INSERT INTO `baiviets` (`id`, `MaDT`, `tieude`, `img`, `noidung`, `created_at`, `updated_at`) VALUES
(621, 'IPXR', 'Thật không ngoa nếu nói iPhone XR chính là chiếc smartphone độc đáo sở hữu nhiều cái nhất: rẻ nhất, nhiều màu sắc nhất, thời lượng pin khủng nhất.', 'img/Iphone/IPXR/2.jpg', 'iPhone XR cũ được Apple cho ra mắt cùng thời điểm với 2 sản phẩm cao cấp iPhone XS và iPhone XS Max. Dù chiếc smartphone này chỉ thuộc phân khúc tầm trung, giá rẻ tuy nhiên nó lại được đánh giá là nổi bật và thực sư khác biệt so với các dòng sản phẩm trước đó của Apple.', NULL, NULL),
(622, 'IPXR', 'iPhone XR cũ like new sở hữu thiết kế nổi bật cá tính và trẻ trung', 'img/Iphone/IPXR/3.jpg', 'Đặc điểm nổi bật đầu tiên và dễ nhận thấy nhất của iPhone XR chính là các phiên bản màu sắc mà Apple trang bị cho máy. Khác với các sản phẩm trước chỉ có các gam màu trầm, tối giản ở XR nhà Táo đã trang bị cho máy tới hẳn 6 phiên bản màu sắc sống động bao gồm: Đen, trắng, đỏ, xanh dương, vàng và hồng san hô.Về màn hình iPhone XR cũ like new vẫn giữ nguyên thiết kế tai thỏ màn hình LCD 6.1 inch với độ phân giải 1792 x 828 pixel, mật độ điểm ảnh 326 ppi. Vì là sản phẩm giá rẻ nên phần khung viền của máy chỉ được làm bằng nhôm cao cấp và có thiết kế mờ chứ không phải là thép không gỉ như 2 người anh cao cấp của mình.Ngoài ra máy còn được trang bị khả năng kháng bụi và chống nước nhưng chỉ dừng lại ở ngưỡng IP67, thay vì là IP68 như trên iPhone XS.', NULL, NULL),
(623, 'IPXR', 'iPhone XR cũ giá rẻ nhưng được trang bị cấu hình mạnh ', 'img/Iphone/IPXR/4.jpg', 'iPhone XR cũng được Apple trang bị cho con chip A12 Bionic mới nhất như bộ đôi iPhone XS và XS Max. Bộ chip này được đánh giá là có khả năng đem gia tăng hiệu năng thêm 15% và tiết kiệm 40% điện năng so với thế hệ chip A11 Bionic của iPhone X.Việc trang bị cùng con chip với 2 dòng sản phẩm cao cấp giúp iPhone XR sở hữu cấu hình mạnh, hứa hẹn sẽ đem đến cho người dùng nhiều trải nghiệm thú vị.Thời lượng pin của iPhone XR cũ được Apple cải thiện có thể lâu hơn iPhone 8 Plus 1 tiếng 30 phút và đây có thể là chiếc smartphone sở hữu dung lượng pin khủng nhất của nhà Apple từ trước đến nay. ', NULL, NULL),
(624, 'IPXR', 'iPhone XR không có camera kép những vẫn có thể hỗ trợ xóa phông cực đỉnh.', 'img/Iphone/IPXR/5.jpg', 'Camera chính trên iPhone XR có độ phân giải 12MP, khẩu f/1.8. Camera sefile được tích hợp các tính năng gần như tương tự như của iPhone XS với độ phân giải 7MP cho phép mở khóa bằng FaceID nhanh hơn, tính năng chụp ảnh sefile hoàn hảo hơn. ', NULL, NULL),
(625, 'IPSE', 'Thiết kế nhỏ gọn và cao cấp ', 'img/Iphone/IPSE/2.jpg ', 'Điểm khác biệt dễ thấy nhất là logo Apple trên mặt lưng nay đã dời ra chính giữa thay vì đặt lệch ở nửa trên như trên smartphone đàn anh.Bên cạnh sự sang trọng vốn có từ chất liệu kim loại và kính, chiếc điện thoại iPhone mới này cũng có khả năng chống nước tiêu chuẩn IP67 giúp hạn chế rủi ro hư hỏng do văng nước, đi mưa.iPhone SE 2020 vẫn có kích thước 4.7 inch, tỉ lệ màn hình cũ 16:9 và các cạnh viền vẫn dày. Tuy nhiên kích thước chung của máy vẫn thuộc hàng nhỏ gọn, cực kì vừa vặn và dễ sử dụng bằng một tay.Bởi máy vẫn lưu giữ lại thiết kế cũ đến từ các dòng như iPhone 6 và iPhone 7 nên kích thước màn hình sẽ có hơi hạn chế, vì thể bạn cũng có thể xem qua iPhone 14 Plus với màn hình có kích thước tới 6.7 inch.', NULL, NULL),
(626, 'IPSE', 'Sức mạnh đầu bảng, tương tự iPhone 11 ', 'img/Iphone/IPSE/3.jpg ', '“Bình cũ” nhưng “rượu mới”, iPhone SE 2020 sở hữu cấu hình hợp thời và cao cấp với chip Apple A13 mạnh mẽ từng xuất hiện trên thế hệ iPhone 11. Nhờ sử dụng con chip cao cấp, thiết bị cũng hỗ trợ công nghệ Wi-Fi 6 và Gigabit LTE cho khả năng kết nối mạng cực nhanh và ổn định.Cho đến năm 2022 thì con chip Apple A16 Bionic trên iPhone 14 Pro Max được mệnh danh là vi xử lý thống lĩnh trên thị trường điện thoại với cấu hình mang lại là cực kỳ mạnh mẽ.Thông số đo từ AnTuTu cho là 364.049 - trải nghiệm tác vụ hằng ngày cực kì mượt và không có độ trễ. Bạn có thể chơi thoải mái các game LOL Mobile, Gunny Mobile,... mà không lo lag máy. ', NULL, NULL),
(627, 'IP14PROMAX', 'Kiểu dáng sang trọng, notch “tai thỏ” biến mất ', 'img/Iphone/IP14PROMAX/2.jpg', 'iPhone 14 Pro Max 1TB sở hữu ngoại hình với thiết kế vuông vức trứ danh giống như iPhone 13 nhưng trở lại với thân hình nay còn mảnh mai hơn nữa. Các màu sắc mới như… càng tô lên thêm vẻ đẹp sang trọng, tinh tế vốn có của Nhìn chung, iPhone 14 Pro Max 1TB sẽ gây ấn tượng mạnh với bất cứ ai nhìn vào sản phẩm.Điểm đặc biệt mà Apple lần này đem đến cho thiết bị chính là việc phần notch sau bao năm tháng đã chính thức bị “khai tử”, thay vào đó là một thiết kế hình viên thuốc con nhộng nằm ngang mang một vẻ đẹp hoàn toàn mới mẻ cho dòng iPhone này. Bên cạnh đó, iPhone 14 Pro Max 1TB trang bị chuẩn kháng nước và bụi bẩn quen thuộc IP68, đảm bảo điện thoại vẫn hoạt động tốt trong nhiều tình huống thời tiết khác nhau.Thiết kế notch con nhộng giúp mở rộng không gian hiển thị so với thân máy hơn 90% với khung hình rộng rãi - 20:9. Mặt trước của điện thoại được bảo vệ bằng chất liệu Ceramic Shield hay còn được gọi là tấm chắn Gốm, đồng thời tích hợp thêm kính cường lực Gorilla Glass giúp bảo vệ smartphone khỏi những va chạm không muốn có. ', NULL, NULL),
(628, 'IP14PROMAX', 'Notch hình viên thuốc mang tên Dynamic Island ', 'img/Iphone/IP14PROMAX/3.jpg', 'iPhone 14 Pro Max 1TB cho ra mắt tính năng Dynamic Island hoàn toàn có thể “đổi đời” trải nghiệm thiết bị của bạn. Phần notch giờ đây không còn đơn giản chỉ là một chiếc notch bình thường, “bất động” nữa. Tính năng Dynamic Island sẽ cung cấp cho người dùng theo dõi hiển thị cuộc gọi đến, dẫn đường GPS, Face ID, đặt lịch hẹn giờ hay những phần mềm thường xuyên sử dụng khác của riêng bạn. Tinh chỉnh các app đang sử dụng một cách dễ dàng và tiện lợi hơn. ', NULL, NULL),
(629, 'IP14PROMAX', 'Tấm nền cao cấp cùng tần số quét 120Hz ', 'img/Iphone/IP14PROMAX/4.jpg', 'iPhone 14 Pro Max 1TB đem đến màn hình OLED LTPO với công nghệ Super Retina XDR - ProMotion hiện đại bậc nhất. Màn hình có kích thước không đổi so với dòng iPhone 13 Pro Max ra mắt vào năm 2021 - 6.7 inch. Mật độ điểm ảnh ở mức 460 ppi và tần số làm mới cao chạm ngưỡng 120Hz.Một tính năng có thể xem là mới xuất hiện trên iPhone 14 Series nhưng không còn xa lạ đối với dòng Apple Watch - Đó chính là chế độ màn hình Always On (Luôn bật) sử dụng dựa trên thuật toán AI hỗ trợ hiển thị thông tin dữ liệu trên màn hình khoá mà vẫn tiết kiệm năng lượng, giảm thiểu mức độ tiêu hao lên đến 15%. ', NULL, NULL),
(630, 'IP14PROMAX', 'Cấu hình có sức mạnh “khủng” ', 'img/Iphone/IP14PROMAX/5.jpg', 'Thiết bị có RAM 6GB LPDDR5 “đánh bay” các hiện tượng đơ, giật lag khi sử dụng. Bộ nhớ trong ở phiên bản này nằm ở mức cao nhất lên đến 1TB. Không gian lưu trữ các dữ liệu cá nhân phải nói là “ngút ngàn”, tất cả những tài liệu làm việc, hình ảnh, video cá nhân hay những phần mềm nặng đô đòi hỏi ROM lưu trữ cao đều có thể nằm gọn trong chiếc iPhone 14 Pro Max 1TB. ', NULL, NULL),
(631, 'IP14PROMAX', 'Đắm chìm trong những hình ảnh đầy chân thực', 'img/Iphone/IP14PROMAX/6.jpg', 'Camera của iPhone 14 Pro Max 1TB một lần nữa khuấy động làng công nghệ với sự nâng cấp vượt trội từ cụm camera với 3 ống kính được ví như 3 viên ngọc trân châu quý giá. Độ phân giải chính 48MP với kích thước có thể thấy là lớn hơn cả so với iPhone 13 Pro Max tiền nhiệm ra mắt một năm trước đó, dẫn đến việc điện thoại sẽ có độ dày hơn khoảng 0.2mm.Các cảm biến chính trong camera bao gồm camera góc siêu rộng cùng với camera tele và cảm biến LiDAR với các tính năng chụp ảnh hữu ích như chế độ Night Mode, HDR, Panorama, Timelapse,…cho phép người dùng sở hữu những bức hình và video có độ phân giải nâng từ 4K thành 8K - Tăng gấp 4 lần lên so với camera cũ. Vì thế mà ai trong chúng ta đều trở thành các “phó nháy” bắt trọn từng khoảnh khắc chuyên nghiệp.', NULL, NULL),
(632, 'IP14PRO', 'iPhone 14 Pro 1TB - chiếc iPhone đáng mua nhất năm 2022', 'img/Iphone/IP14PRO/2.jpg', 'iPhone 14 Pro 1TB được xem là chiếc iPhone đáng mua nhất trong năm trong năm 2022 vì có thể đáp ứng tốt hầu hết mọi nhu cầu của người dùng từ cơ bản đến nâng cao. Với sự nâng cấp mạnh mẽ về mặt phần cứng với camera lên đến 48MP, bộ nhớ trong 1TB, màn hình thiết kế mới hứa hẹn sẽ mang lại trải nghiệm vô cùng tuyệt vời đến người dùng.', NULL, NULL),
(633, 'IP14PRO', 'Hình ảnh sắc nét - trải nghiệm mượt mà với tần số quét 120Hz', 'img/Iphone/IP14PRO/3.jpg', 'Màn hình iPhone 14 Pro 1TB được Apple thay đổi hoàn toàn với phần viền màn hình được làm mỏng đều ở 4 cạnh, đi kèm với phần notch được thiết kế hình giọt nước thay vì tai thỏ như trên các phiên bản tiền nhiệm. Sự thay đổi này mang lại cho người dùng trải nghiệm hình ảnh tốt hơn, không gian rộng rãi hơn cũng như “sexy” hơn khi so với các dòng flagship khác.Chiếc máy vẫn sẽ được trang bị tấm nền OLED với kích thước 6.1 inch độ phân giải 1179 x 2556 Pixels, hỗ trợ dải màu rộng P3 mang lại hình ảnh vô cùng sắc nét, màu sắc chân thực khiến người dùng phải choáng ngợp. Đi cùng với đó là độ tương phản cao giúp các chi tiết trên ảnh / video càng trở nên tự nhiên, sống động cuốn hút mọi ánh nhìn.Một trong những nâng cấp đáng giá nhất trên iPhone 13 Pro đó là được trang bị màn hình 120Hz với công nghệ LTPO giúp màn hình tự điều chỉnh tần số quét từ 10Hz - 120Hz để tiết kiệm pin. Trên iPhone 14 Pro, Apple đã điều chỉnh nó xuống thấp hơn nữa là từ 1Hz - 120hz. Điều này giúp chiếc máy có thể tiết kiệm pin hơn nữa cũng như mang lại khả năng vuốt chạm mượt mà trong mọi ứng dụng / tác vụ mà người dùng sử dụng', NULL, NULL),
(634, 'IP14PRO', 'Thỏa sức sáng tạo với cụm camera 48MP', 'img/Iphone/IP14PRO/4.jpg', 'iPhone 14 Pro 1TB vẫn sẽ được trang bị cụm 3 camera gồm: camera góc rộng 48MP, camera góc siêu rộng 12MP và camera tele 12MP. Với cấu hình phần cứng khủng, chiếc máy sẽ mang lại cho người dùng nhiều bức ảnh chụp vô cùng tuyệt vời. Camera trên iPhone 14 Pro 1TB đã được Apple nâng cấp với độ phân giải 48MP thay vì 12MP trên các phiên bản tiền nhiệm. Đây là một sự cải tiến lớn vô cùng đáng giá kể từ thời iPhone 6 đến nay. Với độ phân giải cao hơn, chiếc máy hứa hẹn sẽ mang lại cho người dùng những bức ảnh chân thực, sắc nét giúp mọi người có thể thỏa sức sáng tạo mọi lúc, mọi nơi.Bên cạnh những tính năng liên quan đến chụp ảnh, khả năng quay video vẫn là một trong những thế mạnh của iPhone từ xưa đến nay. Việc trang bị cảm biến lớn cùng độ phân giải cao, kết hợp với sự tối ưu từ phần mềm sẽ mang lại những thước phim đậm chất điện ảnh. Từ đó giúp người dùng có thể lưu trữ mọi khoảnh khắc đáng nhớ nhất trong mỗi hành trình, mỗi chuyến đi…', NULL, NULL),
(635, 'IP14PRO', 'Hiệu năng vượt trội với Apple A16 Bionic', 'img/Iphone/IP14PRO/5.jpg', 'iPhone 14 Pro 1TB sở hữu hiệu năng mạnh mẽ từ con chip mới nhất của mình là Apple A16 Bionic. Đây là vi xử lý được sản xuất dựa trên tiến trình 4nm mới nhất với hơn 15 tỷ bóng bán dẫn mang lại hiệu năng mạnh mẽ nhưng vẫn đảm bảo tiết kiệm năng lượng cho chiếc máy. Theo Apple, A16 Bionic cho khả năng xử lý nhanh hơn 40% khi so với A15 Bionic trên iPhone 13 Pro, khả năng xử lý đồ họa cũng nhanh hơn 30%.Với hiệu năng mạnh mẽ, iPhone 14 Pro 1TB chắc chắn sẽ mang lại trải nghiệm giải trí tuyệt vời cho người dùng. Cụ thể, người dùng có thể chơi tốt hầu hết các tựa game nặng trên thị trường hiện nay như: Genshin Impact, PUBG Mobile, Liên quân Mobile… ở mức thiết lập đồ họa cao nhất mà không gặp tình trạng bị drop FPS khi đang chơi, mang lại trải nghiệm giải trí hoàn hảo.Ngoài ra, với dung lượng bộ nhớ trong lên đến 1TB, mang lại không gian lưu trữ khổng lồ giúp người dùng thoải mái lưu trữ kho hình ảnh, video cá nhân, ứng dụng mà không cần lo lắng về tình trạng quá tải bộ nhớ. Tuy nhiên, đối với những người dùng cơ bản không cần bộ nhớ trong quá cao thì có thể tham khảo thêm chiếc điện thoại iPhone 14 Pro 128GB để có mức giá hợp lí hơn cũng như phù hợp với nhu cầu của mình.', NULL, NULL),
(636, 'IP14PRO', 'Ngoại hình nhỏ gọn, cao cấp', 'img/Iphone/IP14PRO/6.jpg', 'Ngoại hình iPhone 14 Pro 1TB nhìn chung vẫn không có quá nhiều sự thay đổi so với thế hệ tiền nhiệm. Vẫn là khung viền thép không gỉ với thiết kế vuông vắn mang lại cảm giác sang trọng và vô cùng cao cấp. Điểm khác biệt mà người dùng dễ nhận ra nhất là phần màn hình và cụm camera nay đã được thay đổi với thiết kế mới lạ hơn.Chiếc máy vẫn sẽ được trang bị chuẩn kháng nước, kháng bụi IP68 giúp người dùng có thể tự tin sử dụng ở bất kì đâu với bất kì điều kiện môi trường khác nhau từ công trường bụi bặm, đi mưa… mà không lo nước và bụi xâm nhập gây tổn hại đến các chi tiết bên trong.', NULL, NULL),
(637, 'IP14', 'iPhone 14 128GB - Thiết kế mới lạ, hiệu năng vượt trội', 'img/Iphone/IP14/2.jpg', 'iPhone 14 128GB vừa qua đã được ra mắt lại tiếp tục làm khuấy động thị trường smartphone và được đông đảo iFan săn đón nhiệt tình. Siêu phẩm iPhone 14 có nhiều cải tiến về thiết kế cũng như hiệu năng mang đến nhiều trải nghiệm thú vị cho người dùng.', NULL, NULL),
(638, 'IP14', 'Thiết kế có nhiều thay đổi, mặt trước sang hơn', 'img/Iphone/IP14/3.jpg', 'Ở phiên bản iPhone 14 128GB có thiết kế có nhiều khác biệt so với thế hệ trước. Phiên bản này vẫn sở hữu ngoại hình với những điểm nổi bật như những người đàn anh trước đây. Với trọng lượng chỉ vỏn vẹn 172g, được thiết kế nguyên khối mang đến cho người dùng một thiết kế nhỏ gọn, tiện lợi khi sử dụng.Với thiết kế khung viền phẳng, cùng với bốn góc bo tròn sẽ mang đến cảm giác cầm nắm thoải mái, chắc chắn hơn. Đồng thời, năm nay nhà Apple cũng trang bị đa dạng màu sắc trẻ trung, năng động như: Đen (Midnight), Trắng ( Starlight) , Đỏ ( Product Red), Xanh dương (Blue), Tím (Purple). Cho người dùng thoải mái lựa chọn màu sắc phù hợp với cá tính và sở thích của bản thân.', NULL, NULL),
(639, 'IP14', 'Hiệu năng vượt trội nhờ chip Apple A15 Bionic', 'img/Iphone/IP14/4.jpg', 'Con chip Apple A15 Bionic siêu mạnh được sản xuất trên quy trình 5nm giúp iPhone 14 đạt hiệu năng ấn tượng khi GPU lên tới 35% và CPU lên tới 42% so với tiền nhiệm.Nhờ hiệu năng được cải tiến, người dùng có được những trải nghiệm tốt hơn trên điện thoại khi dùng các ứng dụng chỉnh sửa ảnh hay chiến các tựa game đồ họa cao mượt mà.Bên cạnh đó, bộ nhớ RAM được cải tiến lên đến 6GB cho người dùng trải nghiệm đa nhiệm một lúc nhiều chương trình không lo bị giật, lag. Ngoài ra, iPhone 14 còn được trang bị bộ nhớ trong dung lượng 128GB lý tưởng cho phép bạn thỏa thích lưu trữ mọi nội dung theo ý muốn mà không lo nhanh đầy bộ nhớ.', NULL, NULL),
(640, 'IP14', 'Sử dụng hệ điều hành iOS 16 mới nhất', 'img/Iphone/IP14/5.jpg', 'iPhone 14 128GB được trang bị phiên bản hệ điều hành iOS 16 mới nhất với bố cục hiển thị được tùy biến lại theo hướng cá nhân hóa, gọn gàng hơn so với phiên bản trước đó. Người dùng cũng có thể trải nghiệm một tay dễ dàng hơn khi thanh thông báo đã được dời xuống phía dưới màn hình.', NULL, NULL),
(641, 'IP14', 'Tốc độ 5G tốt hơn', 'img/Iphone/IP14/6.jpg', 'Mạng 5G được cải thiện chất lượng với nhiều băng tần hơn, với 5G giúp điện thoại xem trực tuyến hay tải xuống các ứng dụng và tài liệu đều đạt tốc độ nhanh chóng. Không chỉ vậy, siêu phẩm mới này còn có chế độ dữ liệu thông minh, tự động phát hiện và giảm tải tốc độ mạng để tiết kiệm năng lượng khi không cần dùng tốc độ cao.', NULL, NULL),
(642, 'IP14', 'Màn hình Super Retina XDR độ sáng cao, tiết kiệm pin', 'img/Iphone/IP14/7.jpg', 'iPhone 14 128GB sử dụng tấm nền OLED với kích thước màn hình 6.1 inch cho chất lượng màu sắc và chi tiết hình ảnh sắc nét, sống động, độ phân giải đạt 1170 x 2532 Pixels.Công nghệ màn hình Super Retina XDR của máy đạt độ sáng 800 nits, tối đa lên đến 1200 nits cùng dải màu rộng P3, tỷ lệ tương phản lớn giúp ổn định tốt màu sắc và chất lượng hình ảnh hiển thị trong nhiều điều kiện chiếu sáng, kể cả môi trường nắng gắt hay ánh sáng chói.', NULL, NULL),
(643, 'IP14', 'Cụm camera kép mang lại những hình ảnh cực kỳ sắc nét', 'img/Iphone/IP14/8.jpg', 'Thiết kế cụm camera của iPhone 14 128GB vẫn được giữ nguyên thiết kế như iPhone 13 128GB. Nhưng chất lượng hình ảnh lại được nâng cao vượt trội với việc được hỗ trợ nhiều tính năng hỗ trợ chụp ban đêm cực rõ và sắc nét.Với bộ đôi camera sau ở hữu độ phân giải 12MP, khẩu độ f/1.5 tích hợp tính năng AutoFocus hỗ trợ camera chính thu được nhiều ánh sáng hơn. Với camera góc rộng cho góc nhìn 120 độ giúp thu được nhiều chi tiết hơn, dễ dàng ghi lại những khung cảnh núi non hùng vĩ, ảnh chụp nhóm đông người.Bên cạnh đó, camera trước có độ phân giải 12MP cùng với các công nghệ chụp ảnh chuyên nghiệp như hiệu ứng bokeh, chế độ điện ảnh, Animoji và Memoji để bạn tự tin thể hiện mình trước ống kính, không lo lắng che giấu khuyết điểm.', NULL, NULL),
(644, 'IP13PROMAX', 'iPhone 13 Pro Max 1TB - Bản nâng cấp với nhiều tính năng thú vị đến từ Apple', 'img/Iphone/IP13PROMAX/2.jpg', 'iPhone 13 Pro Max 1TB là dòng smartphone cao cấp nhất của Apple vừa được ra mắt tại sự kiện Apple Event. Máy có thiết kế vuông vức, màn hình 6.7 inch OLED 120Hz, bộ vi xử lý mạnh mẽ Apple A15 Bionic cùng bộ 3 camera siêu sắc nét.', NULL, NULL),
(645, 'IP13PROMAX', 'Bộ ba camera tiên tiến nhất trên iPhone', 'img/Iphone/IP13PROMAX/3.jpg', 'Điện thoại iPhone 13 Pro Max Pro Max 1TB sẽ có cụm camera với thiết kế to hơn, lồi hơn 1 chút so với phiên bản tiền nhiệm. Tương tư với dòng iPhone 12 Pro Max, sản phẩm cũng sở hữu hệ thống 3 camera bao gồm: camera góc rộng, camera góc siêu rộng cùng camera tele cùng độ phân giải 12MP và cảm biến LiDAR.Với cảm biến và ống kính mới cho cả ba camera phía sau, kết hợp với sự tối ưu từ iOS 15 và bộ xử lý tín hiệu hình ảnh (ISP) trong vi xử lý A15 Bionic sẽ giúp chiếc máy cải thiện khả năng khử nhiễu, cân bằng trắng cũng như ánh sáng trên bức ảnh tốt hơn. Từ đó giúp người dùng chụp ra được những bức ảnh có màu sắc đẹp hơn, chân thật hơn.Bên cạnh đó, nhờ khẩu độ lớn hơn giúp cảm biến thu được nhiều ánh sáng hơn từ đó giúp người dùng có thể chụp những bức ảnh kể cả trong điều kiện thiếu sáng. Kết hợp với tính năng Night Mode trên sản phẩm sẽ giúp người dùng có thể thoải mái sáng tạo trong mọi điều kiện ánh sáng khác nhau.', NULL, NULL),
(646, 'IP13PROMAX', 'Apple A15 Bionic với 5 nhân GPU cho hiệu năng mạnh mẽ nhất trong phân khúc', 'img/Iphone/IP13PROMAX/4.jpg', 'iPhone 13 Pro Max 1TB sở hữu hiệu năng đứng đầu thị trường smartphone hiện nay với vi xử lý Apple A15 Bionic dược sản xuất dựa trên tiến trình 5nm. A15 Bionic có 6 nhân CPU với hai nhân hiệu suất cao mới và bốn nhân tiết kiệm điện năng, GPU 5 nhân cho tốc độ xử lý nhanh hơn 20% khi so với phiên bản tiền nhiệm.hiện hơn. Giúp những tác vụ liên quan đến máy học như Live text, Emoji, sạc pin,... trở nên tối ưu hơn.Điện thoại iPhone 13 Pro Max 1TB có thể cân hầu hết mọi tựa game nặng trên thị trường như PUBG Mobile, Genshin Impact, COD Online một cách mượt mà với cấu hình đồ họa ở mức cài đặt cao nhất. Kết hợp với màn hình 120Hz sẽ mang lại cho người dùng trải nghiệm giải trí, chơi game vô cùng tuyệt vời.', NULL, NULL),
(647, 'IP13PROMAX', 'Màn hình 6.7inch Super Retina XDR cùng công nghệ ProMotion', 'img/Iphone/IP13PROMAX/5.jpg', 'Giống với “đàn anh” iPhone 12 Pro Max của mình, chiếc iPhone 13 Pro Max lần này cũng sở hữu kích thước màn hình 6.7 inch nhưng sẽ vượt trội hơn về công nghệ màn hình và tần số quét. Cụ thể. iPhone 13 Pro Max 1TB sẽ được trang bị màn hình 6.7 inch OLED với công nghệ Super Retina XDR, độ phân giải 1284 x 2778 pixels.Đi kèm với đó là công nghệ ProMotion tương tự với dòng iPad Pro ở thời điểm hiện tại. Công nghệ này giúp màn hình trên chiếc iPhone có tốc độ làm tươi từ 1 - 120Hz giúp màn hình tự động điều chỉnh tốc độ làm tươi phù hợp với ứng dụng mà người dùng đang sử dụng giúp tiết kiệm pin hơn cho thiết bị.Đây cũng là màn hình sáng nhất từng có trên iPhone với độ sáng tối đa ngoài trời cao hơn tới 25% so với thế hệ tiền nhiệm. Độ sáng cao nhất ở mức 1000 nits, vì vậy người dùng sẽ trải nghiệm độ phân giải, màu sắc và độ tương phản đáng kinh ngạc cho dù tình cờ lướt web hay xem video HDR.', NULL, NULL),
(648, 'IP13PROMAX', 'Thiết kế sang trọng, cao cấp trên iPhone 13 Pro Max 1TB', 'img/Iphone/IP13PROMAX/6.jpg', 'iPhone 13 Pro Max 1TB sẽ có thiết kế tương tự như dòng sản phẩm tiền nhiệm của mình là dòng iPhone 12 Pro series. Máy sẽ có thiết kế cạnh phẳng vuông vức với phần khung viền được làm từ thép không gỉ, mặt lưng được trang bị kính cường lực Ceramic Shield.Máy vẫn sẽ được tích hợp công nghệ bảo mật Face ID ở mặt trước với phần notch được làm nhỏ đi, camera TrueDepth 12MP. Máy vẫn sẽ đạt được chứng chỉ IP68 với khả năng kháng nước, bụi bẩn giúp người dùng yên tâm hơn khi sử dụng. Máy sẽ có 4 phiên bản màu sắc với 3 màu sắc quen thuộc là vàng, xám, trắng và màu xanh lam hoàn toàn mới.', NULL, NULL),
(649, 'IP13PROMAX', 'Hỗ trợ tốt hơn cho 5G', 'img/Iphone/IP13PROMAX/7.jpg', 'iPhone 13 Pro Max 1TB có thiết kế phần cứng với nhiều băng tần 5G hơn, giúp sản phẩm có thể hoạt động ở nhiều nơi hỗ trợ 5G giúp máy có thể dễ dàng kết nối cũng như đạt được chất lượng cuộc gọi cao hơn. Kết hợp với đó là tính năng Dự liệu thông minh sẽ giúp chiếc iPhone tiết kiệm pin hơn bằng cách tự động chuyển iPhone sang LTE khi không cần đến tốc độ 5G.Nếu quý khách không có nhu cầu sử dụng nhiều bộ nhớ trong, thì phiên bản iPhone 13 Pro Max 128Gb là lựa chọn tối ưu nhất cho mình nhé !', NULL, NULL),
(650, 'IP13PRO', 'Thiết kế “truyền thống” với nhiều màu sắc mới nổi bật', 'img/Iphone/IP13PRO/2.jpg', 'Với thiết kế tổng thể tương tự như dòng iPhone 12, chiếc iPhone 13 Pro 128GB lần này cũng có kiểu dáng vuông vức, cứng cáp thay vì sử dụng khung viền được bo tròn mềm mại. Nhiều ý kiến cho rằng Apple đang “quay ngược quá khứ” về lại dạng thiết kế của iPhone 4 trước đây. Bên cạnh đó, iPhone 13 Pro 128GB dày hơn 0.26mm so với độ dày của iPhone 12. Hơn nữa, iPhone 13 Pro cũng sẽ có phần notch tai thỏ nhỏ hơn so với iPhone 12.Màu sắc của chiếc iPhone mới này cũng khiến nhiều người thích thú vì có tận 5 phiên bản màu sắc khác nhau. iPhone 13 Pro series lần này sẽ có sự xuất hiện của những màu sắc mới bên cạnh những màu sắc cũ như trắng, đen,...', NULL, NULL),
(651, 'IP13PRO', 'Màn hình 120Hz cùng cụm camera được nâng cấp tối ưu', 'img/Iphone/IP13PRO/3.jpg', 'Màn hình iPhone 13 Pro 128GB Xanh lá sẽ có kích thước tương tự với “đàn anh” iPhone 12 Pro của mình là 6.1 inch. Và trang bị ông nghệ Super Retina XDR, đi kèm với tấm nền OLED cùng mật độ điểm ảnh lên đến 460 ppi.Màn hình của dòng iPhone 13 Pro sẽ hỗ trợ tần số quét 120Hz thích ứng, có thể thay đổi từ 1Hz - 120Hz tùy thuộc vào nội dung đang hiển thị. Lợi ích của màn hình 120Hz là nó sẽ mang lại cảm giác cuộn mượt mà hơn cũng như trải nghiệm chơi game tốt hơn cho người dùng.Camera của chiếc iPhone này cũng được Apple chú trọng nâng cấp với khả năng tự động lấy nét cực tốt giúp người dùng có thể chụp ảnh cận cảnh rõ nét hơn. Nó còn được nâng cấp cảm biến LiDAR thế hệ thứ 2 hỗ trợ chế độ chụp chân dung ban đêm, quay video chân dung, lấy nét nhanh hơn trong điều kiện ánh sáng yếu. ', NULL, NULL),
(652, 'IP13PRO', 'Chip A15 Bionic tiết kiệm pin, kết nối 5G mạnh mẽ', 'img/Iphone/IP13PRO/4.jpg', 'Với con chip mới mạnh mẽ và có hiệu suất được nâng cấp là A15 Bionic, iPhone 13 Pro sẽ có sức mạnh vượt trội hơn. A15 Bionic được TSMC sản xuất trên tiến trình 5nm+ thay vì 5nm như trên A14 Bionic. Con chip này cũng hỗ trợ tốt hơn cho tốc độ làm tươi màn hình cũng như cải thiện về mức tiêu thụ điện năng giúp tiết kiệm pin cho smartphone. Bên cạnh đó, con chip này nhiều khả năng sẽ bao gồm 2 lõi hiệu suất cao và 4 lõi tiết kiệm năng lượng, tương tự như A14 Bionic giúp người dùng có thể chiến game thoải mái mà không lo quá ảnh hưởng đến dung lượng pin hiện có.Apple không phải thương hiệu đầu tiên trang bị kết nối 5G lên sản phẩm của mình. Hãng đang bị các thương hiệu smartphone Android “vượt mặt” trong và Apple sẽ không để điều này tiếp tục xảy ra bằng cách nâng cấp tốc độ kết nối 5G lên mức tối đa.Tốc độ kết nối mạng trên iPhone 13 Pro 128GB cũng sẽ hứa hẹn sẽ vô cùng khủng khiếp. Với kết nối 5G trên điện thoại không chỉ nhanh mà còn thông minh. Khi chiếc điện thoại cần được cập nhật, nó sẽ sử dụng LTE để tiết kiệm pin. Khi tải xuống những ứng dụng, chương trình nặng, điện thoại sẽ chuyển sang chế độ 5G.', NULL, NULL),
(653, 'IP13PRO', 'Dung lượng pin khủng', 'img/Iphone/IP13PRO/5.jpg', 'Ngoài việc cải tiến về hiệu năng thì dung lượng pin trên iPhone 13 Pro sẽ tăng đáng kể so với iPhone 12. Cụ thể iPhone 13 Pro sẽ có viên pin 3.095 mAh, lớn hơn khá nhiều so với viên pin 2.815 mAh trên thế hệ tiền nhiệm.', NULL, NULL),
(654, 'IP13MN', 'Hiệu năng mạnh mẽ hàng đầu', 'img/Iphone/IP13MN/2.jpg', 'iPhone 13 mini được trang bị bộ vi xử lý A15 Bionic sản xuất trên tiến trình 5 nm giúp cải thiện hiệu suất và giảm điện năng tiêu thụ đến 15% so với phiên bản A14 Bionic trước đó, đáp ứng hoàn hảo trong công việc cũng như trong giải trí của người dùng tốt hơn.CPU 6 lõi cho hiệu suất hoạt động tăng 40% cùng với đó là GPU cũng có mức hiệu năng tăng mạnh lên đến 80% so với chipset thế hệ trước. Bạn hoàn toàn có thể chơi game mượt mà, các thao tác chỉnh sửa hình ảnh, cắt ghép video đều vô cùng trơn tru.Máy được đi kèm bộ nhớ trong 128 GB khoảng dung lượng lý tưởng cho bạn có thể lưu trữ một cách thoải mái, đảm bảo đủ không gian để có thể sử dụng lâu dài.Tốc độ internet rất quan trọng trên một chiếc smartphone, khi mà mạng kết nối 5G với những ưu thế vượt trội đang dần phủ sóng khắp toàn cầu, và chiếc iPhone 13 mini này sẽ được Apple tích hợp 5G mang đến cho bạn trải nghiệm internet tuyệt vời nhất.Với tính năng Smart Data, iPhone của bạn sẽ tự động chuyển đổi dữ liệu khi mà bạn không cần dùng đến tốc độ cao nhằm tiết kiệm điện năng đáng kể.', NULL, NULL),
(655, 'IP13MN', 'Khả năng chụp ảnh siêu chân thật', 'img/Iphone/IP13MN/3.jpg', 'Cụm camera sau được thiết kế đặt chéo không chỉ tạo sự khác biệt mà nó còn cải thiện góc chụp đáng kể, cảm biến máy ảnh cũng được làm lớn hơn. Camera chính 12 MP cho khả năng quay chụp sắc nét, khả năng thu sáng cũng được tăng lên 47% so với thế hệ trước, cho ra đời những bức hình, video tuyệt hảo dù bạn chụp vào ban ngày hay ban đêm.', NULL, NULL),
(656, 'IP13MN', 'Thời lượng sử dụng tốt', 'img/Iphone/IP13MN/4.jpg', 'Apple cho biết điện thoại sẽ có thời lượng sử dụng dài hơn phiên bản trước cụ thể là thời gian dùng lâu hơn 1.5 giờ. Chip mới A15 Bionic cùng hệ điều hành iOS 15 cũng sẽ giúp tối ưu và kéo dài thời lượng sử dụng.Ngoài ra, máy còn có sạc nhanh 20 W cùng công nghệ sạc không dây MagSafe hỗ trợ bạn sạc điện thoại tiện lợi và nhanh chóng. Một điều đáng tiếc củ sạc nhanh 20 W sẽ không đi kèm và phải mua riêng.iPhone 13 mini 128GB có một ngoại hình vô cùng nhỏ gọn nhưng mang trong mình một hiệu năng rất mạnh mẽ cùng nhiều tính năng mới hữu ích. Bạn là người yêu thích sự nhỏ gọn và muốn có một hiệu năng mạnh thì đây sẽ là thiết bị hoàn toàn phù hợp dành cho bạn.', NULL, NULL),
(657, 'IP13', 'iPhone 13 128GB - Đem đến những gì tuyệt vời nhất', 'img/Iphone/IP13/2.jpg', 'iPhone 13 128GB lần này cũng sẽ giữ nguyên vẹn vẻ ngoài của dòng iPhone 12 Series với thiết kế các cạnh vuông vức. Nhưng sẽ có vài điểm khác biệt dễ dàng có thể nhận ra, thứ nhất là về độ dày của thiết bị. Điện thoại iPhone 13 128GB sẽ có độ dày hơn khoảng 0,26mm vì được trang bị bên trong một viên pin với dung lượng lớn hơn.Điểm tiếp theo là việc Apple sẽ thu nhỏ kích thước notch thông qua cách kết hợp đèn chiếu sáng hồng ngoại, cảm biến và máy chiếu điểm hiện đang được tách biệt, tạo nên hệ thống mở khóa Face ID của iPhone 12 vào một mô-đun duy nhất. Phần notch nhỏ hơn có thể nói rằng là do kích thước khuôn của chip VCSEL sử dụng trong máy quét Face ID sẽ giảm tới 50% cho ra một con chip Face ID nhỏ hơn.', NULL, NULL),
(658, 'IP13', 'Màn hình Super Retina XDR OLED cao cấp', 'img/Iphone/IP13/3.jpg', 'iPhone 13 128GB được trang bị màn hình Super Retina XDR OLED được cải tiến mang lại tỷ lệ tương phản đáng kinh ngạc cho màu đen sâu và tăng 28% độ sáng tối đa ngoài trời ở 800 nits, với độ sáng cao nhất cho nội dung HDR như ảnh và video ở 1200 nits, đồng thời tiết kiệm điện hơn.Đây vẫn là màn hình OLED, hỗ trợ dải màu rộng, Apple cho rằng hình ảnh trên iPhone 13 cho cảm giác chân thực nhất, màu sắc chính xác nhất. Hỗ trợ công nghệ Super Renita XDR với mật độ điểm ảnh cao, cho hình ảnh luôn sắc nét. Điểm thay đổi lớn nhất khi tai thỏ rộng hơn (notch nhỏ hơn) giúp người dùng có thêm thông tin khi xem trên màn hình iPhone 13.', NULL, NULL),
(659, 'IP13', 'Phần cứng mạnh mẽ với A15 Bionic', 'img/Iphone/IP13/4.jpg', 'iPhone 13 128GB được trang bị con chip Apple A15 Bionic. Theo Apple, A15 Bionic nhanh hơn nhiều so với các đối thủ khác, mang lại hiệu năng cao hơn và tiết kiệm năng lượng tốt hơn, khiến mọi thứ trở nên trôi chảy hơn trong dòng sản phẩm iPhone 13. chip A15 mới (5nm) - 6 nhân CPU (2 nhận mạnh và 4 nhân tiết kiệm điện. CPU cho hiệu năng nhanh hơn 50%, GPU có 4 nhân, cho hiệu năng đồ hoạ nhanh hơn 30%.A15 cũng hỗ trợ 16 nhân Neural Engine mới hỗ trợ các tác vụ ML, nó hỗ trợ 15,8 triệu tỷ phép tính mỗi giây. Neural Engine sẽ kết hợp giữa CPU và GPU để xử lý các ứng dụng kết hợp với phần mềm tuỳ chỉnh theo thời gian thực, nhanh hơn, ví dụ như các app có liên quan đến AR, hoặc các app có chèn hiệu ứng vào bối cảnh thực tế,...', NULL, NULL),
(660, 'IP13', 'Hệ thống camera kép tiên tiến nhất trên iPhone', 'img/Iphone/IP13/5.jpg', 'iPhone 13 128GB được trang bị hai cụm camera đặt xéo với camera rộng và góc siêu rộng. Camera chính 12MP f/1.6, cảm biến lớn hơn, thu sáng nhiều hơn 47% cũng như ít noise hơn. Camera còn có thêm tính năng chống rung cảm biến (Sensor-shift OIS) vốn có trên dòng Max của năm ngoái, ảnh chụp và video sẽ có nhiều chi tiết hơn.Apple giới thiệu thêm tính năng Cinematic Mode - giúp người dùng quay video như các bộ phim điện ảnh với tính năng làm mờ hậu cảnh khi quay để có chiều sâu hơn. Đặc biệt là khả năng lấy nét chuyển giao giữa hai vật thể trong thời gian thực để tạo cảm giác chú ý hơn.', NULL, NULL),
(661, 'IP13', 'Nâng cấp ở thời lượng sử dung pin của iPhone 13', 'img/Iphone/IP13/6.jpg', 'iPhone 13 128GB với viên pin mới được nâng cấp hơn lần này sẽ cung cấp cho người dùng một dung lượng pin tăng lên đáng kể với dung lượng dự đoán nằm ở mức 3095mAh. Nhờ vào con chip A15 Bionic mới mà thời lượng pin của iPhone 13 128GB sẽ được cải thiện so với iPhone 12 truóc đó. Cụ thể Apple công bố rằng iPhone 13 sẽ cho thời lượng sử dụng pin nhiều hơn 2,5 giờ so với iPhone 12.', NULL, NULL),
(662, 'IP12PROMAX', 'Thiết kế tạo nên chuẩn mực mới', 'img/Iphone/IP12PROMAX/2.jpg', 'Ngôn ngữ thiết kế của iPhone 12 Pro Max 512GB chính hãng được thay đổi so với người tiền nhiệm, giúp máy đẹp hơn đáng kể. Thay vì sử dụng khung viền được bo tròn mềm mại, máy chuyển sang phần khung có cạnh phẳng vuông vức hơn. Nhiều ý kiến cho rằng Apple đang “quay ngược quá khứ” về lại dạng thiết kế của iPhone 4 trước đây.', NULL, NULL),
(663, 'IP12PROMAX', 'Cấu hình mạnh nhất thế giới smartphone', 'img/Iphone/IP12PROMAX/3.jpg', 'Bộ vi xử lý Apple A13 Bionic trước đó trên iPhone 11 Series vốn đã vô cùng mạnh mẽ, hiệu năng lẫn khả năng chụp ảnh vẫn thuộc hàng “bá đạo” nhất hiện nay. Tuy nhiên, vi xử lý mới Apple A14 Bionic sẽ đưa iPhone 12 Pro Max 512GB lên một tầm cao mới.Với bộ xử lý mới, điện thoại Apple iPhone 12 Pro Max 512GB sẽ chạy tốt đa nhiệm. Không những vậy, máy sẽ chiến tốt các game trên thị trường, kể cả các game dung lượng cao. Ngoài ra, bộ nhớ 512GB cũng mang đến không gian lưu trữ tối đa cho người dùng.', NULL, NULL),
(664, 'IP12PROMAX', 'Hệ thống camera đỉnh cao', 'img/Iphone/IP12PROMAX/4.jpg', 'Bộ ba ống kính camera hiện tại của iPhone 2019 Series bao gồm camera chính, góc siêu rộng và ống kính tele được áp dụng cho mẫu iPhone 12 Pro Max 512GB. Các cảm biến cùng độ phân giải 12MP sẽ giúp các bức ảnh được chụp với chất lượng tốt nhất.', NULL, NULL),
(665, 'IP12PROMAX', 'Màn hình OLED siêu sắc nét', 'img/Iphone/IP12PROMAX/5.jpg', 'Màn hình trên siêu phẩm này có kích thước 6.7 inch, tai thỏ là nơi chứa camera trước và các cảm biến Face ID được đặt trong phần “tai thỏ”. Tuy nhiên với iPhone 12 Pro Max, Apple đã có sự tinh chỉnh để tăng tối đa diện tích hiển thị. Màn hình này sẽ có chất lượng hiển thị tốt, với màu sắc rực rỡ và chi tiết nhất.', NULL, NULL),
(666, 'IP12PROMAX', 'Đánh giá thời lượng sử dụng pin trên iPhone 12 Pro Max 512GB', 'img/Iphone/IP12PROMAX/6.jpg', 'Dung lượng pin luôn là bí ẩn với những chiếc iPhone, thậm chí là cả iPhone 11 Series. Apple gần như không bao giờ công bố dung lượng pin iPhone, phải cho đến khi các hệ thống đánh giá can thiệp sâu thì mới có.Tuy vậy, qua mỗi thế hệ, Apple luôn có sự nâng cấp về dung lượng pin mặc dù khá nhỏ. Do đó, với điện thoại iPhone 12 Pro Max 512GB, máy vẫn sẽ đảm bảo thời lượng pin lâu tối đa cho người dùng.', NULL, NULL),
(667, 'IP12PRO', 'Điện thoại iPhone 12 Pro 128GB - Thiết kế sang trọng, hiệu năng mạnh', 'img/Iphone/IP12PRO/2.jpg', 'iPhone 12 Pro 128GB là mẫu flagship cao cấp của Apple đi cùng nhiều nâng cấp vượt trội. Không chỉ đi cùng thiết kế mới lạ, đẹp mắt cùng hiệu năng khủng, model này còn sở hữu hàng loạt tính năng cao cấp.Thuộc dòng flaghip cao cấp của hãng với chip Apple A14 cùng tiến trình sản xuất 5nm chắc chắn iPhone 12 Pro 128GB sẽ là mẫu smartphone đáng sở hữu nhất năm nay của Apple. Cùng tìm hiểu chi tiết về model này ngay bên dưới đây nhé!', NULL, NULL),
(668, 'IP12PRO', 'Thiết kế', 'img/Iphone/IP12PRO/3.jpg', 'Có thể dễ dàng nhận thấy sự khác biệt lớn nhất chính là phần cạnh viền. Thay vì được bo cong mềm mại như thế hệ trước thì iPhone 12 Pro 128GB năm nay lại đi cùng cạnh phẳng vuông vắn như trên iPad Pro 2020 của hãng. Điều này khiến thiết bị trở nên nam tính và mạnh mẽ hơn nhưng cũng rất sang trọng và đẹp mắt.Mặt trước, máy vẫn giữ nguyên thiết kế tai thỏ thỏ truyền thống cùng lớp kính cường lực cao cấp như trên thế hệ iPhone 11. Tuy nhiên, năm nay Apple đã sử dụng lớp kính có chất liệu tốt hơn rất nhiều nên không chỉ đảm bảo về yếu tố thẩm mỹ mà còn giúp bảo vệ điện thoại một cách tốt nhất.', NULL, NULL),
(669, 'IP12PRO', 'Màn hình', 'img/Iphone/IP12PRO/4.jpg', 'Mặc dù không phải là model sở hữu màn hình lớn nhất hiện nay nhưng màn hình iPhone 12 Pro 128GB không thể chê vào đâu được. Với tấm nền OLED kích thước 6.1 inch cùng công nghệ True Tone độc đáo hứa hẹn đem tới những trải nghiệm thật hoàn hảo đến cho người dùng.Đặc biệt máy còn đi cùng tần số quét màn hình lên đến 120Hz cho khả năng hiển thị sắc nét, sống động đến từng chi tiết. Không chỉ vậy, việc tinh chỉnh phần notch cùng viền benzel nhỏ và mỏng hơn còn giúp tối ưu diện tích hiển thị một cách tối đa, đem tới không gian màn hình lớn ấn tượng hơn bao giờ hết.', NULL, NULL),
(670, 'IP12PRO', 'Camera', 'img/Iphone/IP12PRO/5.jpg', 'Camera  điện thoại iPhone 12 Pro 128GB vẫn sẽ là cụm camera hình vuông với 4 ống kính cùng độ phân giải 12MP như hế hệ iPhone 11 trước đây. Tuy nhiên, Apple đã trang bị thêm nhiều tính năng mới giúp đem đến những bức hình, đoạn video ấn tượng nhất đến cho người dùng.Theo đó, iPhone 12 Pro 128GB sẽ được tích hợp chế độ chụp đêm trên cả 2 camera cùng thời gian phơi sáng lâu hơn. Điều này giúp máy có thể chụp ra những bức ảnh sắc nét ngay cả trong môi trường thiếu sáng. Bên cạnh đó, hãng cũng tích hợp thêm tính năng Deep Fusion mà trước kia chỉ xuất hiện trên các mẫu iPhone cao cấp nhất.Một trong những nâng cấp ấn tượng chính là cụm camera của máy còn được tích hợp thêm cảm biến LiDAR như trên iPad Pro mà hãng mới cho ra mắt.  Với cảm biến này, người dùng có thể tạo ra được những bức hình, thước phim một cách chân thực bởi cảm biến này có thể scan được kích thước chính xác của vật thể.', NULL, NULL),
(671, 'IP11', 'Mua iPhone 11 64GB Chính Hãng (VN/A) - Giá Giảm Cực Mạnh 2022', 'img/Iphone/IP11/2.jpg', 'iPhone 11 64GB vừa ra mắt nối tiếp danh tiếng của dòng điện thoại nhà Apple. Đây là chiếc điện thoại có mức giá dễ chịu nhất trong bộ ba, nhiều lựa chọn màu sắc hơn cùng với đó là sự cải tiến về phần cứng và máy ảnh. Bộ ba iPhone mà Apple vừa ra mắt gồm iPhone 11, iPhone 11 Pro và iPhone 11 Pro Max. Máy được nâng cấp nhiều tính năng, không chỉ đáp ứng nhu cầu làm việc, học tập mà còn đem lại những giây phút giải trí tuyệt vời cho người dùng.', NULL, NULL),
(672, 'IP11', 'Thiết kế quen thuộc, cụm camera độc đáo, chống nước chuẩn IP68', 'img/Iphone/IP11/3.jpg', 'Về tổng thể, iPhone 11 64GB chính hãng không quá khác biệt so với thế hệ trước. Khung viền được làm từ nhôm sang trọng với hai mặt kính. Máy vẫn giữ lại cụm tai thỏ truyền thống cùng camera selfie True Depth. Viền cạnh khá dày nếu so sánh với phiên bản Pro. Màn hình 6,1 inch được trang bị lớp kính bào vệ chống va đập, xước tốt hơn. Một trong những điểm nhấn của iPhone 11 chính là thiết kế cụm camera đột phá. Cụm camera chính được gom gọn vào khung vuông bên trái cùng với đèn LED. Tuy còn nhiều tranh cãi nhưng thiết kế cụm camera mới này cũng góp phần nhận diện thương hiệu cho loạt điện thoại mới. Bên cạnh vẻ ngoài, Apple còn nâng cấp thêm nhiều về phần cứng khi trang bị thêm một camera góc siêu rộng cho điện thoại. Tuy đánh vào phân khúc giá rẻ tương tự như XR nhưng iPhone 11 vẫn đem lại vẻ sang trọng, đẳng cấp vốn có của dòng điện thoại tên tuổi này. Không những thế, người dùng iPhone 11 64GB lại “đau đầu” với 3 màu sắc mới mẻ bên cạnh các màu truyền thống. Để chốt lại vẻ ngoài hiện đại, rực rỡ của điện thoại, Apple còn trang bị thêm khả năng chống nước đạt chuẩn IP68.', NULL, NULL),
(673, 'IP11', 'Màn hình Liquid Retina 6,1 inch chân thực', 'img/Iphone/IP11/4.jpg', 'Với mức giá mềm hơn, iPhone 11 64GB được trang bị màn hình LCD với kích thước 6,1 inch. Apple sử dụng công nghệ Liquid Retina để đem lại trải nghiệm hình ảnh sắc nét, tái tạo màu sắc một cách chân thật nhất. Dù chỉ là tấm màn LCD nhưng trải nghiệm thị giác mà điện thoại đem lại vẫn xứng đáng với phân khúc của mình. Ánh sáng được điều chỉnh dựa trên môi trường thuận tiện khi sử dụng màn hình liên tục. Tần số quét 120Hz giúp các cử chỉ mượt mà hơn. Ngoài ra, không thể không kể đến các công nghệ quen thuộc như Dolby Vision, HDR10,..góp phần hoàn thiện trải nghiệm thị giác của người dùng.', NULL, NULL),
(674, 'IP11', 'Chip A13 Bionic đứng đầu bảng xếp hạng hiện nay', 'img/Iphone/IP11/5.jpg', 'iPhone 11 64GB chính hãng được trang bị con chip mạnh nhất trong giới smartphone hiện nay: A13 Bionic. Chip được sản xuất trên quy trình 7nm của TSMC giúp đem lại hiệu năng khủng nhưng vẫn góp phần tiết kiệm điện năng từ đó người dùng có thời lượng sử dụng máy dài hơn, khoảng 1 tiếng so với iPhone XR. Theo đó, máy được trang bị 4GB RAM đi kèm với viên pin 3110 mAh. Bên cạnh nâng cấp về hiệu năng, thì đồ họa của máy cũng được trau chuốt hơn. GPU mới được tích hợp đem lại khả năng xử lý đồ họa mạnh mẽ. Các game nặng về hình ảnh được render sắc nét tới từng chi tiết. Tính năng FaceID cũng được cải tiến nhiều về độ nhanh nhạy và sự chính xác. Công nghệ âm thanh Dolly Amos đem đến khả năng tạo âm thanh vòm cho iPhone 11 64GB cho các tín đồ âm thanh. Bộ nhớ trong 64GB không quá lớn nhưng vẫn đáp ứng được nhu cầu làm việc hay giải trí. iPhone 11 sẽ chạy iOS 13 mới nhất và tiếp tục được cập nhật liên tục từ Apple. Công nghệ Wifi 6 được coi sẽ là chuẩn Wifi thế hệ kế tiếp cũng xuất hiện trong lần ra mắt này. Tương tự như năm ngoái, với bộ ba iPhone 11, Apple cũng tung ra hai phiên bản một sims và 2 sims tùy thị trường.', NULL, NULL),
(675, 'IP11', 'Camera góc siêu rộng cùng chế độ Night Mode', 'img/Iphone/IP11/6.jpg', 'Năm nay, người dùng có thiết kế camera gần như đồng điệu trên cả ba thiết bị. Ngay cả iPhone 11 64GB chính hãng cũng được tích hợp cụm camera kép bao gồm: 1 cảm biến góc rộng và góc siêu rộng. Cả hai đều có cùng thông số 12MP, chống rung quang học. Bên cạnh việc nâng cấp cảm biến góc siêu rộng, Apple còn hứa hẹn khả năng chụp ảnh “xịn xò” hơn so với các điện thoại tiền nhiệm. Ngoài các chế độ hiện có, máy còn được trang bị thêm chế độ chụp đêm Night Mode mới. Chỉ cần người dùng sử dụng máy ảnh trong điều kiện ánh sáng yếu, máy sẽ tự động bật chế độ này để đem lại những bức hình ít nhiễu, không thua gì khi chụp bình thường. Khả năng chụp ảnh luôn là thế mạnh của iPhone. Và chiếc điện thoại này cũng không ngoại lệ. Camera selfie True Depth 12MP mặt trước cho phép quay phim Slow-Mo độ phân giải 4K. Ngoài ra, người dùng có thể chuyển sang chế độ selfie góc rộng cho những bức ảnh nhóm cực chất. Cụm camera này hứa hẹn sẽ lưu lại nhiều khoảnh khắc cũng như những thước phim tuyệt vời của bạn.', NULL, NULL),
(676, 'IP12', 'Mua iPhone 12 128GB Chính Hãng VN/A - 2 Camera Cực Đẹp Giá Tốt Nhất', 'img/Iphone/IP12/2.jpg', 'iPhone 12 128GB ra mắt nổi bật với mức giá phải chăng nhưng được tích hợp hàng loạt tính năng cao cấp hấp dẫn. iPhone 12 được đánh giá là điện thoại kế nhiệm iPhone 11 hoàn hảo bởi Apple đã tinh chỉnh khá nhiều chi tiết từ ngoại hình đến cấu hình.', NULL, NULL),
(677, 'IP12', 'Thiết kế mới mẻ mà quen thuộc', 'img/Iphone/IP12/3.jpg', 'Không chỉ riêng iPhone 12 128GB mà năm nay, tất cả các thiết bị đều được hoàn thiện bởi bộ khung vỏ nhôm với cạnh bên được vát phẳng tạo nét khác biệt khi đặt cạnh iPhone 11 năm ngoái. Trong trường hợp bạn là một fan trung thành của dòng điện thoại iPhone chắc hẳn không khó để nhận ra đây là phong cách từng được nhà Táo áp dụng trên iPhone. Tuy nhiên, sự trở lại với phong cách này đã đem đến hiệu quả rõ rệt khi giúp điện thoại iPhone 12 128GB đem tới cảm quan cứng cáp hơn và cao cấp hơn. Tổng thể chiếc điện thoại vẫn cho thấy sự sang trọng với hai mặt kính trước – sau bắt mắt. Phong cách thiết kế này không chỉ đẹp hơn mà còn mang lại trải nghiệm cầm nắm khác biệt hơn.', NULL, NULL),
(678, 'IP12', 'Màu sắc phong phú và độ bền đáng nể', 'img/Iphone/IP12/4.jpg', 'Apple iPhone 12 128GB đem tới nét chấm phá về mặt màu sắc với năm màu sắc gồm xanh navy, đỏ (iPhone 12 PRODUCT RED), đen, xanh mint và trắng. Trong đó, xanh navy là tone màu mới và dự kiến sẽ tạo nên trào lưu mới trong làng di động thời gian tới. Tại sự kiện, đại diện của Apple nhấn mạnh vào bộ khung vỏ nhôm bền nhẹ và mặt kính nanoceramic với khả năng chịu lực tốt. Chủ nhân của iPhone 12 sẽ giảm bớt nỗi lo khi chiếc điện thoại gặp phải sự cố va đập bất ngờ trên màn hình.', NULL, NULL),
(679, 'IP12', 'Sự xuất hiện của công nghệ 5G và MagSafe', 'img/Iphone/IP12/5.jpg', 'Khi mà mạng kết nối 5G với những ưu thế vượt trội 4G LTE đang dần phủ sóng khắp toàn cầu, Apple cũng đón đầu xu thế khi đưa tính năng 5G lên trên iPhone 12 128GB. Công nghệ điều chỉnh dữ liệu thông minh sẽ tự động điều chỉnh giữa kết nối 5G hoặc 4G LTE nhằm đảm bảo tốc độ kết nối luôn nhanh nhạy nhất. Về mặt tính năng, iPhone 12 128GB sở hữu công nghệ nam châm MagSafe trên mặt lưng, giúp chiếc điện thoại có thể sạc không dây nhanh hơn', NULL, NULL),
(680, 'OPPO-A55', 'OPPO A55 phiên bản điện thoại tầm trung nhưng chất lượng cao, thiết kế trẻ trung bắt mắt', 'img/OPPO/OPPO-A55/2.jpg', 'OPPO A55 là mẫu điện thoại tầm trung của OPPO thay thế cho người tiền nhiệm của mình là OPPO A54. Máy sở hữu thiết kế trẻ trung với bộ 3 camera AI thông minh, màn hình tràn viền với thiết kế đục lỗ cùng hiệu năng ổn định từ vi xử lý MediaTek Helio G35.OPPO A55 có thiết kế khá tương đồng với người tiền nhiệm của mình, phần mặt trước được thiết kế tràn viền giúp máy có một màn hình lớn hơn nhưng không làm tăng kích thước máy. Với độ mỏng 8.4mm cùng trọng lượng chỉ 193g , máy mang lại cảm giác cầm nắm vừa vặn trong lòng bàn tay, phù hợp cho mọi hoạt động hàng ngày của người dùng. Phần mặt lưng của OPPO A55 được làm khá nổi bật với những màu sắc gradient thời thượng, mang lại cảm giác trẻ trung, sành điệu cá tính cho giới trẻ. Nút nguồn và nút âm lượng ở cạnh bên đặt ở vị trí khá thấp, vừa tầm với của ngón tay, thuận tiện thao tác khi sử dụng. Đồng thời, cảm biến vân tay cũng được OPPO A Series tích hợp trong nút nguồn, giúp người dùng có thể mở khóa nhanh ngay khi vừa mở sáng màn hình. Phần bên dưới vẫn được OPPO trang bị cổng sạc USB Type-C và loa thoại. Hơi đáng tiếc OPPO đã quyết định loại bỏ jack cắm tai nghe 3.5mm trên sản phẩm này.', NULL, NULL),
(681, 'OPPO-A55', 'Lưu trữ mọi khoảnh khắc với bộ 3 camera sau AI', 'img/OPPO/OPPO-A55/3.jpg', 'Máy cũng hỗ trợ quay phim khá tốt với nhiều thiết lập khác nhau giúp người dùng có thể dễ dàng tùy chỉnh video của mình. Máy sẽ hỗ trợ quay video với định dạng FullHD 60FPS / 30FPS giúp người dùng có thể quay lại những thước phim với định dạng cao dễ dàng chỉnh sửa sau này.Camera selfie có thông số khá tương tự với người tiền nhiệm, với độ phân giải 16MP tích hợp AI Beauty 2.0 giúp tự động điều chỉnh màu da và ánh sáng xung quanh. Điều này giúp người dùng trở nên rạng rỡ hơn hoặc lưu lại những khoảnh khắc vui vẻ cùng với bạn bè trong những bức ảnh selfie sống động và đầy màu sắc.', NULL, NULL),
(682, 'OPPO-A55', 'Cấu hình ổn định với vi xử lý Helio G35', 'img/OPPO/OPPO-A55/4.jpg', 'OPPO A55 sở hữu sức mạnh được cung cấp từ vi xử lý MediaTek Helio G35 8 nhân. Đây là con chip được sản xuất trên tiến trình 12nm với xung nhịp 2.3 GHz, đi kèm với công nghệ Hyper Engine giúp cải thiện hiệu suất khi chơi game và kết nối mạng. Vi xử lý này sẽ mang lại cho người dùng những trải nghiệm mượt mà, nhanh chóng với các tác vụ cơ bản như lướt web, xem phim trên Youtube, video call... cũng như giải trí với những tựa game Online nhẹ nhàng. Bộ nhớ RAM 4GB cùng tính năng Hyperboost, giúp quản lý RAM thông minh và hiệu quả hơn. Người dùng có thể mở nhiều ứng dụng, game và xử lý nhiều tác vụ khác nhau nhưng máy vẫn hoạt động cực kỳ ổn định và không bị giật lag quá nhiều.OPPO cũng trang bị cho máy bộ nhớ trong 64GB, vừa đủ để người dùng có thể cài đặt những ứng dụng, tài liệu cũng như video và ảnh chụp. Máy cũng hỗ trợ mở rộng bộ nhớ trong với khe thẻ microSD giúp người dùng có thể nâng cấp thêm bộ nhớ trong để phù hợp với nhu cầu lưu trữ của mình.', NULL, NULL),
(683, 'OPPO-A55', 'Màn hình 6.5 inch sắc nét', 'img/OPPO/OPPO-A55/5.jpg', 'OPPO A55 được OPPO trang bị màn hình tràn viền với thiết kế đục lỗ. Đây là thiết kế khá phổ biến trên các dòng smartphone tầm trung hiện nay vì khả năng mang lại không gian hiển thị lớn hơn nhưng không tốn quá nhiều chi phí sản xuất. Điều này không chỉ mang lại cho người dùng chiếc smartphone có màn hình to hơn mà còn mang đến trải nghiệm nội dung giải trí một cách trọn vẹn nhất. Chất lượng hiển thị của chiếc máy được đánh giá là khá tốt. Với màn hình có kích thước đạt đến 6.5 inch độ phân giải HD+, kết hợp với tấm nền IPS LCD, người dùng sẽ được khám phá những khung hình rõ nét, màu sắc tươi tắn tự nhiên và không bị giảm chất lượng khi nhìn từ nhiều phía.', NULL, NULL),
(684, 'OPPO-A55', 'Dung lượng pin khủng, hỗ trợ sạc nhanh 18W', 'img/OPPO/OPPO-A55/6.jpg', 'Với dung lượng pin lên đến 5000 mAh, người dùng có thể sử dụng chiếc máy thoải mái cả ngày dài mà không lo lắng về tình trạng hết pin. OPPO A55 cũng hỗ trợ công nghệ sạc nhanh 18W giúp người dùng có thể rút ngắn thời gian chờ để tiếp tục sử dụng máy ngay trong những trường hợp cần thiết.Đi kèm với đó là tính năng sạc qua đêm được tối ưu hóa giúp việc sạc pin qua đêm trở nên an toàn hơn. AI sẽ tự điều chỉnh dòng điện sạc theo giờ ngủ của người dùng và đảm bảo điện thoại sẽ luôn được sạc đủ 100% ngay khi người dùng vừa thức dậy, giúp duy trì tuổi thọ pin lâu hơn và hạn chế tình trạng cháy, nổ pin.', NULL, NULL),
(685, 'OPPO-A74', 'OPPO A74 – Oppo A74 đây được xem là mẫu smartphone phân khúc tầm trung. Nhà sản xuất giới thiệu thu hút nhiều sự chú ý của người dùng do máy sở hữu nhiều tính năng vượt trội, cải tiến hơn so với tiền nhiệm Oppo A73.Màn hình AMOLED mang lại chất lượng hình ảnh rõ nét, sống động.', 'img/OPPO/OPPO-A74/2.jpg', 'Oppo A74 được trang bị màn hình kích thước tương đối rộng 6.43 inch cùng với tỉ lệ màn hình sao với thân máy lên tới 90.8%, giúp tăng diện tích hiển thị, đem lại trải nghiệm hài lòng, ưng ý cho người dùng. Ngoài ra, smartphone còn được tích hợp thêm màn hình thiết kế dạng đục lỗ AMOLED với nhiều màu sắc sống động, tươi mới, góc nhìn được mở rộng cung chức năng tiết kiệm pin, giúp người sử dụng trải nghiệm từng hình ảnh một cách chi tiết nhất.Độ sáng màn hình tối đa đạt tới 800 nit kết hợp cùng chức năng tự động điều chỉnh ánh sáng phù hợp với môi trường bên ngoài và mắt, rất tiện lợi cho chủ sở hữu. Chức năng bảo mật dấu vân tay quang học cũng được tích hợp trên smartphone nhằm bảo mật mọi thông tin. TÍnh năng hỗ trợ tốc độ quét nhanh và chuẩn xác, dễ dàng sử dụng.', NULL, NULL),
(686, 'OPPO-A74', 'Thiết kế truyền thống, đậm chất tối giản của Oppo A74', 'img/OPPO/OPPO-A74/3.jpg', 'Chiếc smartphone Oppo A74 vẫn còn được trang bị cụm camera bên trong bộ khung hình chữ nhật ở góc bên trái như các tiền nhiệm của hãng. Điện thoại được gia công tinh tế trở nên mỏng và nhẹ hơn, kiểu dáng của máy cong 3D uyển chuyển, tạo cảm giác dễ chịu khi cầm, nắm. Oppo A74 sở hữu 2 màu sắc đơn giản cho người dùng lựa chọn. Đó là màu xanh dương, tạo nên vẻ trẻ trung, năng động, mát mẻ cùng với màu đen huyền bí, sang trọng, quý phái, thích hợp cho những bữa tiệc cấp cao, dễ phối đồ.', NULL, NULL),
(687, 'OPPO-A74', 'Được trang bị con chip đỉnh cao Snapdragon 662 giúp mang lại tốc độ mượt mà', 'img/OPPO/OPPO-A74/4.jpg', 'Oppo A74 được tích hợp bộ vi xử lý Snapdragon 662 được sản xuất trên tiến trình 11 nm cùng xung nhịp xử lý 2 GHz. Những hiệu năng cơ bản này sẵn sáng đáp ứng mọi nhu cầu hàng ngày và đem đến nhiều trải nghiệm cao cấp nhất cho người dùng. Ngoài ra máy còn có chế độ chơi game, giúp gia tăng hiệu năng và tốc độ điện thoại và chặn các thông báo, cuộc gọi ảnh hưởng tới quá trình chơi của người sử dụng.Bên cạnh đó, nhằm nâng cấp thêm sức mạnh cho thiết bị, hãng đã trang bị cho Oppo A74 một bộ nhớ RAM khủng 8 GB hỗ trợ đa nhiệm mượt mà, hiệu quả cùng bộ nhớ trong lớn 128 GB giúp thoải mái lưu trữ mọi loại tập tin. Máy còn có thêm một khay cắm thẻ MicroSD để mở rộng thêm bộ nhớ trong, đáp ứng mọi nhu cầu.', NULL, NULL);
INSERT INTO `baiviets` (`id`, `MaDT`, `tieude`, `img`, `noidung`, `created_at`, `updated_at`) VALUES
(688, 'OPPO-A74', 'Camera mang lại những hình ảnh sắc nét', 'img/OPPO/OPPO-A74/5.jpg', 'Oppo đã trang bị cho đứa con của mình một bộ khung 3 camera phía sau. Độ phân giải camera chính là 48 MP, camera macro là 2 MP và camera chiều sâu cũng tương tự là 2 MP. Camera chính sẽ mang lại cho chủ sở hữu những khung hình rõ nét và ấn tượng. Bên cạnh đó, camera macro lại mang đến những vẻ đẹp tiềm ẩn ở chi tiết nhỏ, cùng với đó là cảm biến chiều sâu sẽ giúp cho những tấm chân dung sinh động hơn. Hơn thế nữa, smartphone còn có một máy ảnh tự sướng 16 MP ở mặt trước cùng nhiều chức năng làm đẹp tùy chỉnh, giúp thoải mái selfie bất cứ nơi nào.', NULL, NULL),
(689, 'OPPO-A74', 'Sở hữu viên pin dung lượng lớn 5000 mAh và có hỗ trợ sạc nhanh', 'img/OPPO/OPPO-A74/6.jpg', 'Oppo A74 còn có một điểm mạnh nữa chính là được cung cấp viên pin dung lượng khủng 5000 mAh, đáp ứng mọi nhu cầu trong cả một ngày dài. Tính năng sạc nhanh 33W cũng sẵn có trên thiết bị, giúp sạc đầy 54% điện thoại chỉ với 30 phút.', NULL, NULL),
(690, 'OPPO-A76', 'Đặc điểm nổi bật của điện thoại OPPO A76', 'img/OPPO/OPPO-A76/2.jpg', 'Thiết kế với bề ngoài bắt mắt. Bộ xử lý Qualcomm Snapdragon 680 xử lý tốt các tác vụ hàng ngày. Màn hình 6.56 inch, độ phân giải HD+ hiển thị hình ảnh rõ nét. Camera được thiết kế hiện đại, sang trọng. Dung lượng pin khủng 5000mAh, có thể sử dụng cả ngày dài.', NULL, NULL),
(691, 'OPPO-A76', 'Thiết kế với bề ngoài bắt mắt', 'img/OPPO/OPPO-A76/3.jpg', 'OPPO A76 sở hữu một thiết kế khá bắt mắt, với kích thước dài 164.4 mm - ngang 75.7 mm - dày 8.4 mm, trọng lượng máy chỉ có 189g. Mặt lưng của chiếc smartphone này  được hoàn thiện bằng chất liệu nhựa. Đây là loại nhựa nhám mờ, có kết cấu bề mặt như cát mịn, mang lại trải nghiệm cầm nắm thoải mái và nhẹ nhàng. Ngoài ra, khi nghiêng máy ở một góc nhất định dưới ánh sáng, các hạt cát mịn sẽ hiện ra tạo nên một vẻ đẹp độc đáo cho sản phẩm. Khi người dùng cầm chiếc điện thoại ngoài trời bạn sẽ có cảm giác như mình đang tỏa sáng. Chiếc smartphone này được thiết kế với hai màu là xanh dương và đen giúp cho người dùng có thể lựa chọn màu sắc phù hợp với cá tính và sở thích của bản thân.', NULL, NULL),
(692, 'OPPO-A76', 'Màn hình 6.56 inch, tần số quét lên tới 90Hz', 'img/OPPO/OPPO-A76/4.jpg', 'Điện thoại OPPO A76 thuộc dòng OPPO A series có màn hình hiển thị khá lớn với kích thước 6.56inch cùng với tấm nền LCD IPS. Tuy nhiên hơi đáng tiếc là độ phân giải chỉ dừng lại ở mức HD+. Nhưng bù lại là màn hình của chiếc smartphone này có tần số quét lên đến 90Hz giúp cho bạn thao tác vuốt chạm, chuyển cảnh vô cùng mượt mà, trơn tru trong việc lướt web, chơi game.', NULL, NULL),
(693, 'OPPO-A76', 'Camera được thiết kế hiện đại, sang trọng', 'img/OPPO/OPPO-A76/5.jpg', 'Camera của chiếc điện thoại OPPO A76 này được thiết kế hiện đại, sang trọng. Cụm camera sau được bố trí gọn trong một mô-đun hình chữ nhật, một thiết kế trông khá cổ điển và độc đáo. Thông số lần lượt của cụm camera này là 12MP và  2MP và được tích hợp công nghệ AI để xử lý hình ảnh tốt hơn. Ngoài ra, màn hình của OPPO A76 sở hữu thiết kế “chấm O” nằm bên trái, là nơi đặt camera selfie 8MP. Một thiết kế vừa đủ để bạn thực hiện các tính năng chụp và quay cơ bản giúp bạn ghi lại những khoảnh khắc rực rỡ trong cuộc đời của mình.', NULL, NULL),
(694, 'OPPO-A76', 'Bộ xử lý Qualcomm Snapdragon 680 8 nhân xử lý tốt các tác vụ hàng ngày', 'img/OPPO/OPPO-A76/6.jpg', 'OPPO A76 128GB được cung cấp sức mạnh bởi con chip Snapdragon 680 8 nhân kèm với GPU Adreno 610, đây là một con chip cho hiệu năng ở mức ổn trong tầm giá, và hoàn toàn có thể đáp ứng đủ các nhu cầu sử dụng cơ bản của người dùng cũng như giải trí với các tựa game nhẹ nhàng mà không bị giật lag. OPPO A76 có RAM 6GB và bộ nhớ lưu trữ 128GB, bên cạnh đó thì còn được hỗ trợ thẻ nhớ ngoài MicroSD lên đến 1TB. Do đó bạn có thể thoải mái trong việc lưu trữ hình ảnh, video mà không lo ngại đến việc bị đầy bộ nhớ.', NULL, NULL),
(695, 'OPPO-A76', 'Dung lượng pin khủng 5000mAh, có thể sử dụng cả ngày dài', 'img/OPPO/OPPO-A76/7.jpg', 'OPPO A76 được trang bị viên pin lớn 5000mAh và hỗ trợ SuperVOOC 33W, bạn có thể sạc đầy pin thiết bị chỉ trong khoảng hơn 1 giờ đồng hồ. Ngoài ra, máy cũng hỗ trợ sạc nhanh với 5 phút cắm sạc cho 3,5 giờ sử dụng. Đi kèm đó là chế độ tiết kiệm pin, siêu tiết kiệm pin, siêu chờ ban đêm và tối ưu hóa chế độ sạc ban đêm cực hấp dẫn.', NULL, NULL),
(696, 'OPPO-F-X5-Pro', 'Chất liệu bền bỉ, đẳng cấp flagship', 'img/OPPO/OPPO-F-X5-Pro/2.jpg', 'OPPO Find X5 Pro lấy cảm hứng thiết kế từ vũ trụ và sử dụng chất liệu gốm tinh tế, thanh lịch. Chất liệu này không chỉ cho vẻ đẹp sang trọng, mà còn đạt được sự bền bỉ theo năm tháng. Để có được điều này, các kỹ sư OPPO đã không ngừng nghiên cứu qua nhiều năm, từ đó đưa đến quy trình hoàn thiện mặt lưng gốm hoàn chỉnh. Theo đó, mặt lưng OPPO Find X5 Pro trải qua 14 quy trình với hơn 269 lần đánh bóng, đạt được độ nhẵn mịn như đá cuội. Các đường cong trên OPPO Find X5 Pro được tối ưu độ dốc, góp phần cho mặt lưng tỏa sáng lấp lánh trên tay dù trong bất kỳ điều kiện ánh sáng nào. Tô điểm cho thiết kế độc đáo và chất liệu cao cấp, OPPO đã chọn hai phiên bản màu sắc sang trọng là Trắng Gốm Sứ và Đen Gốm Sứ.', NULL, NULL),
(697, 'OPPO-F-X5-Pro', 'Đạt chuẩn chống nước IP68', 'img/OPPO/OPPO-F-X5-Pro/3.jpg', 'Để mang tới trải nghiệm liền mạch, OPPO Find X5 Pro được tích hợp chuẩn chống bụi/nước IP68, để bạn tự tin sử dụng điện thoại dù bất kỳ đâu.', NULL, NULL),
(698, 'OPPO-F-X5-Pro', 'Mọi khung ảnh tuyệt đẹp', 'img/OPPO/OPPO-F-X5-Pro/4.jpg', 'Ẩn mình bên trong thiết kế đẹp, đó là hệ thống camera chất lượng hàng đầu, cho khung ảnh sắc nét và chuyên nghiệp, ngay cả trong bóng tối. Hãy thử trải nghiệm cụm camera 50MP + 50 MP + 13MP và gặp gỡ những điều chưa từng thấy khi chụp ảnh trên smartphone. Bạn sẽ có camera 50MP cảm biến Sony IMX766 cao cấp, kích thước cảm biến 1/1,56 inch, khẩu độ F/1.7, ổn định hình ảnh 5 trục cấp SLR. Camera góc rộng 50MP với chất lượng đảm bảo từ Sony IMX766, hỗ trợ lấy nét theo pha PDAF, khẩu độ F/2.4. Cuối cùng là camera tele 13MP, hỗ trợ zoom quang học kết hợp 5x và zoom kỹ thuật số 20x. Màu sắc của OPPO Find X5 Pro còn cực kì chuẩn xác khi OPPO sử dụng thấu kính nhựa nâng cấp bằng kính siêu trong suốt.', NULL, NULL),
(699, 'OPPO-F-X5-Pro', 'Chống rung chuyên nghiệp', 'img/OPPO/OPPO-F-X5-Pro/5.jpg', 'Công nghệ SLR cùng bộ ổn định quang học 5 trục cho khả năng chống rung hiệu quả. Theo đó, chống rung 5 trục có dịch chuyển cảm biến 3 trục và dịch chuyển thấu kính 2 trục, đưa bạn vào không gian nhiếp ảnh chuyên nghiệp, dù bạn đang di chuyển hay chủ thể chuyển động liên tục, thì cũng không làm khó được Find X5 Pro.', NULL, NULL),
(700, 'OPPO-F-X5-Pro', 'Quay video đêm 4K Ultra “đỉnh của chóp”', 'img/OPPO/OPPO-F-X5-Pro/6.jpg', 'Marisilicon X là bộ xử lý hình ảnh NPU do OPPO tự phát triển, được ghi nhận là bước đột phá hỗ trợ đắc lực trong quá trình quay video đêm. Theo đó, bộ xử lý được xây dựng trên tiến trình 6nm, cung cấp tới 18 nghìn tỷ tác vụ mỗi giây (TOPS). Nhờ vậy, OPPO Find X5 Pro có khả năng xử lý khung hình ấn tượng với khả năng khử nhiễu tối ưu. Tận dụng thế mạnh này, OPPO Find X5 Pro quay video đêm 4K cực tốt, giữ nét đẹp tự nhiên cho chủ thể, thước phim sắc nét và rõ ràng.', NULL, NULL),
(701, 'OPPO-Reno4-Pro', 'Thiết kế sang trọng', 'img/OPPO/OPPO-Reno4-Pro/2.jpg', 'Chiếc điện thoại Oppo Reno 4 Pro có thiết kế tinh tế với viền màn hình mỏng, cong tràn sang hai bên. Ở mặt trước, Oppo Reno 4 Pro sở hữu màn hình đục lỗ để chứa camera selfie. Điện thoại cũng được trang bị cảm biến vân tay trong màn hình để bảo mật. Ở mặt sau, điện thoại có cụm ba camera được thiết kế dọc ở góc trên cạnh phải. Mặt lưng điện thoại cũng được làm bóng, mang đến cảm giác cầm chắc tay và tạo sự sang trọng, hiện đại cho người sở hữu. Với các phím bấm vật lý, cạnh phải sẽ là nơi đặt nút nguồn. Trong khi đó, cạnh trái sẽ chứa nút tăng/giảm âm lượng. Về thiết kế, Oppo Reno 4 Pro không có nhiều sự cải tiến nhưng máy vẫn toát lên sự hiện đại, mang đầy tính thẩm mỹ.', NULL, NULL),
(702, 'OPPO-Reno4-Pro', 'Màn hình rộng, chất lượng hiển thị tốt', 'img/OPPO/OPPO-Reno4-Pro/3.jpg', 'Oppo Reno 4 Pro sở hữu màn hình AMOLED rộng 6.5 inch. Độ phân giải màn hình ở mức FullHD+. Ngoài ra, Reno 4 Pro cũng được trang bị màn hình có tốc độ làm mới 90Hz. Với màn hình có tốc độ làm mới cao, Reno 4 Pro sẽ mang đến sự trải nghiệm màn hình mượt hơn ở mọi số tác vụ. Bên cạnh đó, với độ phân giải cao, màn hình Reno 4 Pro cũng mang đến chất lượng hiển thị cao, màu sắc trung thực, sáng và chi tiết.', NULL, NULL),
(703, 'OPPO-Reno4-Pro', 'Hiệu năng đỉnh, đảm bảo mọi tác vụ được trơn tru', 'img/OPPO/OPPO-Reno4-Pro/4.jpg', 'Tập trung vào phân khúc tầm trung trong năm nay, do đó, Oppo Reno 4 Pro được trang bị chipset Snapdragon 720G thay vì chipset Snapdragon 865 cao cấp của năm. Điện thoại có RAM 8GB cao. Tất nhiên, Reno 4 Pro cũng sẽ được chạy trên ColorOS 7.2 dựa trên hệ điều hành Android 10. Với con chip Snapdragon 720G, Reno 4 Pro dù không mạnh mẽ như các flagship cao cấp khác. Ngoài ra, với hiệu năng này, Reno 4 Pro cũng sẽ đảm bảo các tác vụ của người dùng luôn được thực hiện trơn tru và nhanh chóng. Điện thoại có thể chạy đa nhiệm tốt, chơi tất cả các loại game có mặt trên thị trường hiện nay, kể cả các game hạng nặng, mang đến những giây phút giải trí đỉnh cao cho người dùng.', NULL, NULL),
(704, 'OPPO-Reno4-Pro', 'Camera cải tiến', 'img/OPPO/OPPO-Reno4-Pro/5.jpg', 'Về khả năng quang học, điện thoại Reno 4 Pro được trang bị hệ thống camera chất lượng với bốn camera sau. Camera chính của máy có độ phân giải 48MP + 8MP + 2MP và 2MP. Với camera selfie, Reno 4 Pro có camera selfie 32MP ở mặt trước để chụp ảnh tự sướng và gọi video. Camera Reno 4 Pro có nhiều nâng cấp hấp dẫn. Các tính năng như lấy nét laser hay bổ sung thêm thuật toán ánh sáng đêm,... sẽ góp phần mang đến chụp ảnh, video chất lượng luôn đỉnh và đầy màu sắc dù trong cả môi trường ánh sáng yếu. Ngoài ra, điện thoại còn có khả năng quay video 4K tốc độ 30fps/giây đỉnh. Với cụm camera này, máy sẽ giúp lưu giữ mọi khoảnh khắc cùng người thân với chất lượng cao.', NULL, NULL),
(705, 'OPPO-Reno4-Pro', 'Pin dung lượng cao, sạc nhanh đỉnh', 'img/OPPO/OPPO-Reno4-Pro/6.jpg', 'Oppo Reno 4 Pro, máy được trang bị viên pin có dung lượng 4000 mAh. Đi kèm là sạc nhanh SuperVOOC 2.0 65W. Với dung lượng pin này, máy mang đến thời lượng sử dụng điện thoại của người dùng trong một ngày dài thoải mái. Ngoài ra, sạc nhanh 65W cũng sẽ nạp lại đầy pin cho điện thoại nhanh chóng, để việc sử dụng điện thoại không bị gián đoạn.', NULL, NULL),
(706, 'OPPO-Reno5', 'Màn hình Oppo Reno 5', 'img/OPPO/OPPO-Reno5/2.jpg', 'Không nhiều các smartphone trên thị trường hiện nay sở hữu được cho mình một màn hình tràn viền đúng nghĩa. Với Oppo Reno 5 thì chắc chắn người dùng sẽ bị ấn tượng bởi hầu hết không gian của mặt trước của máy được dành cho màn hình hiển thị 6.43 inch Full HD+ (1080 x 2400 Pixels) tấm nền AMOLED. Cụm camera trước của máy được ẩn đi hoàn toàn mang đến tỉ lệ màn hình lớn hơn. Bên cạnh đó loa thoại cũng được loại bỏ. Để làm được vậy Oppo đã trang bị cho máy công nghệ truyền âm thanh qua màn hình. Với thiết kế này giúp người dùng có thể đàm thoại bình thường mặc dù không quan sát thấy loa thoại.', NULL, NULL),
(707, 'OPPO-Reno5', 'Hệ thống camera chất lượng', 'img/OPPO/OPPO-Reno5/3.jpg', 'Với OPPO Find X thì OPPO đã đánh dấu cách tiếp cận mới cho một chiếc máy tầm trung thì OPPO lại một lần nữa khiến nhiều người không khỏi ngạc nhiên. OPPO Reno 5 mang trong mình cụm camera chính 64 MP & Phụ 8 MP và 2 MP, 2 MP ấn tượng và gây được sự thích thú cho người dùng. Với độ phân giải lên tới 44MP kết hợp với công nghệ làm đẹp bằng AI thì OPPO Reno 5 tự tin sẽ làm hài lòng cả những người dùng khó tính nhất.', NULL, NULL),
(708, 'OPPO-Reno5', 'Công nghệ 5G', 'img/OPPO/OPPO-Reno5/4.jpg', 'Công nghệ mạng 5G đang được xem là tương lai và dòng điện thoại, Oppo đã nhanh chóng đem tới cho người dùng phiên bản Oppo Reno 5 với công nghệ kết nối mạng không dây thế hệ thứ 5. Oppo Reno 5 đã gây ấn tượng khi có tốc độ kết nối mạng hơn 1300 Mbps. Với kết nối này người dùng có thể tải bộ phim có dung lượng 1GB chỉ trong khoảng 6 giây. Với mạng 5G người dùng có thể xem hoặc phát video trực tiếp mà không phải đợi chờ như trước đây cũng như chất lượng hình ảnh siêu nét. Bên cạnh đó với mạng 5G, phiên bản Reno 5 có thể khởi động trực tiếp các game mobile có dung lượng lớn trên đám mây mà không cần tải game về.', NULL, NULL),
(709, 'OPPO-Reno5', 'Cấu hình mạnh, sạc pin siêu nhanh 50W', 'img/OPPO/OPPO-Reno5/5.jpg', 'Oppo Reno 5 sẽ trang bị con chip Snapdragon 720G 8 nhân, GPU Adreno 618. Máy sẽ có bộ nhớ RAM 8GB đi kèm bộ nhớ trong 128GB. Máy được cài sẵn Android 11 khi xuất xưởng với nhiều tùy biến hấp dẫn hứa hẹn sẽ giúp bạn khai thác tối đa công dụng của máy. Điểm gây ấn tượng không kém trên Reno 5 chính là viên pin dung lượng lớn và khả năng sạc siêu nhanh 50W. Sạc đầy pin 100% chỉ trong 48 phút. Hệ thống sạc 5 lớp an toàn và nhanh chóng.', NULL, NULL),
(710, 'Nokia-C30', 'Thiết kế khá lỗi thời chưa thực sự phá cách nhưng vẫn giữ được đặc trưng sự bền bỉ vốn có', 'img/Nokia/Nokia-C30/2.jpg', 'Điểm đánh giá Nokia C30 đầu tiên sẽ là thiết kế tổng quan của máy. C30 là một trong những dòng điện thoại có thiết còn khá cũ, với màn hình cách điệu hình giọt nước nhưng các cạnh vẫn còn khá dày. Ở phía sau mặt lưng máy, thì có thiết kế camera được đặt trong hình tròn, khá phổ biến giống với thiết kế của nhà Huawei năm ngoái. Ngay dưới đó sẽ là khóa vân tay được đặt ở mặt lưng máy. Tuy thiết kế chưa thực sự đổi mới chạy theo xu hướng thị trường, nhưng dòng máy này có khá nhỏ gọn, dễ dàng cầm nắm, sử dụng. Chiếc điện thoại này tuy thiết kế tổng quan không được bắt mắt như những dòng máy mới hiện nay. Nhưng Nokia luôn nổi tiếng về độ bền bỉ, cấu hình ổn định bên trong chứ không tập trung quá nhiều ở thiết kế bên ngoài. Chiếc máy này tuy thiết kế không mới, nhưng cực kỳ cứng cáp, đảm bảo được độ bền nhất định khi sử dụng. Nokia C30 rất thích hợp với các bạn học sinh, sinh viên, người lớn tuổi, yêu cầu độ bền cao, cấu hình ổn và mức giá phải chăng.', NULL, NULL),
(711, 'Nokia-C30', 'Màn hình có kích thước lớn nhất trong phân khúc giá rẻ', 'img/Nokia/Nokia-C30/3.jpg', 'Điểm đánh giá Nokia C30 tiếp theo chính là về chất lượng màn hình hiển thị. Tuy thiết kế máy có phần khá lỗi thời, màn hình có chút dày, nhưng đổi lại kích thước màn hình của máy cực kỳ lớn 6.82inch, với tấm nền IPS LCD. Đây là một trong những dòng smartphone giá rẻ có màn hình lớn nhất thị trường hiện tại. Với điểm cộng là thiết kế hình giọt nước nên không gian hiển thị của máy vẫn vô cùng rộng rãi, dù viền có hơi dày. Với tấm nền IPS LCD thì chất lượng hiển thị của máy sẽ không được tốt như các dòng màn hình AMOLED hiện nay. Nhưng vẫn ở mức ổn định, đủ để phục vụ tốt nhu cầu giải trí, xem phim, học tập của người dùng. Độ phân giải màn hình đạt được là HD+ đem đến hình ảnh hiển thị rõ nét, có độ tươi mới khá chân thật.', NULL, NULL),
(712, 'Nokia-C30', 'Dung lượng pin cực khủng 6000mAh ấn tượng', 'img/Nokia/Nokia-C30/4.jpg', 'Đánh giá Nokia C30 về dung lượng pin được trang bị, thì chiếc máy này sở hữu một viên pin khủng lên đến 6000mAh. Kết hợp cùng với con chip Unisoc có khả năng tiết kiệm năng lượng tốt, đảm bảo phục vụ tốt nhu cầu sử dụng của người dùng từ 2 đến 3 ngày. Nhắc đến Nokia người ta luôn nghĩ đến độ bền bỉ bên ngoài thiết kế cùng với thời lượng pin cực trâu. Hiện tại Nokia vẫn mang những điểm nổi bật đó của mình lên dòng smartphone của hãng.', NULL, NULL),
(713, 'Nokia-C30', 'Công nghệ sạc nhanh – Kết nối 4G', 'img/Nokia/Nokia-C30/5.jpg', 'Nhà Nokia chỉ trang bị sạc nhanh 10W cho máy, nên thời gian sạc đầy pin của máy cũng khá là lâu. Nhưng bù lại thời gian sử dụng của máy cũng bền bỉ đến 2, 3 ngày mới sạc một lần. Chỉ tiếc rằng Nokia C30 chỉ hỗ trợ kết nối 4G chưa được nâng cấp lên 5G, nhưng vẫn cực kỳ nhanh chóng ổn định.', NULL, NULL),
(714, 'Nokia-C31', 'Nokia C31 với thiết kế bền bỉ và chất lượng', 'img/Nokia/Nokia-C31/2.jpg', 'Tổng thể thiết kế của Nokia C31 được làm khá đơn giản và quen thuộc nhưng lại siêu bền bỉ, với việc sử dụng vật liệu nhựa polycarbonate siêu bền kết hợp cùng chất lượng hoàn thiện với lối thiết kế vân nổi ở phần mặt lưng giúp mang lại cho thiết bị khả năng hạn chế các vết xước nhẹ, tránh được tình trạng bám dấu vân tay và mồ hôi trong quá trình sử dụng. Bền bỉ nhưng liệu có mới mẻ? Gen Z đừng lo vì nhà sản xuất đem đến cho người dùng 2 phiên bản màu sắc khác nhau là Xanh lam và Xanh Bạc hà. Mỗi màu sắc mỗi vẻ đẹp khác nhau và đều tôn lên vẻ năng động và bắt mắt, thích hợp cho cả nam lẫn nữ. Ở mặt sau được trang bị vùng cảm biến vân tay giúp người dùng có thể mở khóa thiết bị nhanh chóng. Ngoài ra cụm loa cũng đã được chuyển sang phần mặt lưng và đặt ở góc trái bên dưới thiết bị.', NULL, NULL),
(715, 'Nokia-C31', 'Màn hình Nokia C31 lớn, quá đã cho trải nghiệm giải trí', 'img/Nokia/Nokia-C31/3.jpg', 'Với một mức giá khá mềm, thật bất ngờ vì nhà Nokia trang bị cho C31 màn hình có kích thước lớn tới 6.7 inch mang lại không gian hiển thị rộng lớn, bạn sẽ có một không gian vô cùng rộng rãi để làm mọi thứ mình thích, người dùng có thể xem phim hay chơi game đã mắt. Nội dung trên màn hình được tái hiện tương đối rõ nét nhờ hỗ trợ độ phân giải HD+, cùng với đó là độ sáng màn hình đạt 400 nits để người dùng có thể dễ dàng sử dụng khi ở ngoài trời. Không những thế, khung hình 20:9 cũng giúp cho người dùng có được không gian hiển thị rộng hơn để trải nghiệm thêm phần tốt hơn. Đây là chiếc màn hình hợp lý để đáp ứng các nhu cầu xem phim, đọc báo, lướt mạng xã hội hàng ngày của hầu hết mọi người dùng!', NULL, NULL),
(716, 'Nokia-C31', 'Dung lượng pin Nokia C31 bền bỉ, đúng chất Nokia', 'img/Nokia/Nokia-C31/4.jpg', 'Một trong những nỗi lo lớn nhất của người dùng khi sử dụng điện thoại thông minh chính là thời lượng pin kém. Nhưng với Nokia, pin là điều chưa bao giờ hãng làm con dân thất vọng!Với mức dung lượng 5.050 mAh - một con số khá ấn tượng với một sản phẩm giá rẻ, mang đến thời gian sử dụng lên đến hai ngày trong một lần sạc pin. Việc sở hữu một dung lượng pin lớn giúp cho điện thoại đáp ứng tốt mọi nhu cầu chụp ảnh,duy trì sự ổn định trên nhiều tác vụ hằng ngày.Nếu bạn kích hoạt tính năng tiết kiệm pin AI, bạn hoàn toàn có thể sử dụng máy trong vòng ba ngày. Do đó, bạn sẽ không bao giờ phải lo lắng về pin trên Nokia C31 khi đi ra ngoài.', NULL, NULL),
(717, 'Nokia-G10', 'Thiết kế', 'img/Nokia/Nokia-G10/2.jpg', 'Nokia G10 được hoàn thiện từ chất liệu nhựa nhưng không hề đem đến cảm giác rẻ tiền khi cầm trên tay. Máy dày 9,2 mm và nặng 194 gram nên khi cầm khá đầm tay. Nổi bật trong thiết kế Nokia G10 là mặt lưng sử dụng hiệu ứng chuyển màu kèm hiệu ứng lấp lánh và hạn chế bám vân tay rất hiệu quả. Bên cạnh đó là cụm camera hình tròn độc đáo với 3 ống kính và 1 đèn flash LED. Cụm camera này rất mỏng, bên dưới được bố trí logo Nokia. Các chi tiết này giúp Nokia G10 có sự cân bằng và có tính thẩm mỹ cao. Điều này đem đến những trải nghiệm thú vị cho người dùng từ trong ra ngoài.', NULL, NULL),
(718, 'Nokia-G10', 'Màn hình', 'img/Nokia/Nokia-G10/3.jpg', 'Về khía cạnh màn hình, giới chuyên môn đánh giá Nokia G10 cho chất lượng hiển thị tương đối tốt, sắc nét. Máy được trang bị màn hình giọt nước HD+, kích thước 6.52 inch và tấm nền IPS LCD cho hình ảnh sống động và sắc nét. Tuy không bằng các smartphone cao cấp nhưng hoàn toàn chấp nhận được với một smartphone giá rẻ. So với các đối thủ cùng mức giá, Nokia G10 cho chất lượng hiển thị ở góc nhìn hẹp vượt trội hơn hẳn. Cạnh viền bezel mỏng, tỷ lệ hiển thị 20:9 đem đến trải nghiệm tốt hơn cho người dùng.', NULL, NULL),
(719, 'Nokia-G10', 'Camera', 'img/Nokia/Nokia-G10/4.jpg', 'Cụm camera Nokia G10 không phải có 4 cảm biến mà trong số đó là đèn flash LED. Cách bố trí các cảm biến và đèn flash LED đã giúp làm tăng tính thẩm mỹ cho máy. Hệ thống camera của G10 gồm: camera chính 13MP, camera macro và đo chiều sâu 2MP. Tuy độ phân giải không cao nhưng theo đánh giá Nokia G10 của giới chuyên môn thì khả năng chụp ảnh của máy khá tốt. Màu sắc có độ tương phản cao, ảnh nhiều chi tiết. Nokia cũng tích hợp các chế độ chụp ảnh như: chụp đêm, HDR,… giúp giảm nhiễu và tăng độ phơi sáng cho hình ảnh. Camera selfie 8MP cho phép người dùng chụp ảnh tự sướng và gọi video sắc nét. Bên cạnh đó máy còn có thể quay được video 1080P tốc độ 30fps. Tuy không được tích hợp ổn định UIS nhưng chất lượng video khá ổn, chất nhận được so với mức giá.', NULL, NULL),
(720, 'Nokia-G10', 'Hiệu năng và pin', 'img/Nokia/Nokia-G10/5.jpg', 'Nokia trang bị cho G10 chip Helio G25 cho tốc độ GPU đạt 2.0GHz, GPU 650 MHz. Ngoài ra, chip còn được tích hợp công nghệ HyperEngine giúp tăng hiệu năng chơi game. Đi kèm với chip Helio G25 là RAM 4GB, ROM 64GB xử lý mượt mọi tác vụ. Máy được cài đặt sẵn hệ điều hành Android 11. Cung cấp năng lượng cho Nokia G10 là viên pin 5.050 mAh. Đây chính là điểm công lớn của G10 so với các đối thủ. Máy chỉ tụt 25% pin khi chơi game trong 3 tiếng đồng hồ và sạc đầy pin trong 2h40p nhờ hỗ trợ sạc 10W. Có thể nói Nokia G10 là smartphone có hiệu suất pin tốt nhất phân khúc giá rẻ.', NULL, NULL),
(721, 'Nokia-G10', 'Bảo mật', 'img/Nokia/Nokia-G10/6.jpg', 'Nokia G10 được tích hợp cảm biến vân tay trên nút nguồn cạnh bên giúp bảo mật tốt hơn. Ngoài ra, máy còn có tính năng mở khóa bằng nhận diện khuôn mặt với độ chính xác cao. Điểm đặc biệt nhất về bảo mật là Nokia G10 được bảo mật thông tin cá nhân cẩn thận, được cập nhật bảo mật hàng tháng trong 3 năm và nâng cấp hệ điều hành trong 2 năm. Điều mà rất hiếm smartphone giá rẻ có được', NULL, NULL),
(722, 'Nokia-G11', 'Nokia G11 với thiết kế tương đồng Nokia G21, đơn giản nhưng không kém phần tinh tế', 'img/Nokia/Nokia-G11/2.jpg', 'Nokia G11 có một thiết kế tương đối an toàn, không nổi bật, không phá cách. Xét ở phân khúc giá của Nokia G11 thì mình đánh giá chiếc điện thoại này có diện mạo đẹp và chỉ cần nhìn thoáng qua thì ai cũng dễ dàng nhận ra đây là thương hiệu Nokia. Chính vì sự giống nhau như anh em song sinh với Nokia G21 nên cảm giác cầm Nokia G11 không có sự khác biệt, ngoại trừ việc hãng đã lược bỏ một số thành phần kim loại khiến khối lượng tổng thể của Nokia G11 phần nào nhẹ hơn. Mặt lưng và khung viền của Nokia G11 được hoàn thiện từ nhựa, vẫn có những đường vân ngang để hạn chế bám mồ hôi và dấu vân tay. Bên cạnh đó, các đường vân còn giúp mặt lưng trở nên bớt đơn điệu và tăng độ bám khi cầm trên tay. Màu sắc cũng là một điểm mình chú ý trên mặt lưng Nokia G11, mặt lưng của phiên bản màu Charcoal sẽ thay đổi màu sắc một chút tùy vào góc độ mà chúng ta nhìn vào. Cụm camera sau của Nokia G11 được đặt trong một khung hình chữ nhật, nằm ở phía bên trái của mặt lưng. Cách Nokia sắp xếp các cảm biến camera cũng khá thú vị khi cả 3 ống kính được đặt nằm dọc ở bên trái, bên còn lại chỉ có đèn flash. Tác giả cảm thấy cách sắp xếp camera này có lẽ nhằm tạo thêm điểm nhấn cho thiết kế mặt lưng vốn đơn điệu của Nokia G11. Mặc dù vậy thì thiết kế tổng thể mặt lưng Nokia G11 vẫn có điểm nhấn hơn so với một số đối thủ cùng phân khúc, điều này cho thấy Nokia vẫn dành một sự nghiêm túc nhất định cho sản phẩm của hãng dù ở phân khúc giá rẻ. Sang đến mặt trước, Nokia G11 sở hữu màn hình giọt nước có kích thước 6.5 inch, đồng thời tỷ lệ màn hình của Nokia G11 cũng lên đến 20:9. Nhờ vậy không gian hiển thị trên Nokia G11 rất thoải mái, đã mắt nhưng phần viền màn hình vẫn còn tương đối dày, đặc biệt là ở phần cạnh dưới. Nếu Nokia làm mỏng đi phần viền này tác giả nghĩ trải nghiệm của người dùng sẽ trở nên trọn vẹn hơn. Đến với các cạnh viền của Nokia G11, hãng vẫn giữ nguyên cách bố trí tương tự như trên Nokia G21. Cạnh trên gồm lỗ cắm tai nghe 3.5 mm, mic thu âm. Cạnh phải là nơi đặt phím nguồn và cụm phím tăng giảm âm lượng. Sang đến cạnh trái thì ngoài khe SIM, Nokia còn trang bị thêm 1 nút giúp gọi trợ lý ảo Google Assistant cho Nokia G11.', NULL, NULL),
(723, 'Nokia-G11', 'Nokia G11 với thiết kế tương đồng Nokia G21, đơn giản nhưng không kém phần tinh tế', 'img/Nokia/Nokia-G11/3.jpg', 'Camera Nokia G11 có thông số cụ thể như sau: Camera chính: Độ phân giải 13 MP. Camera macro: Độ phân giải 2 MP. Camera đo chiều sâu: Độ phân giải 2 MP. Camera trên Nokia G11 thua về độ phân giải so với Nokia G21, tuy nhiên chất lượng ảnh mà Nokia G11 ghi lại được vẫn rất ổn. Màu sắc của các bức ảnh đều khá trung tính, không bị quá rực rỡ hay bị mất quá nhiều chi tiết. Nokia G11 còn có camera macro giúp người dùng có thêm lựa chọn để sáng tạo nên những bức ảnh cho riêng bản thân.', NULL, NULL),
(724, 'Nokia-G21', 'Thiết kế', 'img/Nokia/Nokia-G21/2.jpg', 'Có thể nói phong cách thiết kế gần đây của Nokia đã có phần thay đổi. Đặc biệt là khối camera của họ không còn là một khối tròn nữa. Đã đi theo số đông và thực sự khối cam hình chữ nhật vẫn được chờ đón hơn. Mình thích điều này. Điện thoại này khá dày và nặng. Nó vẫn được hoàn thiện bằng nhựa nhưng chứa khối pin lớn 5000mAh nên nặng là điều đương nhiên. Cảm giác cầm nắm nói chung là tốt và nếu bạn cầm máy ở mặt lưng sẽ thấy sự mới lạ của Nokia mà không máy nào có. Các cạnh vuông nhưng 2 mặt hơi bo cong nên chuyển tiếp tốt ở các mặt trước sau. Sử dụng 1 tay dễ dàng với tỷ lệ thiết kế 20:9.', NULL, NULL),
(725, 'Nokia-G21', 'Mặt trước', 'img/Nokia/Nokia-G21/3.jpg', 'Mặt trước là một màn hình LCD lớn tới 6.5 inch và đây làm màn hình giọt nước. Các cạnh màn hình này tương đối mỏng nhưng phần cằm máy còn rất dày. Tuy vậy tính tới mức giá chỉ hơn 3 triệu thì dày một chút cũng không có vấn đề gì cả. Trong notch giọt nước chính là camera selfie 8MP cùng với một số cảm biến. Phía trên của màn hình này là một dải loa thoại được gắn xen giữa màn hình và khung máy. Nó cung cấp âm thanh đầy đủ và ổn định khi đàm thoại.', NULL, NULL),
(726, 'Nokia-G21', 'Mặt sau', 'img/Nokia/Nokia-G21/4.jpg', 'Mặt sau được hoàn thiện nhựa với 2 phiên bản màu sắc gồm Nordic Blue, Dusk. Bản mình đang đánh giá chính là màu Nordic Blue (xanh bắc âu) khá hấp dẫn và lạ mắt. Nó có các đường vân là sự kết hợp giữa những đường tròn đồng tâm lớn nhỏ xen kẽ nhau. Cảm giác sờ lên rất lạ và chưa từng thấy ở một thiết bị nào khác. Khối camera chữ nhật đặt dọc ở góc trái trông mới lạ với Nokia. Nó chứa 3 ống kính bên trong cùng một đèn LED hỗ trợ ánh sáng. Chúng không nhô lên quá cao so vói mặt lưng máy, cũng không vướng víu khi sử dụng', NULL, NULL),
(727, 'Nokia-G21', 'Màn hình', 'img/Nokia/Nokia-G21/5.jpg', 'Điện thoại trang bị một tấm nền IPS LCD lớn 6.5 inch, mức trang bị phổ biến trong tầm giá. Nó chỉ có độ phân giải HD 720p mà thôi nhưng đó là cách giảm giá thành mà nhiều thương hiệu sử dụng. Nhưng điểm đặc biệt chính là tốc độ làm mới màn hình 90Hz – tùy chọn rất hiếm thấy ở tầm giá này. Bởi thế bạn sẽ có những thước phim hay và mượt mà đấy. Đây là màn hình LCD nên bạn không cần hi vọng quá cao về độ sáng màn hình. Nó có độ sáng 400 nits ở chế độ thủ công. Bật sang chế độ tự động có thể nhỉnh hơn chút là 437 nits. Có thể bạn sẽ rất khó khăn với ánh nắng trực tiếp. Nhưng nếu dùng trong nhà thì thoải mái dùng rồi', NULL, NULL),
(728, 'Nokia-G21', 'Camera', 'img/Nokia/Nokia-G21/6.jpg', 'Điện thoại Nokia G21 trang bị 3 camera sau gồm cam chính 50MP và 2 cảm biến phụ chụp macro và chiều sâu. Bạn không nên hi vọng camera tele ở tầm giá này khi mà camera siêu rộng cũng bị cắt bỏ đi luôn. Thực sự thì nếu có siêu rộng mình cũng không hi vọng nó chụp ảnh quá đẹp đâu.Camera chính dùng cảm biến Samsung JN1 50MP với kích thước nhỏ chỉ 0,64µm. Có chế độ lọc màu Tetrapixel nên bạn sẽ có được ảnh mặc định 12.5MP khá đẹp. Camera macro 2MP không có tự động lấy nét. Cảm biến chiều sâu 2MP. Camera trước 8MP để chụp ảnh selfie khá ổn.', NULL, NULL),
(729, 'Vivo-T1-5G', 'Vivo-T1-5G phiên bản điện thoại tầm trung nhưng chất lượng cao, thiết kế trẻ trung bắt mắt', 'img/Vivo/Vivo-T1-5G/2.jpg', 'Vivo-T1-5G là mẫu Vivo T1 5G được xem là một trong những chiếc điện thoại mạnh nhất ở thời điểm hiện tại trong phân khúc tầm trung. bởi thiết bị được trang bị vi xử lý Snapdragon 778G cùng dung lượng RAM lên đến 12 GB (trong đó có 8 GB RAM chính + 4 GB RAM ảo). Đây là thời lượng khá tốt đối mà một thiết bị có viên pin 4.700 có thể mang lại.', NULL, NULL),
(730, 'Vivo-T1-5G', 'Vivo-T1-5G Về khả năng hiển thị, chất lượng hiển thị trên Vivo T1 5G là không phải bàn, màu sắc tươi tắn, trong trẻo khung hình đẹp đẽ, sắc nét sẽ cho bạn những giây phút giải trí trọn vẹn nhất.', 'img/Vivo/Vivo-T1-5G/3.jpg', 'Vivo-T1-5G là mẫu sở hữu viên pin 4700 mAh cho thời gian sử dụng lên đến hơn 9h liên tục.', NULL, NULL),
(731, 'Vivo-T1-5G', 'Vivo T1 5G sở hữu cảm biến chính 64MP, khẩu độ f/1.8, cùng với camera góc siêu rộng 8MP, khẩu độ f/2.2 và camera macro 2MP, khẩu độ f/2.4. Trong điều kiện đủ sáng ảnh có độ bão hòa và độ tương phản cao hơn, độ sáng đẩy lên một chút, ảnh nhiều chi tiết và khả năng khử nhiễu tốt.', 'img/Vivo/Vivo-T1-5G/4.jpg', 'Với 8MP trên camera góc rộng mình nghĩ sẽ chẳng làm ăn được gì nhưng khi sử dụng mình đã phải thay đổi suy nghĩ khi hình ảnh từ cảm biến này cho ra chẳng hề kém cạnh so với cảm biến chính từ màu sắc, độ chi tiết, độ bão hòa, tương phản đều rất tốt.', NULL, NULL),
(732, 'Vivo-T1-5G', 'Đầu tiên là về thiết kế, chiếc máy này có thiết kế khá là nổi bật với cụm camera gồm ba cảm biến được đặt trong hai vòng tròn cùng kích thước tạo cảm giác đồng bộ và được bao quanh khung viền chữ nhật nhìn khá là giống băng cassette.', 'img/Vivo/Vivo-T1-5G/5.jpg', 'Cụm camera này nhô lên so với mặt lưng máy Sforum khuyến khích bạn nên sử dụng ốp lưng để hạn chế những vết xước không mong muốn.', NULL, NULL),
(733, 'Vivo-T1-5G', 'Vivo T1 5G được trang bị màn hình AMOLED có kích thước 6.44 inches, độ phân giải FHD+ và độ sáng lên đến 1300 nits trong khi đó một số mẫu smartphone trong tầm giá như: Samsung A53 5G, Xiaomi 11 Lite 5G NE chỉ hỗ trợ 800 nits.', 'img/Vivo/Vivo-T1-5G/6.jpg', 'Với độ sáng màn hình cao T1 5G cho khả năng hiển thị xuất sắc dưới nguồn sáng mạnh, cá nhân mình thấy tính năng này rất hữu ích khi đi ngoài đường đặc biệt là dưới ánh nắng chói chang mình vẫn có thể đọc được những thông báo, tin nhắn một cách rõ nét.', NULL, NULL),
(734, 'Vivo-T1X', 'Vivo T1x 4G có kích thước 164.26 x 76.08 x 8 mm, trọng lượng 182g khá là nhẹ. Mặt trước của máy sở hữu màn hình IPS LCD Full HD+ 6.58 inch với thiết kế notch hình giọt nước để chứa camera selfie.', 'img/Vivo/Vivo-T1X/2.jpg', 'Mặt sau của máy được hoàn thiện từ chất liệu polymer cộng thêm yếu tố thiết kế vuông vức và được vát nhẹ các cạnh xung quanh giúp người dùng cầm máy khá tì tay.', NULL, NULL),
(735, 'Vivo-T1X', 'Vivo T1x 4G có màn hình IPS LCD kích thước 6.58 inch với notch hình giọt nước, độ phân giải Full HD+ (1080 x 2400 pixel) hiển thị hình ảnh sắc nét và đặc biệt hỗ trợ tốc độ làm mới khung hình 90Hz.', 'img/Vivo/Vivo-T1X/3.jpg', 'Với tần số quét 90Hz, màn hình của Vivo T1x 4G có thể phản hồi lại một cách mượt mà các thao tác chạm, lướt của người dùng. Đồng thời chơi các tựa game có tốc độ khung hình cao cũng mượt và dễ dàng hơn.', NULL, NULL),
(736, 'Vivo-T1X', 'Vivo T1x 4G được cung cấp sức mạnh bởi con chip Snapdragon 680 4G đến từ Qualcomm, cho hiệu năng ổn định và có thể chạy tốt các ứng dụng cơ bản thường ngày, cũng như các tác vụ nặng hơn.', 'img/Vivo/Vivo-T1X/4.jpg', 'Bộ nhớ RAM lên đến 6 GB hỗ trợ chạy nhiều ứng dụng cùng lúc được ổn định.', NULL, NULL),
(737, 'Vivo-T1X', 'Vivo trang bị cho T1x 4G cảm biến chính lên đến 50MP, khẩu độ lớn f/1.8, có thể chụp được những bức ảnh một cách sắc nét.', 'img/Vivo/Vivo-T1X/5.jpg', 'Bên cạnh đó, máy còn sở hữu ống kính độ sâu 2MP chuyên dùng để chụp chân dung và ống kính macro 2MP chụp cận cảnh giúp đa dạng hóa bức ảnh trong mọi tình huống chụp.', NULL, NULL),
(738, 'Vivo-T1X', 'Vivo T1x 4G sở hữu viên pin dung lượng lớn 5000 mAh, sử dụng cả ngày dài mà không lo hết pin.', 'img/Vivo/Vivo-T1X/6.jpg', 'Thiết bị cũng hỗ trợ công nghệ sạc nhanh 18W để giảm bớt thời gian chờ đợi của người dùng.', NULL, NULL),
(739, 'Vivo-V23e', 'Màn hình của máy là Vivo V23e in theo tỷ lệ 10:9 Viền màn hình cũng tạm ổn nên tổng thể máy gọn gàng vừa tay.', 'img/Vivo/Vivo-V23e/2.jpg', 'Cạnh viền của máy được làm bằng: nhưa mặt lưng cũng bằng nhựa luôn, máy màu đen thì có làm hiệu ứng giả kính như tấm gương.', NULL, NULL),
(740, 'Vivo-V23e', 'Vivo V23e sở hữu màn hình 6.44 in. Máy sử dụng tấm nền Amoled và có độ phân giải 1080x1920 và đạt 409 ppi.', 'img/Vivo/Vivo-V23e/3.jpg', 'Màu sắc trên máy khác rực rỡ đẹp phù hợp với phân khúc và giá tiền. Độ sáng màn hình tốt khi nhìn ngoài trời rõ.', NULL, NULL),
(741, 'Vivo-V23e', 'Vivo V23e sử dụng chíp Mediatek Helio G96 đây là dòng chip thuộc phân khúc tầm trung và là bản nâng cấp so với con chip G95.', 'img/Vivo/Vivo-V23e/4.jpg', 'Máy có phiên bản Ram 8Gb và Rom 128Gb khi sử dụng các tác vụ khá mượt mà.', NULL, NULL),
(742, 'Vivo-V23e', 'Một số tính năng nỗi bật như chạy 2 cửa sổ song song trên cùng 1 màn hình, và các tính năng vuốt chạm thì máy nào bây giờ cũng có nên mình bỏ qua phần này.', 'img/Vivo/Vivo-V23e/5.jpg', 'Vivo V23e sử dụng andoid phiên bản 11 trên giao diện Funtouch 12. Nên các bạn có thể tùy biến giao diện theo sở thích riêng của mình.', NULL, NULL),
(743, 'Vivo-V23e', 'Máy có thể quay video ở độ phân giải: 4k ở cả 2 camera trước và sau với nhiều tính năng làm đẹp khuôn mặt khi quay.', 'img/Vivo/Vivo-V23e/6.jpg', 'Trong điều kiện đủ sáng: ảnh chụp trong trẻo, nhiều chi tiết, có thể đăng ngay lên mạng xã hội không cần chỉnh sữa gì, khá tốt.', NULL, NULL),
(744, 'Vivo-V25e', 'vivo V25e được trang bị dòng chipset Helio G99 – bộ vi xử lý cho hiệu năng khá ổn trong phân khúc điện thoại giá rẻ và tầm trung.', 'img/Vivo/Vivo-V25e/2.jpg', 'Đúng hơn, hiệu năng của chiếc máy này ở mức vừa đủ để phục vụ các tính năng nổi bật khác của V25e như camera sắc nét, màn hình hiển thị tốt hay công nghệ sạc siêu nhanh ấn tượng.', NULL, NULL),
(745, 'Vivo-V25e', 'Phần mềm này sẽ cho thiết bị trải qua các bài test và cho ra số điểm cụ thể, điểm số càng cao tương ứng với cấu hình càng mạnh.', 'img/Vivo/Vivo-V25e/3.jpg', 'Nhờ được trang bị cấu hình ở mức khá nên vivo V25e cho số điểm tương đối ổn: 367,838 điểm; trong đó bao gồm 95,737 điểm CPU; 85,855 điểm GPU; 88,215 điểm MEM và 98,031 điểm UX.', NULL, NULL),
(746, 'Vivo-V25e', 'vivo V25e đạt 98.9%, pin giảm 5%, FPS chỉ dao động ở dưới mức 5 khung hình trên giây.', 'img/Vivo/Vivo-V25e/4.jpg', 'Đây là một con số khá là thấp khi so với nhiều đối thủ khác trong cùng phân khúc.', NULL, NULL),
(747, 'Vivo-V25e', 'cho chất lượng hình ảnh rõ nét, màu sắc rực rỡ cùng các hiệu ứng kỹ năng, bụi cây và bóng đổ… đều được hiển thị một cách chân thực.', 'img/Vivo/Vivo-V25e/5.jpg', 'Mặc dù được thiết lập ở mức đồ họa cao nhưng thiết bị vẫn đem lại cho mình một độ mượt “siêu căng”, không bị giật lag, tốc độ khung hình dao động ở mức 60 FPS.', NULL, NULL),
(748, 'Vivo-V25-Pro', 'Chiếm hầu hết ở mặt trước là một màn hình cong tuyệt vời cùng vị trí đục lỗ siêu nhỏ dành cho camera selfie.', 'img/Vivo/Vivo-V25-Pro/2.jpg', 'Cả cạnh trên và cạnh dưới đều rất mỏng, trải nghiệm màn hình có thể đem lại hứa hẹn sẽ rất tuyệt vời đấy.', NULL, NULL),
(749, 'Vivo-V25-Pro', 'Khối camera ở mặt sau cho cảm giác hài hòa và cân đối đến kì lạ. Nếu bạn chỉ lướt qua hẳn sẽ nghĩ điện thoại này chỉ có 2 camera thôi.', 'img/Vivo/Vivo-V25-Pro/3.jpg', 'Nhưng chú ý một chút sẽ có thêm một camera macro 2MP ở ngay dưới nữa. Mặc dù không đáng kể nhưng dù sao có vẫn hơn không!', NULL, NULL),
(750, 'Vivo-V25-Pro', 'Khung máy lại được làm bằng nhựa và nó được hoàn thiện bóng đồng màu với mặt lưng. Làm bóng có vẻ sang trọng nhưng thực tế đây lại là nơi để vân tay, vết bẩn bám vào.', 'img/Vivo/Vivo-V25-Pro/4.jpg', 'Mặc dù bạn có thể lau đi một cách dễ dàng nhưng mình không thích điều đó.', NULL, NULL),
(751, 'Vivo-V25-Pro', 'Các cổng kết nối và nút bấm vẫn ở trên khung máy này, nhưng đáng tiếc không có vị trí thẻ nhớ và cũng không có jack âm thanh 3.5mm.', 'img/Vivo/Vivo-V25-Pro/5.jpg', 'Một số thương hiệu cắt giảm những cái này là để nâng cấp khả năng chống nước nhưng đáng tiếc Vivo V25 Pro không như vậy.', NULL, NULL),
(752, 'Vivo-X80', 'Chính thiết kế camera khổng lồ đã giúp Vivo X80 ghi điểm với người dùng và nổi bật trong phân khúc. Mặc dù không đi theo xu hướng thiết kế phẳng nhưng X80 v Các bạn sẽ cảm nhận rõ điều này khi thao tác vuốt, chạm trên màn hình khi chơi game hoặc đơn giản chỉ là xem phim.ẫn rất đẹp và sang trọng. ', 'img/Vivo/Vivo-X80/2.jpg', 'Mặt lưng được vát cong 2 bên đem lại sự thoải mái cho người dùng, không cảm thấy bị cấn tay.', NULL, NULL),
(753, 'Vivo-X80', 'Giới chuyên môn đánh giá chi tiết Vivo X80 rất cao về chất lượng màn hình.', 'img/Vivo/Vivo-X80/3.jpg', 'Máy được trang bị màn hình đục lỗ kích thước khá lớn lên tới 6.78 inch và chỉ thua Galaxy S22 Ultra một chút.', NULL, NULL),
(754, 'Vivo-X80', 'Chưa dừng lại ở đó, Vivo X80 còn được trang bị tần số quét cực cao 120Hz đem đến trải nghiệm siêu mượt trên từng thao tác.', 'img/Vivo/Vivo-X80/4.jpg', ' Các bạn sẽ cảm nhận rõ điều này khi thao tác vuốt, chạm trên màn hình khi chơi game hoặc đơn giản chỉ là xem phim.', NULL, NULL),
(755, 'Vivo-X80', 'Với hệ thống camera ấn tượng gồm: cảm biến chính 50MP, cảm biến góc siêu rộng 12MP, cảm biến tele 12MP,', 'img/Vivo/Vivo-X80/4.jpg', 'cảm biến selfie 32MP kết hợp tinh chỉnh hình ảnh từ Zeizz và chip Vivo V1+ những bức hình thu được từ Vivo X80 vô cùng ấn tượng. ', NULL, NULL),
(756, 'Vivo-X80', 'Cung cấp sức mạnh cho Vivo X80 hoạt động là vi xử lý siêu mạnh mẽ Dimensity 9000 của MediaTek.', 'img/Vivo/Vivo-X80/5.jpg', 'Được biết, chip Dimensity 9000 được sản xuất trên tiến trình 4nm và sử dụng 1 lõi Cortex-X2 cho tốc độ xung nhịp tối đa lên tới  3,05 GHz, 3 lõi Cortex-A710 2.85 GHz, 4 lõi Cortex-A510 tiết kiệm pin 1.80 GHz.', NULL, NULL),
(757, 'Vivo-Y02s-3G', 'Thiết kế Vivo Y02s hiện đại bắt mắt với màn hình 6.5 inch HD Plus', 'img/Vivo/Vivo-Y02s-3G/2.jpg', 'Dù là điện thoại phân khúc giá rẻ, Vivo Y02s mang ngoại hình hiện đại, trẻ trung, không kém phần sang trọng với khung viền tinh tế, các góc cạnh rõ ràng. Tất cả tạo nên tổng thể đẹp mắt và thẩm mỹ khi sử dụng. Toàn bộ thân máy được hoàn thiện từ chất liệu polymer cao cấp 2.5D giúp cho Vivo Y02s đạt trọng lượng nhẹ chỉ 183g cầm nắm chắc tay. Mặt lưng smartphone sáng bóng, có cụm camera ở góc trái màn hình có đèn flash. Kích thước màn hình lớn, tạo trải nghiệm tốt cho người dùng khi sử dụng,', NULL, NULL),
(758, 'Vivo-Y02s-3G', 'Camera nổi bật với tính năng làm đẹp khuôn mặt', 'img/Vivo/Vivo-Y02s-3G/3.jpg', 'Điểm nhấn trên điện thoại Vivo Y02s là cụm camera sau sắc nét với độ phân giải lên đến 8MP với khẩu độ f/2.0 cho ảnh chụp phong cảnh hấp dẫn giúp người dùng có những bức ảnh sống động và rõ nét nhất. Hãng cũng đã tích hợp cho điện thoại Vivo Y02s tính năng chụp Timelaspse giúp người dùng thỏa sức sáng tạo nhiếp ảnh. Ở phía dưới camera chính còn hiện diện đèn flash hỗ trợ chụp đêm rõ chi tiết.Mặt trước điện thoại Vivo Y02s cũng góp mặt thêm camera selfie độ phân giải 5 MP khẩu độ f/2.2 giúp người dùng thỏa thích đam mê selfie, chụp ảnh, ghi lại những khoảnh khắc đáng nhớ bên gia đình.. Tính năng làm đẹp khuôn mặt Face Beauty được tích hợp cho camera selfie, giúp điện thoại Vivo Y02s phát huy hết khả năng chụp ảnh “tự sướng” và mang lại ảnh chụp chất lượng tuyệt hảo.', NULL, NULL),
(759, 'Vivo-Y02s-3G', 'Hiệu năng giải trí ổn định kèm RAM 3 GB và bộ nhớ 32 GB', 'img/Vivo/Vivo-Y02s-3G/4', 'Vivo Y02s sở hữu dung lượng RAM 3 GB đáp ứng được nhu cầu chạy đa ứng dụng, trong khi bộ nhớ lưu trữ 32 GB là mức lý tưởng để người dùng sao lưu dữ liệu cần thiết. Y02s mang trong mình bộ vi xử lý MediaTek Helio P35 (MT6765) với 8 nhân xử lý lên đến 2.35 GHz, mang đến hiệu suất gaming ổn định. Ngoài ra, mẫu điện thoại này còn vận hành trên giao diện Funtouch OS 12 với nền Android 12 tương thích đời mới. Tất cả mang lại cho người dùng Vivo Y02s thao tác nhanh chóng, tránh tình trạng giật lag, khó chịu khi đang sử dụng.Điện thoại Vivo Y02s hỗ trợ 2 khe nano SIM để người dùng có thể sử dụng cho công việc và liên lạc gia đình. Chiếc máy còn có khe mở rộng bộ nhớ bằng thẻ micro SD tiện ích. Ngoài ra, Vivo Y02s còn hỗ trợ WiFi băng thông lên đến 5 GHz, tích hợp Bluetooth 5.0, và trang bị cổng kết nối chuẩn USB Type-C.', NULL, NULL),
(760, 'Vivo-Y02s-3G', 'Thời lượng sử dụng dài lâu thoải mái', 'img/Vivo/Vivo-Y02s-3G/5', 'Nắm bắt nhu cầu người dùng điện thoại Vivo yêu thích giải trí dài lâu hoặc cần thời lượng sử dụng ngày dài, Vivo Y02s chính là chiếc máy phù hợp. Điện thoại Vivo Y02s mang trong mình dung lượng pin tận 5000mAh kết hợp chế độ Tiết kiệm pin, giúp máy vận hành ổn định dài lâu và đáp ứng nhiều thao tác sử dụng.', NULL, NULL),
(761, 'SSG-A23', 'Samsung Galaxy A23 128GB - Bên ngoài có màu sắc mới, bên trong có bộ vi xử lý mang cấu hình tuyệt vời', 'img/Samsung/SSG-A23/2.jpg', 'Samsung Galaxy A23 128GB là chiếc smartphone được thương hiệu sản xuất nhằm phục vụ cho phân khúc khách hàng ưa chuộng những chiếc máy có giá tầm trung nhưng vẫn sở hữu nhiều tính năng cao cấp và hấp dẫn. Galaxy A23 sở hữu những nâng cấp mới mẻ sẽ đáp ứng tốt nhu cầu của bạn.', NULL, NULL),
(762, 'SSG-A23', 'Thiết kế tổng thể bằng nhựa cao cấp', 'img/Samsung/SSG-A23/3.jpg', 'Samsung Galaxy A23 128GB sẽ là thiết bị mang đến cho bạn cảm giác nhẹ nhàng, nhưng vẫn chắc tay với thiết kế phần khung viền và mặt lưng được hoàn thiện từ chất liệu nhựa cao cấp, chất liệu này có thể giảm tải phần lớn trọng lượng của điện thoại nhưng vẫn bảo đảm được tính bền bỉ và đồng thời tiết kiệm giá thành. Mặt lưng đằng sau của Galaxy A23 có những màu sắc người dùng đã nhìn thấy qua, nay thêm vào bộ sưu tập màu sắc Cam đào mang đến cảm giác lạ mắt, khá dịu nhẹ cho khi nhìn nhưng vẫn cực kỳ trẻ trung và nổi bật. Điện thoại còn có màu sắc như Đen, Xanh nhạt và Trắng ngọc giúp bạn thoải mái lựa chọn theo sở thích. Thân máy có thiết kế bo tròn uyển chuyển giữa các góc, được phủ thêm một lớp bóng phía trên tạo thêm điểm nhấn cho sự bóng bẩy, óng ánh của sản phẩm. Tuy nhiên, đối với mặt lưng bóng, việc để lại dấu vân tay và bụi bẩn có thể hiển thị khá rõ trên bề mặt, do đó bạn nên thường xuyên lau chùi, vệ sinh máy hoặc trang bị cho máy ốp lưng để giữ mới thiết bị dài lâu.', NULL, NULL),
(763, 'SSG-A23', 'Màn hình Infinity-V có độ phẩn giải cao', 'img/Samsung/SSG-A23/4.jpg', 'Không giống như các dòng tiền nhiệm, với sự trở lại lần này của Samsung Galaxy A23 128GB, thương hiệu đã chuyển sang sử dụng màn hình Infinity-V với kích thước 6.6 inch và độ phân giải HD+ 720 x 1560 pixels đem đến nội dung hiển thị có độ chuẩn xác cao. Bên cạnh đó, trên màn hình được Samsung trang bị kính cường lực mang tên Corning Gorilla Glass 5, hỗ trợ người dùng chống va đập, trầy xước trong bất kỳ trường hợp nào. Tránh những lực tác động xuất xảy ra với thiết bị trong quá trình sử dụng hằng ngày. Chưa dừng lại ở đó, công nghệ màn hình bao gồm tần số quét 90Hz, cho phép tốc độ làm mới hình ảnh nhanh chóng và mượt mà. Nhưng đối với dòng Galaxy A23 thì tấm nền được sử dụng trên máy lại là TFT thay vì Super AMOLED như dòng tiền nhiệm. Sự thay đổi này thật sự không phải là một quyết định sai lầm, vì tấm nền sẽ cho bạn những nội dung có màu sắc hiển thị tốt, sắc nét và trung thực hơn.', NULL, NULL),
(764, 'SSG-A23', 'Cấu hình hoạt động rất ổn định', 'img/Samsung/SSG-A23/5.jpg', 'Tiếp theo phải nói đến hiệu năng của chiếc Samsung Galaxy A23 128GB này, bên trong chúng gắn một bộ vi xử lý Snapdragon 680. Để đi vào chi tiết, chipset này được sản xuất trên quy trình 6nm, hỗ trợ bởi GPU Adreno 610 và CPU Kryp 265, cho phép máy được nhận hiệu suất vượt trội mà vẫn tiết kiệm điện năng tối ưu. Điều này giúp giảm thiểu giật hình và trục trặc trong khi tăng tốc độ khung hình để phù hợp với kết xuất trong trò chơi. Hỗ trợ hiển thị lên đến 90 khung hình / giây FHD + giúp mọi trò chơi trở nên mượt mà và hoàn hảo. Ngoài ra, con chip cũng giúp xử lý video, hình ảnh rất tốt. Hơn nữa, con chip này sẽ giúp người dùng có trải nghiệm thời lượng pin được cải thiện lên đến 20%, kết hợp Quick Charge 3.0 sạc thiết bị của bạn trong nháy mắt (lên đến 80% chỉ trong 35 phút) đồng thời kéo dài chu kỳ sử dụng pin. Phiên bản sẽ chạy trên hệ điều hành Android 11 và tuỳ biến giao diện OneUI 4.1, RAM 6GB và bộ nhớ trong 128GB, cung cấp không gian lưu trữ khá rộng rãi.', NULL, NULL),
(765, 'SSG-A23', 'Camera chiết xuất hình ảnh chuẩn ', 'img/Samsung/SSG-A23/6.jpg', 'Cụm camera của Samsung Galaxy A23 128GB được đặt bên mạn trái phía trên của phần lưng thiết bị. Xếp gọn gàng thành hình chữ nhật, với bố trí như thế này sẽ tạo cảm giác tinh tế, không bị lố hay chiếm dụng nhiều diện tích. Samsung Galaxy A23 có 4 camera phía sau với camera chính được nâng cấp so với dòng Galaxy A22 từ 48MP lên thành 50MP, camera góc siêu rộng 5MP, camera macro 2MP và ống kính độ sâu 2MP. Camera trên điện thoại mang ưu điểm của hệ thống camera này là khả năng lấy nét nhanh, độ chi tiết tốt, màu sắc tái tạo khá ổn trong môi trường đầy đủ ánh sáng, cho phép bạn sáng tạo và bắt những khoảnh khắc đời thường nhanh và rõ ràng. Độ phân giải chạm 50MP cũng giúp hình ảnh đỡ bị nhoè, bệt và noise hơn khi bạn chụp hình vào buổi tối hay những nơi có ánh sáng không đều. Thêm một điểm cộng khi bạn sở hữu Samsung Galaxy A23 sẽ nằm ở viên pin có dung lượng 5000mAh, kết hợp cùng sạc nhanh 25W cung cấp năng lượng hơn cả ngày cho bạn học tập, làm việc và giải trí. Khi hết pin thì đã có sạc nhanh nạp lại năng lượng nhanh chóng, ổn đinh.', NULL, NULL),
(766, 'SSG-A33', 'Samsung Galaxy A33 128GB - Sở hữu ngoại hình và hiệu năng hoạt động ổn định cao cấp đáng giá', 'img/Samsung/SSG-A33/2.jpg', 'Samsung Galaxy A33 là phiên bản tiếp theo của model Galaxy A32 với ngoại hình và cụm camera sẽ không mang đến cảm giác thân quen cho người dùng. Tuy nhiên, điểm đắt giá để chiếc smartphone tầm trung này đáng được bạn sở hữu sẽ nằm ở cấu hình của chúng, điện thoại được trang bị bộ vi xử lý các tác vụ ấn tượng mạnh.', NULL, NULL),
(767, 'SSG-A33', 'Tổng thể liền mạch, thanh lịch', 'img/Samsung/SSG-A33/3.jpg', 'Samsung Galaxy A33 có thiết kế đầy cuốn hút mặc dù đây là một trong những chiếc smartphone nằm trong phân khúc giá tầm trung. Điện thoại có thiết kế nguyên khối, phần viền và mặt lưng liên kết với nhau tạo nên một tổng thể tinh tế, không cầu kỳ. Sử dụng chất liệu nhựa cao cấp và lớp phủ bóng, tạo nên vẻ đẹp mướt mắt. Galaxy A33 có 3 tùy chọn màu sắc bao gồm Đen, Xanh và Trắng giúp bạn dễ dàng lựa chọn mà không bị phân tâm bởi quá nhiều phiên bản màu sắc. Điểm khác biệt mới trên chiếc điện thoại này so với dòng Galaxy A32 tiền nhiệm là khả năng chống nước chuẩn IP67. Bạn có thể đem theo và sử dụng “ngon ơ” ở nhiều điều kiện thời tiết mà không lo máy sẽ bị hư hỏng nhanh. Mặt lưng của máy có cụm camera được thiết kế hơi khác so với các dòng smartphone tầm trung khác lẫn cái chiếc flagship đắt đỏ tạo nên điểm nhấn đặc trưng cho thiết bị. Bên trong màn hình vẫn được Samsung tích hợp cảm biến vân tay tiện lợi, hỗ trợ mở khoá nhanh chóng và bảo mật hơn so với phương thức mật khẩu truyền thống.', NULL, NULL),
(768, 'SSG-A33', 'Màn hình không có sự thay đổi rõ rệt', 'img/Samsung/SSG-A33/4.jpg', 'Đối với dòng Samsung Galaxy A33, thông số và công nghệ được trang bị cho màn hình sẽ không có quá nhiều điểm khác biệt so với dòng tiền nhiệm. Bởi lẽ Galaxy A32 đã mang đột phá rất lớn khi cải tiến về màn hình. Do đó, Samsung sẽ vẫn tiếp tục mang công nghệ này gắn cho Galaxy A33. Màn hình sở hữu công nghệ tấm nền Super AMOLED với kích thước 6.5 inch vô cực cùng thiết kế Infinity-U, cung cấp độ phân giải Full HD+ mang đến không gian giải trí rộng lớn và tràn đầy màu sắc chân thực, chi tiết rõ ràng. Có thể Samsung Galaxy A33 cũng sẽ mang độ sáng màn hình đạt 800 nits và tần số quét 90Hz, đem lại không chỉ hình ảnh hiển thị sắc nét mà còn giúp trải nghiệm vuốt chạm cực kì mượt mà và khác biệt.', NULL, NULL),
(769, 'SSG-A33', 'Hiệu năng hoạt động nâng cấp', 'img/Samsung/SSG-A33/5.jpg', 'Thế hệ Samsung Galaxy A này sẽ có một số nâng cấp mới về phần hiệu năng. Smartphone này gọi tên bộ vi xử lý MediaTek Dimensity 800U. Chipset khi chế tạo được sản xuất trên tiến trình 7nm TSMC tiên tiến, có 8 lõi bao gồm: 2 lõi ARM Cortex-A76 với xung nhịp lên tới 2.4GHz và 6 lõi Cortex-A55 xung nhịp 2.0GHz, đem đến hiệu năng rất tốt so với các chip trong phân khúc tầm trung. Hơn thế, chip còn trang bị thêm GPU ARM Mali-G57 cho ra trải nghiệm mượt mà. Ngoài ra, con chip này sẽ hỗ trợ người dùng trải nghiệm truy cập 5G tiên tiến nhất hiện nay một cách nhanh chóng và ổn định. Dimensity 800U sở hữu SIM kép 5G. SIM kép 5G cho phép người dùng sử dụng 5G nhanh hơn và gọi video chất lượng hơn hẳn so với dòng chip tiền nhiệm. Được biết, Galaxy A33 sẽ có RAM 8GB và 2 phiên bản bộ nhớ trong là 64GB hoặc 128GB và  vận hành trên nền tảng Android 11 cùng giao diện One UI 3.0.', NULL, NULL),
(770, 'SSG-A33', 'Cụm camera bắt trọn từng khoảnh khắc', 'img/Samsung/SSG-A33/6.jpg', 'Samsung Galaxy A33 sẽ có cụm 4 camera cùng độ phân giải chính 64MP khẩu độ f/1.8 giống như model tiền nhiệm. Hỗ trợ đi kèm là ống kính góc siêu rộng 8MP khẩu độ f/2.2 cho khả năng chụp ảnh với góc độ chạm mức 123 độ. Ống kính phụ lần lượt có độ phân giải 5Mp và 2MP đều cùng khẩu độ f/2.4 cho bạn tính năng chụp ảnh mang chiều sâu và cận cảnh macro cực kì sắc nét và trung thực. Phía trước Samsung thiết kế cho Galaxy A33 camera selfie có độ phân giải 20MP đi kèm khẩu độ f/2.2 và tính năng Bokeh làm mờ hậu cảnh tiên tiến, giúp bạn thoải mái sáng tạo những bức hình “tự sướng” đê mê người nhìn ở bất cứ nơi đâu. Độ phân giải này cũng giúp bạn có thể gọi video call với các thành viên trong gia đình hay bạn bè để “nấu cháo điện thoại” rõ ràng biểu đạt được trọn vẹn cảm xúc.', NULL, NULL);
INSERT INTO `baiviets` (`id`, `MaDT`, `tieude`, `img`, `noidung`, `created_at`, `updated_at`) VALUES
(771, 'SSG-A53', 'Samsung Galaxy A53 - Cấu hình hoạt động tốt hơn, hỗ trợ nhiều chế độ mới mẻ', 'img/Samsung/SSG-A53/2.jpg', 'Samsung Galaxy A53 tiếp nối dòng sản phẩm Samsung A52 với những tính năng mới toanh, bộ vi xử lý và thời lượng pin được cải tiến mạnh mẽ hơn, ngoại hình ra mắt với màu sắc mới thú vị. Nếu bạn vẫn còn chần chừ đối với dòng tiền nhiệm thì phiên bản này sẽ làm cho bạn không thể “cầm lòng” được.', NULL, NULL),
(772, 'SSG-A53', 'Kiểu dáng trẻ trung bắt mắt', 'img/Samsung/SSG-A53/3.jpg', 'Samsung Galaxy A53 được biết sẽ có thiết kế nguyên khối, được hoàn thiện từ nhựa ở mặt lưng và khung bằng nhôm, nhưng vẫn đảm bảo được tính bền bỉ cao, chắc tay mà giữ được trọng lượng “nhẹ tênh” phù hợp cho người dùng không thích chiếc smartphone của mình quá nặng nề gây khó chịu khi bỏ vào túi quần. Phiên bản Samsung A53 mới thì chúng ta sẽ thấy Samsung “tô” cho lớp vỏ màu Gradient có khả năng chuyển màu nhẹ nhàng, cực kỳ hiện đại và trẻ trung với 4 màu sắc mới như Xanh nhạt, Cam đào, Đen và Trắng. Màu sắc của máy kết hợp với đường cắt bóng mang đến cho người dùng hiệu ứng ánh sáng óng ánh đã mắt. Phần camera của Galaxy A53 có cấu trúc không khác gì mấy so với Tổng thể smartphone có các cạnh được bo cong nhẹ nhàng, hài hoà và thanh lịch. Samsung Galaxy A53 sẽ tạo cảm giác mềm mại cho tay người dùng khi cầm nắm sử dụng trong thời gian dài.', NULL, NULL),
(773, 'SSG-A53', 'Màn hình Super AMOLED sống động', 'img/Samsung/SSG-A53/4.jpg', 'Tiếp nối với ngoại hình đẹp mắt, màn hình cũng là một trong những điểm mấu chốt để gây ấn tượng mạnh cho người dùng. Samsung Galaxy A53 được trang bị công nghệ màn hình Super AMOLED với tấm nền IPS cao cấp mặc dù chỉ nằm ở phân khúc giá rẻ. Chủ sở hữu chắc chắn sẽ được đắm chìm trong những bộ phim yêu thích, chơi game giải “hết nấc”. Kích thước màn hình khá lớn ở mức 6.5 inch, kết hợp với độ phân giải Full HD+ 1080 x 2400 pixels, tần số quét cao 120Hz, cho phép hình ảnh hiển thị rõ nét, cho tiết cùng màu sắc chân thực cao. Độ sáng của điện thoại 800 nits với tỷ lệ 20: 9 (mật độ ~ 407 ppi), giúp nội dung được hiển thị bao quát hơn. Viền bezel của thiết bị cũng được tinh chế khá mỏng, nhờ vậy mà màn hình có thể chiếm dụng tối đa diện tích nhất.', NULL, NULL),
(774, 'SSG-A53', 'Bộ vi xử lý mạnh mẽ ', 'img/Samsung/SSG-A53/5.jpg', 'Điện thoại Samsung Galaxy A53 sẽ phát huy hết “công lực” nhờ vào sức mạnh của con chip Exynos 1280 8 lõi, kết hợp với GPU Mali-G68 cho khả năng xử lý tác vụ cực kỳ mượt mà. Để biết rõ hơn về chipset này, chúng được sản xuất trên tiến trình 5nm, CPU ARM Cortex-A78 hoạt động ở tốc độ 2.4GHz và sáu lõi Cortex-A55 với tốc độ 2.0GHz. Điện thoại có RAM ở mức 6-12GB cho khả năng đa nhiệm nhanh chóng và ổn định. Lần “tái xuất” này, Samsung sẽ hỗ trợ dung lượng pin lớn 5000mAh, cao hơn dòng Galaxy A52 1000mAh. Với dung lượng pin được nâng cấp thì người dùng sẽ có thể thoải mái sử dụng cho những tác vụ công việc, giải trí cả ngày không lo về vấn đề hết pin. Ngoài ra, thương hiệu cũng trang bị thêm cho máy sạc nhanh 25W, giúp bạn tiết kiệm tối đa khoảng thời gian sạc giữa những lúc nghỉ ngơi.', NULL, NULL),
(775, 'SSG-A53', 'Hệ thống 4 camera \"cân\" hết', 'img/Samsung/SSG-A53/6.jpg', 'Có thể thấy trên dòng Samsung Galaxy kì này sẽ không có gì thay đổi về thông số kỹ thuật của bộ 4 camera. Camera chính vẫn có độ phân giải là 64MP khẩu độ f/1.8, camera góc siêu rộng 12MP khẩu độ f/2.2, ống kính macro 5 MP và cảm biến độ sâu 5 MP với khẩu độ f/2.4. Sản phẩm có camera selfie 32MP ẩn ở dưới màn hình, khi kích hoạt sẽ tự động xuất hiện và cũng hỗ trợ các tính năng chụp ảnh như Làm đẹp, nhận diện khuôn mặt, chụp với Emoji,…cho ảnh selfie xinh đẹp và thêm thú vị. Ngoài ra, Samsung Galaxy A53 hỗ trợ thêm tính năng HDR và chụp ảnh toàn cảnh, tự động lấy nét, đèn flash, nhận diện khuôn mặt, zoom quang học,...cùng việc quay video 4K @ 30 khung hình / giây, 1080p @ 30/60 khung hình / giây và con quay hồi chuyển EIS cho phép bạn bắt trọn những khoảnh khắc và tuỳ chỉnh, sáng tạo theo khung hình mà mình mong muốn.', NULL, NULL),
(776, 'SSG-A73', 'Samsung Galaxy A73 - Sở hữu thông số mới đáng chú ý về hiệu năng hoạt động, hệ thống camera', 'img/Samsung/SSG-A73/2.jpg', 'Samsung Galaxy A73 mang thiết kế nguyên khối được hoàn thiện cao cấp nhất trong các dòng sản phẩm Galaxy A tính tới thời điểm hiện tại, đi chung với các tuỳ chọn màu trẻ trung, nịnh mắt. Không dừng lại ở đó, điện thoại còn có những cải tiến rõ rệt bên trong cấu hình, màn hình đem đến cho bạn nhiều lợi ích bất ngờ với mức giá hấp dẫn.', NULL, NULL),
(777, 'SSG-A73', 'Kiểu dáng đặc trưng', 'img/Samsung/SSG-A73/3.jpg', 'Samsung Galaxy A73 được thiết kế với kích thước 76.1 x 163.7 x 7.6mm với trọng lượng rất nhẹ nhàng chỉ 181g. Để giữ được trọng lượng nhẹ như vậy thì chất liệu sử dụng để chế tác chiếc smartphone này sẽ là nhựa, tất nhiên là không phải loại nhựa thường, mà là nhựa cao cấp, có tính bền bỉ cao. Chất liệu này giúp ngoại hình vẫn sang trọng nhưng giá thành được cải thiện tối ưu. Mặt lưng của thiết bị hoàn thiện nhám, đây là một điểm đáng khen về thiết kế của Galaxy A73 bởi việc này sẽ giúp hạn chế tình trạng bám dính bụi bẩn và mồ hôi, dấu vân tay khi bạn sử dụng máy và khi nhìn bằng mắt thường, người dùng cũng có thể cảm nhận được vẻ đẹp cao cấp hơn hẳn cái model khác. Điện thoại có phần viền bezel khá mỏng, mặt trước có thiết kế màn hình vô cực Infinity-O đã quá quen thuộc, camera selfie có kích thước lớn hơn một chút so với Samsung A53 nhưng điều này không ảnh hưởng quá nhiều đến trải nghiệm hiển thị nội dung. Hơn thế, sản phẩm sẽ đem đến cho bạn các tuỳ chọn màu sắc trẻ trung như Đen, Trắng và Xanh bạc hà. Kết hợp với khả năng chống nước IP67, tiêu chuẩn này hỗ trợ quá trình sử dụng máy của bạn diễn ra dài lâu theo năm tháng, mặc cho bạn có dùng thiết bị ở bất cứ nơi nào với những điều kiện thời tiết nào, từ khí hậu trong nước ra các nước khác.', NULL, NULL),
(778, 'SSG-A73', 'Công nghệ màn hình tiên tiến, độ phân giải Full HD+', 'img/Samsung/SSG-A73/4.jpg', 'Màn hình của Samsung Galaxy A73 được trang bị tấm nền AMOLED với độ lớn ở mức 6.7 inch chắc chắn sẽ cho bạn không gian hiển thị cực kỳ rộng rãi và bao quát. Thiết bị có độ phân giải Full HD+ 1080 x 2400 pixels và tần số quét ấn tượng lên đến 120Hz. Độ sáng 800 nits của màn hình cũng sẽ gây ấn tượng không kém, mang đến điều kiện trải nghiệm khá tốt khi nhìn dưới điều kiện ánh sáng mạnh. Trên bề mặt của màn hình được bảo vệ bằng kính cường lực Gorilla Glass 5 giúp chống lực va đập nhẹ, trầy xước đáng được “vinh danh” trên chiếc smartphone giá tầm trung này. Ngoài ra, cách Samsung bố trí các phím bấm vẫn không thay đổi so với trên 2 model Galaxy A còn lại, chỉ khác một chút là khe SIM đã được chuyển sang cạnh khác thay vì nằm ở cạnh đáy như trên Galaxy A53. Ở cạnh đáy hiện nay sẽ chỉ còn loa ngoài, micro và cổng sạc Type-C và không có jack cắm 3.5mm.', NULL, NULL),
(779, 'SSG-A73', 'Hiệu năng có cải tiến rõ rệt', 'img/Samsung/SSG-A73/5.jpg', 'Điện thoại Galaxy A73 được đánh giá là mang cấu hình khá mạnh mẽ, có thể cung cấp cho bạn sức mạnh để “gánh” hết những tác vụ từ đơn giản đến phức tạp trung  bình với bộ vi xử lý Snapdragon 778G, chạy trên nền hệ điều hành Android 12 mới mẻ và tuỳ chọn giao diện OneUI 4.1. Chipset Snapdragon 778G sản xuất trên tiến trình tiên tiến 6nm, trang bị 8 lõi xử lý gồm: 1 lõi CPU Kryo 670 Prime hoạt động với hiệu suất 2.4GHz, 3 lõi Kryo 670 Gold và 4 lõi Kryo 670 Silver (dựa trên Cortex-A55), đi kèm với CPU là GPU Adreno 642L mang đến khả năng xử lý đồ họa tốt hơn. Giờ đây bạn có thể dùng Galaxy A73 để giải trí và làm việc mang hiệu quả cao. Bên cạnh đó, thiết bị sẽ có RAM 6Gb/8GB và bộ nhớ trong ở mức 128GB/512GB và thẻ nhớ microSD lên đến 1TB. Đây quả là một tin vui đối với người dùng có nhiều dữ liệu cá nhân cần lưu trong máy.', NULL, NULL),
(780, 'SSG-A73', 'Hệ thống camera “đỉnh”', 'img/Samsung/SSG-A73/6.jpg', 'Cụm camera của Samsung Galaxy A73 có thể tạo dấu ấn khó phai cho bạn với việc thương hiệu đã nâng cấp camera chính của máy lên 108MP, tiếp theo đó là ống kính góc siêu rộng độ phân giải 12MP, camera macro 5MP và cảm biến đo độ sâu trường ảnh 5MP. Kết hợp với đó là tính năng chống rung quang học OIS cũng được tích hợp vào máy và khả năng quay video 4K 2160p@30/60FPS / FHD 1080p@30/60FPS. Người dùng có thể chụp hình và quay phim hứa hẹn mang lại những bức ảnh nét căng, màu sắc tái tạo trung thực, không có độ trễ khi quay, phù hợp không chỉ với người dùng thông thường mà còn phục vụ công việc trên các nền tảng mạng xã hội như Youtube, Tiktok.', NULL, NULL),
(781, 'SSG-A73', 'Dung lượng pin cung cấp cả ngày sử dụng', 'img/Samsung/SSG-A73/7.jpg', 'Samsung Galaxy A73 sở hữu một viên pin có dung lượng 5000mAh khá lớn, giống với hầu hết các model điện thoại thông minh trong cùng phân khúc tầm trung của nhà Samsung. Ngoài ra, nhà sản xuất còn có thêm sạc nhanh 25W giúp rút ngắn thời gian sạc pin của bạn đảm bảo người dùng có nhiều thời gian làm việc khác hơn.', NULL, NULL),
(782, 'SSG-M32', 'Đánh giá điện thoại Samsung Galaxy M32 – điện thoại Samsung giá rẻ', 'img/Samsung/SSG-M32/2.jpg', 'Mới đây Samsung tiếp tục cho ra mắt mẫu điện thoại giá rẻ Samsung M32. Đây là điện thoại thuộc dòng điện thoại Galaxy M ở phân khúc giá rẻ nhưng được trang bị cấu hình tương đối ổn định. Ngoài ra, bạn cũng có thể tham khảo thêm điện thoại Samsung Galaxy M32s với cấu hình được nâng cấp.', NULL, NULL),
(783, 'SSG-M32', 'Thiết kế mặt lưng nhựa bóng, màu sắc đa dạng', 'img/Samsung/SSG-M32/2.jpg', 'Galaxy M32 là sản phẩm thuộc phân khúc giá rẻ nhưng vẫn được trang bị thiết kế bắt mắt. Máy với mặt lưng nhựa bóng cùng các họa tiết sọc độc đáo. Thiết kế mặt lưng nhựa có thể sẽ bán mồ hôi và vân tay do đó người dùng cần vệ sinh thường xuyên để có thể giữ được vẻ đẹp cho điện thoại. Về tổng thể, Samsung M32 không quá nặng nề với tổng trọng lượng khoảng 196gram và độ mỏng 8,4 mm. Các góc cạnh trên điện thoại được bo tròn mềm mại mang lại cho thiết bị khả năng cầm nắm thoải mái, không bị cấn tay.', NULL, NULL),
(784, 'SSG-M32', 'Màn hình FHD 6.5 inch, thiết kế giọt nước', 'img/Samsung/SSG-M32/3.jpg', 'Về thiết kế, điện thoại Samsung Galaxy M32 không có quá nhiều khác biệt so với M22. Điện thoại vẫn sở hữu thiết kế màn hình giọt nước, mặt lưng nhựa. Máy cũng được bán ra với hai phiên bản màu là Đen và Xanh đại dương. Về màn hình, Galaxy M32 được trang bị màn hình FHD 6.4 inch với mật độ điểm ảnh 411 ppi cùng tấm nền Super AMOLED 16 triệu màu. Nhờ đó Samsung m32 cho khả năng hiển thị sắc nét, chi tiết rõ ràng cùng màu sắc sống động. Bên cạnh đó là công nghệ Real Smooth giúp người dùng có những trải nghiệm chạm – lướt một cách tối ưu. Người dùng cũng có thể tùy chỉnh màu sắc hiển thị trên màn hình với hai chế độ là chế độ màu sắc tươi tắn và chế độ tái tạo màu chuẩn.', NULL, NULL),
(785, 'SSG-M32', 'Cụm 4 camera sau, camera chính 64MP, camera selfie 32MP', 'img/Samsung/SSG-M32/4.jpg', 'Về camera, Galaxy M32 có sự nâng cấp về camera so với Samsung M22. Cụ thể máy được trang bị 4 camera, được thiết kế trên modul hình chữ nhật. Trong đó ống kính chính có độ phân giải 64MP cùng khẩu độ f/1.8. Ba camera còn lại lần lượt là: Ống kính siêu rộng 8MP, ống kính macro 2MP và ống kính đo chiều sâu 2MP. Ống kính góc rộng trên Galaxy M32 với góc chụp rộng tới 123 độ, thích hợp sử dụng khi chụp phong cảnh hoặc chụp nhóm. Ống kính macro cận cảnh hỗ trợ lấy nét vật thể ở cự ly gần, nhờ đó đem lại những hình ảnh với chi tiết cao. Người dùng cũng có thể dễ dàng điều chỉnh độ mờ nên để chủ thể bức ảnh trông nổi bật hơn. Ống kính độ sâu trường ảnh với khả năng chụp ảnh chân dung hỗ trợ mang lại những bức hình chất lượng cao đầy chuyên nghiệp. Nhìn chung, trong điều kiện đủ sáng, Samsung M32 mang lại hình ảnh chất lượng với màu sắc tự nhiên, độ chi tiết cao. Nhưng chất lượng hình ảnh có thể sẽ bị giảm đi đôi chút khi người dùng sử dụng trong điều kiện thiếu sáng. Về camera trước, Samsung M32 được trang bị camera trước có độ phân giải 20MP, khẩu độ f/2.0. Nhờ đó người dùng có thể thỏa sức nắm giữ những khoảnh khắc và chia sẻ với bạn bè.', NULL, NULL),
(786, 'SSG-M32', 'Chip MediaTek Helio G80, 8GB RAM', 'img/Samsung/SSG-M32/5.jpg', 'Về cấu hình, điện thoại Samsung Galaxy M32 được trang bị con chip MediaTek Helio G80 lõi 8 cùng với 8GB RAM. Nhờ đó, những tác vụ hàng ngày máy có thể xử lý mượt mà. Cụ thể, trong cách bài test hiệu năng, Samsung M32 cho con số khá ổn định (178.876 điểm Antutu). Khi sử dụng chơi game, điện thoại có thể chơi tốt các tựa game phổ biến như Pubg Mobile hay Liên quân Mobile. Các tác vụ như lướt web, nhắn tin, xem video điện thoại vẫn cho khả năng xử lý mượt mà. Về phần mềm, điện thoại sẽ chạy trên phiên bản giao diện dùng OneUI mới và hệ điều hành Android 11. Giao diện OneUI với khả năng tùy biến giao diện theo sở thích cá nhân giúp người dùng có những trải nghiệm dùng tuyệt vời nhất. Dung lượng bộ nhớ trong 128GB cũng giúp người dùng thoải mái lưu trữ, tải ứng dụng mà không lo đầy bộ nhớ. Ngoài ra, người dùng cũng có thể mở rộng bộ nhớ lưu trữ thông qua khe cắm thẻ nhớ mở rộng với dung lượng tối đa lên đến 1TB. Bên cạnh đó, điện thoại còn được trang bị cụm loa chất lượng mang lại khả năng giải trí âm thanh ấn tượng. Cụm loa thoại mang lại âm thanh rõ ràng, giúp các cuộc đàm thoại diễn ra liền mạch.', NULL, NULL),
(787, 'SSG-M32', 'Pin 5000 mAh, hỗ trợ sạc nhanh 25W', 'img/Samsung/SSG-M32/6.jpg', 'Về dung lượng pin, máy được trang bị viên pin dung lượng lớn lên đến 5.000 mAh. Với dung lượng này người dùng có thể dùng cả ngày với tần suất cao. Với người dùng cơ bản thậm chí có thể dùng đến 2 ngày mà không cần sạc pin. Hơn thế nữa, máy còn trang bị công nghệ sạc nhanh 25W, nhờ đó giúp bổ sung năng lượng một cách nhanh chóng. Tuy nhiên, Samsung sẽ không sạc bị củ sạc nhanh 25W kèm máy thay vào đó là củ sạc 15W. Do đó, khi sử dụng sạc kèm trong hộp, người dùng sẽ mất khoảng gần 2 tiếng rưỡi để sạc đầy pin. Nếu sử dụng sạc chuẩn 25W, thời gian này sẽ rút ngắn còn khoảng 1 giờ 30 phút.', NULL, NULL),
(788, 'SSG-M32', 'Bảo mật vân tay tối ưu cùng Samsung Knox ', 'img/Samsung/SSG-M32/7.jpg', 'Samsung M32 được trang bị công nghệ bảo mật cấp quốc phòng Samsung Knox nhờ đó giúp bảo vệ mọi dữ liệu của người dùng, kể cả khi điện thoại đang khởi động. Công nghệ giúp bảo vệ dữ liệu của người dùng hiệu quả khỏi các cuộc tấn công dữ liệu hoặc phần mềm độc hại. Điện thoại cũng sẽ được trang bị cảm biến vân tay thông minh được tích hợp trong nút nguồn giúp mở khóa dễ dàng, kể cả trong bóng tối.', NULL, NULL),
(789, 'SSGNote-20-Ultra', 'Thiết kế sang trọng', 'img/Samsung/SSGNote-20-Ultra/2.jpg', 'Galaxy Note 20 Ultra vẫn giữ nguyên thiết kế nam tính. Máy sở hữu thiết kế vuông vức, sang trọng bên ngoài máy được phủ một lớp sơn mờ chống dấu vân tây. Điện thoại có ba phiên bản màu sắc là Đồng Ánh Kim, Trắng Huyền Bí và Đen Huyền Bí. Trong đó màu đen và trắng sử dụng chất liệu kính bóng bẩy. Bên cạnh đó màu đồng được phủ thêm lớp nhám mờ. Mặt trước chúng ta sẽ có một chiếc màn hình lớn lên tới 6.9 inch và phải nói đây là một màn hình rất lớn đấy. Chiếc màn hình tràn viền của Note 20 Ultra có độ phân giải QHD+ (3088 x 1440 px) và sử dụng công nghệ Dynamic AMOLED 2x cho độ sáng tăng thêm 25%. Màn hình của máy được bảo vệ bởi kính cường lực Corning Gorilla Glass 7. Điện thoại thông minh được trang bị máy quét vân tay siêu âm trong màn hình, giúp quá trình mở máy nhanh chóng, hiệu quả hơn. Ngoài ra, màn hình của Note 20 Ultra còn có tốc độ làm tươi lên tới 120 Hz để đem lại sự mượt mà.', NULL, NULL),
(790, 'SSGNote-20-Ultra', 'Cấu hình mạnh mẽ', 'img/Samsung/SSGNote-20-Ultra/3.jpg', 'Samsung Galaxy Note 20 Ultra sẽ có chung con chip Exynos 990 với Note 20. Phiên bản 4G sẽ có RAM 8 GB, tùy chọn ROM 256 GB hoặc 512 GB.', NULL, NULL),
(791, 'SSGNote-20-Ultra', 'Hệ thống camera chất lượng', 'img/Samsung/SSGNote-20-Ultra/4.jpg', 'Điện thoại Galaxy Note 20 Ultra có cụm camera hình chữ nhật ở mặt sau. Máy được trang bị hệ thống bốn camera sau. Cụm camera sau bao gồm camera chính 108MP, camera góc siêu rộng 12MP, camera tele 12MP và cảm biến laser để lấy nét nhanh và chuẩn hơn. Camera tele của máy có tính năng zoom quang 5x và zoom kỹ thuật số 50x. Với camera chính lên đến 108MP hứa hẹn sẽ mang đến cho người dùng những hình ảnh chất lượng tốt, sắc nét. Ngoài ra, camera của máy còn hỗ trợ zoom quang 50x cho chất lượng ảnh ra tốt hơn so với thế hệ trước. Với hệ thống camera khủng, Galaxy Note 20 Ultra có thể dễ dàng hỗ trợ người dùng bắt trọn từng khoảnh khắc trong cuộc sống.', NULL, NULL),
(792, 'SSGNote-20-Ultra', 'Bút S-Pen thế hệ mới', 'img/Samsung/SSGNote-20-Ultra/5.jpg', 'Về chiếc bút S-pen của máy, bút đã giảm mức độ trễ từ 42ms trên người tiền nhiệm thành 9ms. Bên trong, Note 20 Ultra sở hữu chip Snapdragon 865+ dành cho thị trường Mỹ và Exynos 990 mở bán tại các thị trường khác. Kết hợp với con chip này là 8GB RAM và bộ nhớ trong 256GB.', NULL, NULL),
(793, 'SSGNote-20-Ultra', 'Dung lượng pin lớn, thoải mái sử dụng', 'img/Samsung/SSGNote-20-Ultra/6.jpg', 'Galaxy Note 20 Ultra 256GB được trang bị viên pin 5000mAh. Điện thoại được trang bị công nghệ sạc nhanh 45W, giúp tiết kiệm được thời gian sạc tối đa cho người dùng. Với nhu cầu thông thường như lướt web, xem phim, mạng xã hội thì máy có thể trụ được lên đến 2 ngày cho một lần sạc.', NULL, NULL),
(794, 'SSG-S20-FE', 'Màn hình 6.5inch Super AMOLED, công nghệ HDR10, tần số quét 120Hz', 'img/Samsung/SSG-S20-FE/2.jpg', 'Galaxy S20 FE 256GB sở hữu màn hình lớn với kích thước 6.5inch độ phân giải FullHD+ cùng tấm nền Super AMOLED cao cấp giúp hình ảnh được hiển thị sắc nét, màu sắc rực rỡ. Bên cạnh đó, màn hình trên chiếc Galaxy S20 FE 256GB còn hỗ trợ tần số quét màn hình lên đến 120Hz cùng công nghệ hiển thị HDR 10 giúp tăng độ tương phản mang lại trải nghiệm hình ảnh chân thật nhất. Giờ đây, người dùng có thể tận hưởng từng phút giây giải trí hoàn hảo dù là chơi game hoặc xem phim…', NULL, NULL),
(795, 'SSG-S20-FE', '', 'img/Samsung/SSG-S20-FE/3.jpg', '', NULL, NULL),
(796, 'SSG-S20-FE', 'Hiệu năng tuyệt đỉnh với con chip Snapdragon 865', 'img/Samsung/SSG-S20-FE/4.jpg', 'Galaxy S20 FE 2556GB được trang bị con chip Qualcomm Snapdragon 865 mạnh mẽ mang lại hiệu năng cao nhưng vẫn tiết kiệm pin nhờ được áp dụng tiến trình 7nm. Với bộ vi xử lý này máy có thể xử lý nhiều tác vụ khác nhau mượt mà hơn. Ngoài ra, sản phẩm còn được trang bị dung lượng RAM khá khủng lên đến 8GB cùng bộ nhớ trong 256GB. Với dung lượng RAM lớn người dùng có thể xử lý nhiều tác vụ cùng lúc một cách mượt mà. Ngoài ra chuẩn bộ nhớ UFS 3.1 mới nhất cho tốc độ đọc ghi cao giúp việc chuyển file giữa Galaxy S20 Fe 256GB với các thiết bị khác nhanh chóng hơn. Về khả năng chơi game, với cấu hình khủng cùng dung lượng RAM lớn người dùng có thể yên tâm chơi tất cả các tựa game nặng ở thời điểm hiện tại mà không sợ xảy ra tình trạng giật, lag.', NULL, NULL),
(797, 'SSG-S20-FE', 'Cụm 3 camera chất lượng', 'img/Samsung/SSG-S20-FE/5.jpg', 'Galaxy S20 FE 256GB sở hữu cụm 3 camera được đặt trong một mô-đun hình chữ nhật ở mặt lưng tương tự như đàn anh Galaxy S20. Với cụm 3 camera bao gồm: camera chính 12MP hỗ trợ quay phim 8K 30FPS đi kèm với chống rung quang học OIS cùng chống rung điện tử EIS, camera góc siêu rộng 12MP cho trường nhìn lên đến 120 độ, camera tele 8MP cho khả năng zoom quang học 3X. Hình ảnh được chụp trên Galaxy S20 Fe 256GB cho chất lượng ảnh khá tốt. Hình ảnh có độ chi tiết cao, màu sắc tươi tắn trong điều kiện đầy đủ ánh sáng. Trong điều kiện thiếu sáng, nhờ cảm biến lớn cùng chế độ chụp đêm nên những hình ảnh cho ra vẫn có độ chi tiết khá tốt, ít bị noise. Camera Selfie cũng là một điểm cộng trên sản phẩm khi được hãng trang bị camera với độ phân giải lên đến 32MP. Nhờ cảm biến lớn cùng nhiều chế độ làm đẹp hứa hẹn sẽ mang lại cho người dùng nhiều tấm ảnh Selfie đẹp nhất.', NULL, NULL),
(798, 'SSG-S20-FE', 'Dung lượng pin lớn, hỗ trợ sạc nhanh', 'img/Samsung/SSG-S20-FE/6.jpg', 'Galaxy S20 FE 256GB được Samsung trang bị viên pin với dung lượng 4500 mAh. Với dung lượng pin lớn cùng màn hình AMOLED tiết kiệm điện giúp máy có thể sử dụng cả một ngày dài mà không lo lắng về vấn đề hết pin trên chiếc điện thoại này. Máy cũng được Samsung trang bị công nghệ sạc nhanh 15W giúp người dùng có thể nhanh chóng sạc lại đầy pin cho sản phẩm mà không mất thời gian quá lâu.', NULL, NULL),
(799, 'SSG-S22-Ultra', 'Samsung Galaxy S22 Ultra 256GB - Mang trong mình những nâng cấp hiện đại bậc nhất năm 2022.', 'img/Samsung/SSG-S22-Ultra/2.jpg', 'Điện thoại S22 Ultra 256GB trình làng với những tính năng cao cấp cũng như hiệu suất hoạt động đến từ bộ vi xử lý cực kỳ hiện đại, kết hợp song song là ngoại hình nâng vẻ đẹp đẳng cấp, thượng lưu cho bất cứ ai sở hữu chiếc smartphone này.', NULL, NULL),
(800, 'SSG-S22-Ultra', 'Thiết kế “chanh sả” ngút ngàn', 'img/Samsung/SSG-S22-Ultra/3.jpg', 'Samsung Galaxy S22 Ultra 256GB được chế tác có hình dáng vuông vức và có thể nói là cứng cáp hơn so với dòng Galaxy S21 tiền nhiệm, độ dày và cạnh vuông nhô ra hơn và chúng trông “na ná” với dòng điện thoại Galaxy Note, nhưng bạn vẫn có thể nhìn ra ngay điểm khác biệt giữa những dòng smartphone này. Điện thoại Galaxy S22 Ultra 256GB có kích thước mỏng với viền bezel cực mỏng, khiến cho độ lớn của màn hình chính tràn ra gần như 100%, hơi cong một chút đem làm tầm nhìn bao quát, trọn vẹn nhất khi sử dụng. Không những vậy, thiết kế mặt khung của thiết bị cũng đem lại cảm giác cầm nắm nhẹ nhàng, thoải mái không bị cấn tay. Dòng thiết bị này sở hữu 2 mặt đều được phủ lớp kính cường lực Corning Gorilla Glass Victus vừa mang độ cứng cáp giúp bảo vệ điện thoại khỏi va đập trầy xước khi rớt từ độ cao 2m, vừa có khả năng chống chói, chống loá tối ưu bảo vệ đôi mắt của chủ sở hữu kể cả khi bạn nhìn vào màn hình nhiều giờ liên tục. Lưng của S22 Ultra 256GB sử dụng chất liệu kim nhôm với 4 gam màu sắc sang trọng Đen, Trắng, Xanh lục, Đỏ đậm. Điểm nhấn đặc biệt của Samsung Galaxy S22 Ultra 256GB sẽ rơi vào thiết kế cụm camera ở mặt sau, gồm bộ 3 camera chính nằm thành 1 hàng dọc ở trên cùng bên trái mang vẻ đẹp lạ mắt, ấn tượng. Viền của camera liền mạch và tiệp màu với mặt lưng của từng phiên bản.', NULL, NULL),
(801, 'SSG-S22-Ultra', 'Màn hình nét mượt mà - Hỗ trợ thêm S-Pen', 'img/Samsung/SSG-S22-Ultra/4.jpg', 'Để biến chiếc điện thoại Galaxy S22 Ultra 256GB thành một cú hit trong năm 2022, Samsung đã trang bị cho thiết bị của mình màn hình có kích thước siêu lớn lên đến 6.8 inch kết hợp với công nghệ Dynamic AMOLED 2X và độ phân giải chạm mức 2K 1440 x 3088 pixels, thêm khả năng hiển thị HDR10+ sắc sảo, tốc độ làm tươi nội dung hiển thị 120Hz. Ngoài ra, màn hình trang bị mật độ điểm ảnh 516 PPI và tỷ lệ so với thân máy là 87.81%, cho phép khả năng hiển thị nội dung được đẩy lên cao nhất, từ đó nâng lên trải nghiệm sử dụng của người dùng thật sự tuyệt vời. Những hình ảnh hiển thị trên Samsung S22 Ultra 256GB sẽ sắc sảo, gam màu sống động và rất tự nhiên. Hơn thế, theo những tin đồn gần đây thì S22 Ultra 256GB lần này khi xuất xưởng sẽ có đi kèm với bút S-Pen mà từ trước đến nay thương hiệu chỉ hỗ trợ trên các dòng Galaxy Note. Mang đến nhiều hơn sự tiện lợi cho người dùng và đem đến cơ hội trải nghiệm những tiện ích cao cấp đến từ sản phẩm S-Pen.', NULL, NULL),
(802, 'SSG-S22-Ultra', 'Sức mạnh khủng đáng gờm', 'img/Samsung/SSG-S22-Ultra/5.jpg', 'Con chip mang tên Qualcomm Snapdragon 8 Gen 1 được sản xuất trên tiến trình 4nm EUV là con chip cung cấp sức mạnh hoạt động cho điện thoại Samsung Galaxy S22 Ultra 256GB. Chipset được thiết kế CPU 8 lõi với cấu trúc ARMv9, CPU của Snapdragon 8 Gen 1 chia làm 3 cụm, trong đó gồm 1 lõi chính Cortex-X2, 3 lõi lớn Cortex-A710 và 4 lõi nhỏ Cortex-A510. Bên cạnh đó, bộ vi xử lý Snapdragon 8 Gen 1 được trang bị GPU mới của Adreno, hứa hẹn tăng 30% hiệu suất và tiết kiệm điện năng lên đến 25% nhờ sử dụng kiến ​​trúc mới. Phiên bản này sở hữu RAM 12GB và bộ nhớ trong 256GB mang cấu hình mạnh, dễ dàng “đánh vật” những tựa game ở cấp độ console trên nền tảng di động mượt mà, nhạy bén và không bị bất kì độ trễ nào. Samsung còn trang bị thêm một số công nghệ khác như bộ điều khiển đa IP tiên tiến (AMIGO) giúp nâng cao hiệu suất và khả năng quản lý năng lượng để giảm tiêu hao pin với các trò chơi có độ phân giải cao. Ngoài con chip thì viên pin cung cấp năng lượng cho điện thoại sẽ có dung lượng là 5000mAh và sạc nhanh 45W, hỗ trợ bạn nạp “nguồn sống” cho thiết bị nhanh chóng.', NULL, NULL),
(803, 'SSG-S22-Ultra', 'Camera cho ra những hình ảnh đỉnh cao', 'img/Samsung/SSG-S22-Ultra/6.jpg', 'Chỉ cần thoạt nhìn vào thiết kế lạ mắt của cụm 4 camera, người dùng có thể cảm nhận ngay được sự nâng cấp của chúng và đúng như thế, cụm camera trên Samsung S22 Ultra 256GB chính là điểm nhấn khác biệt nổi bật nhất. Camera chính của điện thoại có độ phân giải 108MP, đi chung với camera phụ góc rộng 12MP, 2 camera tele 10MP và các tính năng chụp ảnh, quay phim thông minh như tính năng chống rung OIS dịch chuyển. Tính năng tự động lấy nét AI, cho ra những hình ảnh chất lượng HDR sắc nét, giúp xử lý ảnh tốt hơn nữa so với dòng máy cũ. Samsung cũng cải tiến thêm về độ sáng của ảnh và khả năng thu hình chi tiết ở chế độ Ban đêm. Mặt trước có 1 camera selfie nằm ở giữa phía trên màn hình hỗ trợ độ phân giải 40MP cùng với các tính năng: Nhận diện khuôn mặt, quay phim 4K, Full HD, Tự động lấy nét AF và Xoá phông,... ', NULL, NULL),
(804, 'SSGZ-Flip3', 'Những điều bạn cần biết về Galaxy Z Flip 3', 'img/Samsung/SSGZ-Flip3/2.jpg', 'Đây là mẫu điện thoại màn hình gập có kích thước nhỏ hơn, giá cả phải chăng hơn của Samsung. Trong khi Galaxy Z Fold 3 là mẫu điện thoại có thể biến thành máy tính bảng thì Galaxy Z Flip 3 là mẫu điện thoại có thể thu nhỏ kích thước để dễ bỏ túi hơn. Tôi sẽ không cho rằng đây là mẫu điện thoại màn hình gập dành cho người nghèo vì nó vẫn đắt. Tuy nhiên, Galaxy Z Flip 3 có thể chính là cánh cửa dẫn bạn đến thế giới của điện thoại màn hình gập nhờ mức giá phải chăng và thiết kế trang nhã. Galaxy Z Flip nguyên bản có mức giá thấp nhất là 35 triệu đồng. Trong khi đó, Galaxy Z Flip 3 có mức giá chỉ từ 25 triệu đồng mà thôi. Phiên bản bộ nhớ trong 256GB chỉ đắt hơn 2 triệu. Và chúng tôi khuyên bạn chọn phiên bản này nếu bạn là người cần nhiều dung lượng lưu trữ vì máy không hề có khe thẻ nhớ mở rộng. Với cách định giá này, Galaxy Z Flip 3 đối đầu trực tiếp với iPhone 13, Galaxy S21 Ultra 5G, OPPO Find X3 Pro 5G và những điện thoại cao cấp khác trong khoảng giá 25 triệu đồng. Cũng như Galaxy Z Fold 3, Samsung đang cung cấp các ưu đãi giảm giá đầy giá trị. Bạn hoàn toàn có thể mua mẫu điện thoại này chỉ với 12 triệu đồng nếu tham gia chương trình thu cũ đổi mới. Galaxy Z Flip 3 có hai phiên bản bộ nhớ trong và bảy tùy chọn màu sắc để bạn thoải mái lựa chọn. Tuy nhiên, màu Xám Phantom, Trắng Flora và Hồng Bloom chỉ được bán độc quyền tại Samsung.com. Đen Phantom là tùy chọn màu duy nhất có mặt lưng hoàn thiện nhám. Đi kèm trong hộp chỉ có cáp và cây lấy SIM, không có củ sạc.', NULL, NULL),
(805, 'SSGZ-Flip3', 'Về phần cứng mới', 'img/Samsung/SSGZ-Flip3/3.jpg', 'Công thức tạo ra phần cứng của Galaxy Z Flip 3 cũng tương tự như của Galaxy Z Fold 3. Samsung đã đại tu khung máy từ trong ra ngoài bằng vật liệu và ngoại hình mới. Ở góc độ phần cứng, Galaxy Z Flip 3 tốt hơn nhiều so với thế hệ tiền nhiệm. Bạn cần biết rằng Galaxy Z Flip và Galaxy Z Flip 5G là hai thiết bị gần như giống hệt nhau. Sự khác biệt nằm ở bộ vi xử lí và khả năng hỗ trợ 5G. Còn các khía cạnh còn lại thì hai máy đều giống nhau. Hay nói cách khác, sự khác biệt giữa hai mẫu điện thoại này và Galaxy Z Flip 3 đáng kể hơn rất nhiều.Đầu tiên, hãy nói đến vật liệu. Galaxy Z Flip 3 sử dụng nhôm Armor Aluminum và kính Gorilla Glass Victus tương tự như Galaxy Z Fold 3. Điều này đã làm cho Galaxy Z Flip 3 cứng cáp hơn rất nhiều. Samsung cho biết Armor Aluminum mạnh hơn nhôm series 7.000 và Gorilla Glass Victus là sản phẩm tốt nhất mà Corning cung cấp ở thời điểm hiện tại với khả năng kháng vỡ và kháng xước đều được cải thiện. Samsung còn thay đổi hình dạng của các tấm kính bên ngoài. Mặt kính của Galaxy Z Flip 3 được làm phẳng và ghép khít vào khung kim loại. Hình dạng tổng thể được thiết kế lại. Samsung chỉ bo tròn các góc một ít. Vì vậy mà Galaxy Z Flip 3 trông vuông vức hơn thế hệ tiền nhiệm. Nhưng nhờ kích thước tổng thể được giảm đi một chút mà máy vẫn trông thanh mảnh ngay cả khi đóng lại. Bản lề đã cứng cáp hơn bao giờ hết. Thiết kế cơ bản của bản lề vẫn như cũ, tức là nó sẽ biến mất hoàn toàn khi điện thoại mở ra hết cỡ. Bạn có thể mở Galaxy Z Flip 3 ở bất kì góc độ nào. Điều này khiến cho mẫu điện thoại có thể biến thành một chiếc laptop cỡ nhỏ hay giá ba chân khi chụp hình. Sẽ khá khó để mở máy bằng một tay vì bản lề không có lò xo. Mặt khác, cũng chỉ với một tay, ta lại có thể giật bung điện thoại khá dễ dàng. Đương nhiên là Samsung có cải thiện độ bền của màn hình chính. Nó được phủ một lớp phim PET (polyethylene terephthalate) có tính co giãn cao. Nhờ vậy mà màn hình chính bền hơn đến 80%. Do đó, Galaxy Z Flip 3 không còn mỏng manh như thế hệ tiền nhiệm nữa. Galaxy Z Flip 3 đạt chuẩn kháng nước IPX8. Đây là một nâng cấp lớn và thực sự đã làm tăng sức hấp dẫn của Galaxy Z Flip lên rất nhiều. Tuy nhiên, cũng như Galaxy Z Fold 3, máy không hề kháng bụi. IPX8 có nghĩa là điện thoại có thể bị ngâm trong nước ở độ sâu 1,5m trong vòng 30 phút. Vì vậy, mồ hôi và mưa chắc chắn không phải là vấn đề đối với Galaxy Z Flip 3. Bạn chỉ cần cẩn thận giữ máy tránh xa bụi và đất.Galaxy Z Flip 3 có phím nguồn kiêm đầu đọc dấu vân tay ở cạnh bên. Nó khá là chìm nên khó xác định vị trí khi đang vội. Nhưng đầu đọc hoạt động rất nhanh chóng và chính xác một cách đáng kinh ngạc. Còn phím âm lượng thì có hành trình duy chuyển và độ phản hồi tuyệt vời. Galaxy Z Flip 3 dùng cổng USB-C để sạc và truyền dữ liệu. Máy hỗ trợ 1 Nano SIM + 1 eSIM và không có khe cắm thẻ nhớ. Bạn sẽ được trải nghiệm công nghệ âm thanh nổi Dolby Atmos do máy có loa kép. Đây là một nâng cấp tuyệt vời so với loa đơn trên thế hệ tiền nhiệm. Tuy nhiên, Galaxy Z Flip 3 không cho ra âm thanh cân bằng và sinh động như Galaxy Z Fold 3 (vốn có nhiều không gian hơn cho loa). Nhưng điều đó không đồng nghĩa với việc máy có cặp loa tệ. Galaxy Z Flip 3 cho ra âm thanh lớn và có chất lượng hoàn toàn ổn trong mức giá. Samsung đã thực hiện tất cả những thay đổi trên mà không làm thay đổi mục đích thiết kế của Galaxy Z Flip 3. Đây vãn là một mẫu điện thoại có kích thước bình thường nhưng có thể gập lại để dễ dàng bỏ túi hơn. Khi gập lại, máy chỉ có kích thước 10,67cm theo đường chéo. Tôi thực sự đánh giá cao điều này. Nếu không gian túi của bạn có hạn, Galaxy Z Flip 3 có thể là chiếc điện thoại bạn đang cần.', NULL, NULL),
(806, 'SSGZ-Flip3', 'Màn hình dẻo có tốt không?', 'img/Samsung/SSGZ-Flip3/4.jpg', 'Như đã nói ở trên, màn hình Dynamic AMOLED Infinity Flex 6,7″ có lớp phim bảo vệ mới giúp tâng độ bền. Nếu bạn đã từng có cơ hội dùng thử Galaxy Z Flip phiên bản đầu tiên, bạn sẽ ngay lập tức nhận ra sự khác biệt. Tương tự như trên Galaxy Z Fold 3, lớp phủ bên ngoài của màn hình chính có khả năng phản xạ cực cao khiến cho độ chói cao hơn bình thường. Màn hình chính có độ phân giải 2,600 x 1,080 như của Galaxy Z Flip 5G với mật độ điểm ảnh 425ppi và trông sắc nét và sống động hơn bao giờ hết. Tôi không hề gặp khó khăn gì khi sử dụng Galaxy Z Flip 3 ngoài trời nắng. Màn hình của máy cao và hẹp do có tỉ lệ 22:9, cực kì phù hợp với việc lướt mạng. Và tần số quét 120Hz khiến cho mọi thao tác trông cực kì mượt mà. Bạn có thể dùng tần số quét 60Hz tiêu chuẩn nếu bạn muốn tiết kiệm pin. Về nhược điểm, nếp gấp ở giữa màn hình vẫn trông rõ ràng cho dù màn hình đang bật hay tắt. Bạn cũng có thể dễ dàng xác định vị trí của nó bằng xúc giác. Mặc dù nếp nhăn có thể khiến một số người khó chịu, đối với một mảnh kính bị uốn cong, màn hình chính của Galaxy Z Flip 3 đã hoàn thành tốt nhiệm vụ của mình. Tuy nhiên, chúng ta vẫn không biết phải mất bao năm nữa nhược điểm này mới được khắc phục.', NULL, NULL),
(807, 'SSGZ-Flip4', 'Thiết kế không mới, vẫn hướng trực tiếp đến người dùng nữ giới', 'img/Samsung/SSGZ-Flip4/2.jpg', 'Mẫu smartphone màn hình gập vỏ sò mới của Samsung vốn không sở hữu bất kỳ cải tiến vượt trội nào về mặt ngoại hình. Nếu đặt cạnh chiếc Z Flip4 bên cạnh thế hệ tiền nhiệm, sẽ rất khó để chỉ ra điểm khác biệt. Nếu để ý thật kỹ thì phần khung viền nhôm của Z Flip4 được hoàn thiện phẳng và bóng bẩy hơn đôi chút so với mẫu máy ra mắt năm 2021. Mặt lưng của Z Flip4 năm nay vẫn được hoàn thiện dạng kính nhám với 4 màu sắc là Xám Đen, Vàng Đồng, Xanh và Tím Bora, màu đặc trưng nhất của dòng Z Flip4. Ngoài ra, Samsung còn giới thiệu một phiên bản đặc biệt có tên là Z Flip4 Be Spoke cho phép người dùng tự tùy chọn màu sắc cho mặt lưng máy để thể hiện cá tính riêng của chính mình. Tuy nhiên, phiên bản này cũng có giá bán đắt hơn tương đối so với 4 tùy chọn màu có sẵn.', NULL, NULL),
(808, 'SSGZ-Flip4', 'Hai màn hình hiển thị đẹp nhưng vẫn còn điểm yếu', 'img/Samsung/SSGZ-Flip4/3.jpg', 'Samsung trang bị cho Z Flip4 2 phần màn hình. Đầu tiên là màn hình gập 6,7 inch là thành phần được người dùng tương tác nhiều nhất. Về chất lượng hiển thị, tấm nền Dynamic AMOLED 2X với công nghệ HDR10+ vẫn thể hiện cực kỳ tốt trên nhiều khía cạnh như độ tương phản, độ nét hay khả năng tái tạo màu sắc. Tuy không có gì để chê về chất lượng hiển thị việc vẫn sở hữu “vết hằn” ngay giữa màn hình khiến trải nghiệm vuốt chạm trên Z Flip4 bị ảnh hưởng ít nhiều. Do đó, để tránh cảm giác “hụt hẫng” khi sử dụng, người dùng chỉ nên vuốt chạm ở phần nửa dưới của màn hình.', NULL, NULL),
(809, 'SSGZ-Flip4', 'Bộ 3 camera không thay đổi, vẫn đủ cho hội chị em tự sướng', 'img/Samsung/SSGZ-Flip4/4.jpg', 'Là một mẫu máy hướng đến người dùng nữ giới là chủ yếu nhưng Samsung đã quyết định không nâng cấp bất kỳ thông số camera nào cho Z Flip4. Ảnh chụp ra từ camera chính của mẫu máy này thể hiện khá tốt ở điều kiện đầy đủ sáng, ảnh cho ra với màu sắc rực rỡ, chi tiết tốt. Phong độ này vẫn được duy trì khi đổi sang góc siêu rộng. Ảnh chụp ra từ camera chính của mẫu máy này thể hiện khá tốt ở điều kiện đầy đủ sáng, ảnh cho ra với màu sắc rực rỡ, chi tiết tốt. Phong độ này vẫn được duy trì khi đổi sang góc siêu rộng.', NULL, NULL),
(810, 'SSGZ-Fold4', 'Ngoại hình Samsung Z Fold 4', 'img/Samsung/SSGZ-Fold4/2.jpg', 'Trọng lượng điện thoại màn hình gập mới nhẹ hơn 10 gram so với phiên bản trước đó. Cụ thể trên Galaxy Z Fold 4 chỉ nặng 263 gram trong khi trên Galaxy Z Fold 3 là 271 gram. Không chỉ vậy, gã khổng lồ công nghệ Hàn Quốc cũng đã tối ưu phần bản lề giúp thiết bị mỏng hơn và tỷ lệ màn hình có phần rộng và ngắn hơn một chút. Tỷ lệ màn hình của Galaxy Z Fold 4 là 23,1:19 và trên điện thoại màn hình gập Galaxy Z Fold 3 là 22,5: 18. Nhiều người kỳ vọng Samsung sẽ trang bị cảm biến vân tay dưới màn hình cho flagship mới của mình, nhưng thật đáng tiếc khi công ty tiếp tục tích hợp ở nút nguồn như model trước. Nhưng không vì vậy mà tốc độ mở khóa và độ nhạy cảm biến bị ảnh hưởng, nó vẫn mang đến độ chính xác và linh hoạt cho người dùng. Năm nay, Samsung mang đến cho người dùng muốn mua Galaxy Z Fold 4 các tùy chọn màu sắc như Greygreen\", Phantom Black, Beige và Burgundy. Các biến thể này đều được trang bị khả năng chống nước IPX8 cho phép điện thoại có thể tồn tại ở độ sâu 1,5m trong thời gian 30 phút.', NULL, NULL),
(811, 'SSGZ-Fold4', 'Màn hình Samsung Z Fold 4 mang đến đa nhiệm tuyệt vời', 'img/Samsung/SSGZ-Fold4/3.jpg', 'Màn hình chính của máy được trang bị màn hình Dynamic AMOLED 7,6 inch với độ phân giải 2176 x 1812 pixel. Điều này mang đến màu sắc hiển thị đẹp mắt, hình ảnh sống động và độ sáng cao. Đây cũng chính là ưu điểm của màn hình Samsung. Một điểm khá đáng tiếc là nếp gấp trên điện thoại vẫn còn khá nhiều và không có cải thiện so với thế hệ Galaxy Z Fold 3. Nhưng để lại bỏ hoàn toàn là một thách thức lớn đối với Samsung. Màn hình phụ của Galaxy Z Fold 4 tiếp tục giữ nguyên kích thước 6,2 inch và có thiết kế nốt ruồi, viền bezel được tối ưu mỏng mang đến không gian hiển thị lớn và tốt hơn. Bạn có thể trải nghiệm các tác vụ thông thường như lướt web, tin nhắn...khá tiện lợi.Điểm cộng dành cho Samsung khi tíc hợp tốc độ làm mới 120Hz cho cả màn hình chính và màn hình phụ của Galaxy Z Fold 4. Điều này có nghĩa là thiết bị sẽ mang đến khả năng chơi game siêu mượt, màu sắc rực rỡ và cuộn màn hình linh hoạt. Nếu như màn hình ngoài chỉ có thể thay đổi tần số quét xuống mức thấp nhất là 48Hz thì trên màn hình chính là 1Hz.', NULL, NULL),
(812, 'SSGZ-Fold4', 'Camera với cảm biến 50MP', 'img/Samsung/SSGZ-Fold4/4.jpg', 'Camera Galaxy Z Fold 4 nhận được một số nâng cấp so với thế hệ tiền nhiệm. Điện thoại được trang bị ống kính chính có độ phân giải 50MP, camera tele 10MP hỗ trợ zoom quang 3x và camera siêu rộng 12MP.  Thiết lập camera này khá giống với các điện thoại Galaxy S22 và Galaxy S22+. Do đó, chất lượng hình ảnh sẽ không có nhiều khác biệt so với các model Galaxy S. Thêm vào đó, với chipset hàng đầu hiện nay còn mang đến khả năng xử lý hình ảnh tốt hơn cho điện thoại màn hình gập Galaxy Z Fold 4. Ngoài ra, camera selfie ẩn dưới màn hình của cũng nhận được một số ưu ái từ gã khổng lồ công nghệ Hàn Quốc. Mặc dù chất lượng tổng thể không nhận được nhiều cải thiện, nhưng Samsung đã tối ưu khiến nó khó nhận ra hơn.Galaxy Z Fold 4 được trang bị 2 camera selfie gồm 1 cảm biến đặt dưới màn hình chính có độ phân giải 4MP. Trong khi đó, cảm biến thứ 2 đặt ở màn hình phụ có độ phân giải 10MP mang đến khả năng chụp ảnh tự sướng khá tốt. Nhìn chung, khả năng chụp ảnh trên Galaxy Z Fold 4 chắc chắn sẽ không khiến bạn thất vọng.', NULL, NULL),
(813, 'SSGZ-Fold4', 'Hiệu suất và phần mềm', 'img/Samsung/SSGZ-Fold4/5.jpg', 'Galaxy Z Fold 4 chắc chắn sẽ khiến người hâm mộ hài lòng nhờ một số tính năng đa nhiệm mới tốt hơn. Trong đó bao gồm khả năng, chạy ba ứng dụng cùng một lúc ở chế độ xem chia đôi, thậm chí có nhiều ứng dụng hơn trong cửa sổ bật lên nếu bạn muốn và có một dock cố định chỉ là một vài điểm mới lạ giúp tăng tính đa tác vụ lên 11.Việc hỗ trợ bút S-Pen còn giúp người dùng thoải mái sáng tạo, viết, vẽ, ghi chú ở mọi lúc mọi nơi....tuy nhiên, nó không được tích hợp sẵn bên trong máy mà người dùng cần phải mua riêng. Về phần mềm, điện thoại chạy trên nền tảng Android 12L với giao diện One UI 4.1.1 mới nhất.', NULL, NULL),
(814, 'SSS22', 'Thiết kế đẹp, nhỏ gọn', 'img/Samsung/SSS22/2.jpg', 'Viền cực mỏng, đều tất cả các cạnh là ấn tượng đầu tiên khi cần trên tay chiếc Galaxy S22. Nhìn vào phần viền dưới của màn hình bạn sẽ cảm nhận ngay được sự cao cấp, tinh tế của sản phẩm. Nhờ viền siêu mỏng và kích thước màn hình chỉ 6.1 inch, kích thước tổng thể của Galaxy S22 cực kỳ nhỏ gọn và dễ dàng cầm nắm, thậm chí sử dụng bằng một tay. Trọng lượng của máy cũng khá nhẹ chỉ 167g, nhẹ hơn một chút so với iPhone 13 và nhìn chung là trải nghiệm cầm nắm tốt.Bên cạnh viền mỏng, thiết kế Galaxy S22 còn gây ấn tượng nhờ khung máy nay đã vuông vức hơn. Bộ khung máy được làm bo cong nhẹ vừa đủ cho cảm giác cầm thoải mái, cảm giác cầm khi không đeo ốp lưng tốt hơn nhiều so với iPhone 13.Phần mặt lưng của máy hoàn thiện bằng kính nhám mờ ít bám mồ hôi vân tay nhưng đổi lại dễ trơn, dễ rớt. Cụm camera nay đã đồng màu với mặt lưng cho cảm giác liền lạc hơn. Nhìn chung mình đánh giá cao những thay đổi trên Galaxy S22 so với phiên bản tiền nhiệm, dù khác biệt không quá nhiều nhưng như vậy là quá đủ cho một trải nghiệm tốt.', NULL, NULL),
(815, 'SSS22', 'Hiệu năng ổn nhưng mà… nóng', 'img/Samsung/SSS22/3.jpg', 'Snapdragon 8 Gen 1 nóng không còn là câu chuyện mới, những mẫu smartphone gaming thậm chí phải trang bị cả hệ thống tản nhiệt buồng hơi lẫn quạt quản nhiệt bên trong để duy trì được hiệu suất cho con chip này. Không bất ngờ khi Galaxy S22 rất nóng, bởi nó vừa không có quạt tản nhiệt, vừa có tiết diện nhỏ. Vấn đề về nhiệt độ sẽ là kẻ thù của pin, đồng thời nó sẽ ảnh hưởng nhiều đến trải nghiệm chơi game. Nói về cái sự quá nhiệt thì các bạn có thể xem thử nghiệm stress test với 3DMark dưới đây, trong thử nghiệm này 3DMark chạy 20 lần và ghi lại số điểm sau mỗi lần test. Dễ thấy hiệu năng đã giảm tới gần 50% sau 20 lần (khoảng 20 phút), nhiệt độ tăng nhanh. Sau thử nghiệm, nhiệt độ ở phần gần camera khá cao, tạo cảm giác khó chịu. Khi chơi game thì cũng không khá hơn là bao, chỉ cần chơi PUBG khoảng 15 phút với thiết lập 60fps và HDR thì cả thân máy đều rất nóng. Điểm cộng là trải nghiệm game không bị ảnh hưởng quá nhiều, vẫn đủ mượt nhưng nếu chơi quá nhiều trong tình trạng máy nóng như vậy thì độ bền của máy, đặc biệt là màn hình và viên pin sẽ bị ảnh hưởng nhiều đấy', NULL, NULL),
(816, 'SSS22', 'Camera là một nâng cấp đáng giá', 'img/Samsung/SSS22/4.jpg', 'Năm nay Samsung đã mang đến một thay đổi khá quan trọng trên hệ thống camera của S22 và S22 Plus. Cả hai vẫn có 3 camera sau nhưng camera chính đã tăng từ 12MP lên 50MP, kích thước cảm biến cũng lớn hơn một chút. Trong khi đó camera tele đã giảm từ 64MP xuống 10MP. Tuy nhiên camera tele giờ đã là tele xịn với zoom quang 3X, nếu bạn chưa biết thì trên S21 camera tele chỉ có 1.1x thôi. Camera siêu rộng thì vẫn là 12MP.', NULL, NULL),
(817, 'Xiaomi-11T', 'Thiết kế ngoại hình sang trọng', 'img/Xiaomi/Xiaomi-11T/2.jpg', 'Xiaomi 11T 128GB có thiết kế khung kim loại và cả hai mặt được hoàn thiện từ tấm kính Gorilla Glass Victus để có thể vừa chịu được lực tác động tốt và bảo vệ thiết bị khi có tình trạng va đập hay rơi rớt xảy ra với 2 mặt kính trước và sau vừa tô điểm cho chiếc Xiaomi 11T một vẻ đẹp sang trọng tuyệt đẹp. Các đường viền của điện thoại được tạo hình mỏng, được bo cong nhẹ nhàng rất cân đối ở mặt trước cùng với thiết kế lỗ đục ở mang đến cho điện thoại một vẻ đẹp của dòng smartphone tầm trung và cao cấp ngày nay. Bên cạnh đó, với thiết kế các cạnh bo cong ở tất cả các cạnh mang lại cho thiết bị một cái nhìn khác biệt hơn, phần kính ở mặt sau được bo cong ở tất cả các cạnh mang lại cho điện thoại một cái nhìn khác biệt hơn, trong khi lớp hoàn thiện mờ của khung giúp cải thiện khả năng cầm nắm khá nhiều.', NULL, NULL),
(818, 'Xiaomi-11T', 'Màn hình OLED rộng lớn', 'img/Xiaomi/Xiaomi-11T/3.jpg', 'Có thể nói, một trong những điểm nhấn quan trọng giúp Xiaomi 11T 128GB “lọt vào mắt xanh” của người dùng nằm ở chiếc màn hình rộng 6,67 inch. Hiện nay trên thị trường, người dùng đang có xu hướng ưa thích sử dụng những chiếc smartphone có màn hình rộng và Xiaomi 11T hoàn toàn có thể đáp ứng được điều này. Xiaomi 11T 128GB được trang bị màn hình với công nghệ OLED, cung cấp tốc độ làm mới lên đến 120Hz, tốc độ lấy mẫu cảm ứng 480Hz, độ tái tạo màu 10 bit, hỗ trợ thêm HDR10+ và sở hữu độ sáng màn hình tối đa lên đến 1000 nits. Bên cạnh đó Xiaomi 11T cũng đi kèm với tính năng Màu sắc thích ứng (phiên bản True Tone của Xiaomi), đây có thể là một lợi ích tuyệt vời. Với thông số như vậy, người dùng không chỉ có một chiếc màn hình rộng mà còn có thể đem đến cho bạn những hình ảnh hiển thị nằm ở mức sắc sảo, cực kì chi tiết. Người dùng có thể thoải mái làm việc, lướt web, coi phim, chơi game, v,v với trải nghiệm hài lòng nhất.', NULL, NULL),
(819, 'Xiaomi-11T', 'Cấu hình của Xiaomi 11T 128GB được cung cấp sức mạnh ấn tượng', 'img/Xiaomi/Xiaomi-11T/4.jpg', 'Xiaomi 11T 128GB được trang bị một con chip mạnh mẽ đến từ nhà MediaTek xuất sức ở Đài Loan. Chipset Dimensity 1200, bộ vi xử lý được sản xuất dựa trên tiến trình 6nm đầu tiên của hãng và cũng là dòng vi xử lý đầu tiên của MediaTek sử dụng bộ nhân Cortex-A78. CPU của Dimensity 1200 sử dụng cấu hình 1+3+4, có tổng cộng 8 lõi. Đầu tiên là lõi Cortex-A78 chạy ở tốc độ 3.0 GHz, tiếp đến là ba lõi Cortex-A78 khác ở tốc độ 2.6 GHz và cuối cùng là 4 lõi Cortex-A55 tiết kiệm năng lượng chạy ở tốc độ 2.0 GHz. Hơn thế nữa, người dùng cũng có thể mong đợi một bộ vi xử lý có CPU sẽ nhanh hơn tới 22% và cũng tiết kiệm điện hơn 25% so với thế hệ trước. Chipset sử dụng modem 5G tích hợp cùng công nghệ UltraSave 5G (2CC) được phân chia theo tần số (FDD) và phân chia thời gian (TDD), chia sẻ quang phổ động (DSS), SIM kép 5G (5G SA + 5G SA) và thoại kép cho radio (VoNR). Chipset có khả năng tiết kiệm điện năng tối đa, hỗ trợ người dùng kết nối 5G độc lập và không độc lập ở mức cao nhất.', NULL, NULL),
(820, 'Xiaomi-11T', 'Cụm camera hoạt động ổn định', 'img/Xiaomi/Xiaomi-11T/5.jpg', 'Về mặt camera của máy, Xiaomi đang sử dụng cho Mi 11T của mình một camera chính có cảm biến 108MP  0,7µm pixel, ống kính này có tiêu cự tương đương 24mm ở khẩu độ f / 1.75, nhưng không có OIS. Một mô-đun tele 5MP nhưng mô-đun này chỉ được sử dụng để chụp macro, không thể sử dụng để phóng to thực tế. Cuối cùng, là một ống kính siêu rộng 8MP với khẩu độ f / 2.2 và trường nhìn 120°. Camera của máy có thể tự động lấy nét ở khoảng cách là 3cm. Đối với thông số máy ảnh,nhìn chung Xiaomi 11T 128GB không sở hữu một camera có độ kỹ thuật quá cao, nhưng chúng vẫn có thể đảm bảo rằng smartphone vẫn sẽ có tính năng quay phim Full HD và chụp hình vẫn chất lượng ảnh ở mức ổn định, rõ ràng và sắc nét. Ngoài ra, Xiaomi 11T cũng được hỗ trợ một camera selfie 16MP 1/3.06\" và khẩu độ f/2.4 đem đến trải nghiệm chụp ảnh tự sướng hay gọi video cho người thân bạn bè khá tốt.', NULL, NULL),
(821, 'Xiaomi-12-5G', 'Cầm nắm cực kỳ thoải mái', 'img/Xiaomi/Xiaomi-12-5G/2.jpg', 'Ấn tượng đầu tiên khi mình nhìn điện thoại Xiaomi 12 5G là nó quá đẹp, các chi tiết được hoàn thiện một cách tỉ mỉ, cạnh viền được bo cong mềm mại và không thấy xuất hiện chi tiết thừa. Bộ khung kim loại cứng cáp cùng mặt lưng kính cao cấp được hoàn thiện nhám mang lại khả năng hạn chế bám dấu vân tay, cũng như cho ra cảm giác cầm nắm rất thoải mái và chắc chắn. Xiaomi 12 đi ngược với xu hướng thiết kế vuông vức hiện nay nhằm mang đến cho người dùng trải nghiệm cầm nắm thoải mái nhất có thể, khi hai cạnh bên được hãng bo cong một cách mềm mại. Máy mang đến cho mình cảm giác rất êm ái khi sử dụng, tình trạng cấn tay gần như không xuất hiện cho dù sử dụng liên tục trong khoảng thời gian dài, cử chỉ vuốt màn hình từ cạnh ngoài vào trong trở nên nhanh chóng và trơn mượt hơn nhờ viền màn hình bo cong. Cụm loa được bố trí riêng lẻ ở hai đầu thiết bị cùng công nghệ âm thanh Dolby Atmos, cho ra trải nghiệm giải trí khi chơi game hay xem phim một cách sống động hơn.', NULL, NULL),
(822, 'Xiaomi-12-5G', 'Nhìn đã mắt với màn hình sắc nét', 'img/Xiaomi/Xiaomi-12-5G/3.jpg', 'Xiaomi 12 được trang bị tấm nền AMOLED có kích thước 6.28 inch, mang lại màu sắc rực rỡ, hiển thị vùng tối có chiều sâu hơn cùng một không gian trình chiếu rộng lớn, giúp mình trải nghiệm các tác vụ xem phim, chơi game cực kỳ đã mắt. Trước lúc cầm qua máy thì mình khá hụt hẫng khi biết độ phân giải màn hình trên Xiaomi 12 được “cải lùi” so với thế hệ tiền nhiệm, nhưng khi cầm thiết bị trên tay thì mình thấy máy hiển thị rất chi tiết và gần như không kém cạnh quá nhiều so với điện thoại Xiaomi 11 (màn hình 2K+). Được biết, thì đây là do kích thước màn hình của Xiaomi 12 nhỏ hơn giúp mật độ điểm ảnh tăng cao lên đến 419 ppi, kết hợp cùng những công nghệ hiển thị tiên tiến được nâng cấp, cho ra hình ảnh vô cùng sắc nét và đẹp mắt. Xiaomi 12 có các thông số về màu sắc như: Công nghệ True Color, độ bao phủ màu DCI-P3, cùng khả năng hiển thị 68 tỷ màu, đem lại độ chính xác về màu khá cao giúp mình an tâm hơn trên các công việc chỉnh sửa hình ảnh, hỗ trợ việc in ấn cực tốt. Hỗ trợ tần số quét 120 Hz mang lại cho mình cảm giác vuốt chạm rất trơn tru cho các tác vụ lướt web, đa nhiệm hay chơi game với hình ảnh hiển thị trông mượt mà và bắt mắt hơn.', NULL, NULL),
(823, 'Xiaomi-12-5G', 'Máy trang bị 3 camera có độ phân giải cao', 'img/Xiaomi/Xiaomi-12-5G/4.jpg', 'Ở chế độ chụp ảnh 50 MP cho ra các bức hình có độ chi tiết cao, màu sắc được tái hiện chân thực, ảnh sau khi zoom vẫn mang một chất lượng khá ổn, hỗ trợ cho việc hậu kỳ ảnh một cách tốt hơn. Máy mang lại các bức ảnh chụp ở buổi tối rất tốt nhờ ống kính chính có diện tích lớn giúp thu được nhiều ánh sáng hơn, để nâng cao chất lượng thì mình có bật \"Chế độ chụp đêm\" giúp bức ảnh thu lại có độ chính xác về màu sắc cao hơn mà không bị hòa vào với nhau, hiện tượng lóe sáng cũng được cải thiện đáng kể. Nhờ trang bị camera góc siêu rộng 13 MP nên kết quả thu được có độ bao quát rộng lớn và sắc nét hơn, các góc của bức ảnh được máy xử lý khá tốt khi vật thể và quang cảnh không bị bóp méo quá nhiều làm mất đi tính chân thực. Camera thứ 3 mà hãng trang bị là camera macro 5 MP giúp mình có được các bức hình chụp cận có độ chi tiết tốt, bắt nét nhanh và màu sắc mang lại rất chân thực. Phần mặt trước trang bị camera selfie độ phân giải lên đến 32 MP, nước ảnh rất trong trẻo, màu da được tái tạo chân thực mà không bị bệt, cho ra những tấm hình làm mình cảm thấy rất là ưng ý.', NULL, NULL);
INSERT INTO `baiviets` (`id`, `MaDT`, `tieude`, `img`, `noidung`, `created_at`, `updated_at`) VALUES
(824, 'Xiaomi-12-5G', 'Trải nghiệm mượt hầu hết các tác vụ', 'img/Xiaomi/Xiaomi-12-5G/5.jpg', 'Cung cấp sức mạnh cho Xiaomi 12 là con chip thuộc top đầu trên bảng xếp hạng chipset mạnh mẽ dành cho smartphone (04/2022) đến từ nhà Qualcomm mang tên Snapdragon 8 Gen 1 8 nhân. Để kiểm chứng sức mạnh trên máy thì mình có test qua hai phần mềm đo hiệu năng với số điểm như sau: 1205 (đơn nhân), 3405 (đa nhân) trên Benchmark và 12936 điểm cho ứng dụng PCMark. Với mức hiệu năng khủng như vậy giúp cho thiết bị thừa sức mang đến những trải nghiệm mượt mà trên các công việc hàng ngày như lướt web, xem phim, đọc tin tức. Để đi sâu vào khả năng xử lý trên máy mạnh mẽ đến đâu thì mình đã chơi game trên Xiaomi qua 2 trò chơi phổ biến hiện nay như Liên Quân Mobile và PUBG Mobile, được xem là hai tựa game đòi hỏi về hiệu năng khá cao ở thời điểm hiện tại. Đầu tiên là Liên Quân Mobile, mình chơi với mức cấu hình cao nhất, hình ảnh hiển thị vô cùng đẹp mắt, đổ bóng nhân vật chân thực, không xuất hiện tình trạng khựng hay giật lag, tuy nhiên máy nóng lên khá nhanh khi chơi khoảng từ 15 - 20 phút ở mức cấu hình cao như vậy. Tiếp theo đó là tựa game PUBG Mobile với mức đồ họa tối đa có thể bật được là Ultra HD cùng tốc độ khung hình cực cao, mang lại hình ảnh sống động và chân thực, giúp mình nhận diện được kẻ địch ở khoảng cách xa, quan sát rõ nét từng chuyển động của đối thủ. Tình trạng khựng nhẹ đôi lúc vẫn còn xuất hiện nhưng không đáng kể với tốc độ khung hình dao động loanh quanh 40 FPS, máy khá nóng ở vị trí gần cụm camera khi chơi lâu, để cho thiết bị được mát mẻ thì mình có chuyển mức cấu hình xuống HDR, cho thấy máy hoạt động ở mức FPS cao hơn, ổn định hơn và nhiệt độ cũng giảm đi đáng kể. Điện thoại có RAM 8 GB đem lại khả năng xử lý đa nhiệm phải gọi là “mướt mườn mượt”, khựng máy khi mở nhiều ứng dụng cùng một lúc là điều dường như không xuất hiện ở sản phẩm này trong lúc mình sử dụng.', NULL, NULL),
(825, 'Xiaomi-12-5G', 'Thời lượng sử dụng lâu dài', 'img/Xiaomi/Xiaomi-12-5G/6.jpg', 'Điện thoại trang bị viên pin có dung lượng 4500 mAh được xem là khá ổn, đáp ứng thời lượng on screen hơn 7 tiếng* cho các tác vụ chơi game, lướt YouTube, Facebook và sử dụng trình duyệt. Với công nghệ sạc nhanh 67 W có khả năng lấp đầy viên pin từ 0 - 100% chỉ trong 50 phút*, giúp bạn quay lại công việc hay các tác vụ giải trí một cách nhanh chóng mà không mất quá nhiều thời gian chờ đợi.', NULL, NULL),
(826, 'Xiaomi-12T-5G', 'Ấn tượng với diện mạo sang trọng', 'img/Xiaomi/Xiaomi-12-5G/2.jpg', 'Xiaomi 12T có thiết kế khá tương đồng với thế hệ tiền nhiệm, mặt lưng được làm bo cong ở hai cạnh kèm theo một dòng chữ “Xiaomi” bố trí ở góc dưới phần thân máy. Một thay đổi rõ rệt để người dùng có thể nhận biết được chiếc Xiaomi 12T nằm ở phần cụm camera, ống kính chính sẽ không được làm hình tròn như trên phiên bản Xiaomi 12 mà giờ đây hãng đã thiết kế nó dưới dạng một ô vuông trông khá là cứng cáp.', NULL, NULL),
(827, 'Xiaomi-12T-5G', 'Đáp ứng tốt mọi nhu cầu giải trí nhờ màn hình chất lượng', 'img/Xiaomi/Xiaomi-12-5G/3.jpg', 'Về phần màn hình thì có thể Xiaomi 12T sẽ được trang bị một tấm nền AMOLED có kích thước 6.67 inch và độ phân giải nằm ở mức 1220 x 2712 Pixels. Là một chiếc điện thoại flagship nên việc trang bị một màn hình có tần số quét 120 Hz là điều hiển nhiên trên chiếc Xiaomi 12T. Ở Xiaomi 12T thì ta có thể dễ dàng nhận thấy phần màn hình của máy sẽ không còn làm bo cong như thế hệ trước, có lẽ đây là cách mà nhà Xiaomi đã tối ưu đi để cắt giảm quy trình sản xuất nhằm mang đến một mức giá bán phù hợp hơn đối với người dùng điện thoại Android.', NULL, NULL),
(828, 'Xiaomi-12T-5G', 'Thỏa sức sáng tạo nội dung hình ảnh với camera đầy chất lượng', 'img/Xiaomi/Xiaomi-12-5G/4.jpg', 'Ở phiên bản Xiaomi 12 trước đó với camera chính có độ phân giải tuy chỉ nằm ở mức 50 MP nhưng lại mang đến chất lượng ảnh chụp cực kỳ sắc nét, còn đối với phiên bản Xiaomi 12T lần này sẽ được nâng cấp độ phân giải lên đến 108 MP giúp cho chiếc máy mang lại sự đột phá.', NULL, NULL),
(829, 'Xiaomi-12T-5G', 'Hiệu năng cực khủng đến từ chipset nhà MediaTek', 'img/Xiaomi/Xiaomi-12-5G/5.jpg', 'Lần ra mắt sản phẩm sắp tới đây của nhà Xiaomi không chỉ giới thiệu đến cho người dùng một siêu phẩm smartphone, mà đây cũng là một dịp để ta có thể chiêm ngưỡng được sức mạnh cực khủng trên con chip Dimensity 8100 Ultra mới nhất đến từ nhà MediaTek.', NULL, NULL),
(830, 'Xiaomi-12T-5G', 'Hỗ trợ sạc siêu tốc', 'img/Xiaomi/Xiaomi-12-5G/6.jpg', 'Ở thế hệ điện thoại Xiaomi dòng Mi trước đó cụ thể như chiếc 11T Pro, khi được ra mắt vào tháng 10 năm ngoái thì máy đã khiến đông đảo các tín đồ công nghệ tại thời điểm đó không khỏi ngỡ ngàng trước sự nâng cấp đáng kể về công suất sạc lên tới 120 W. Và hiển nhiên trên phiên bản dòng T mới nhất này vẫn được tích hợp công nghệ sạc pin siêu tốc, Xiaomi 12T quả là một chiếc điện thoại cực kỳ đáng sắm dành cho các tín đồ công nghệ thường xuyên chơi game hay làm việc trên điện thoại, chỉ cần mất một khoảng thời gian ngắn là máy đã có thể sạc đầy được viên pin. Trong buổi ra mắt này, có thêm phiên bản Xiaomi 12T Pro 5G, với cấu hình nổi bật không kém như camera chính có độ phân giải đến 200 MP tích hợp OIS, sử dụng CPU Snapdragon 8+ Gen 1 cùng viên pin 5000 mAh và công nghệ sạc nhanh 120 W.', NULL, NULL),
(831, 'Xiaomi-12T-Pro-5G', 'Xiaomi 12T Pro cấu hình siêu khủng, ổn định, thời trang', 'img/Xiaomi/Xiaomi-12T-Pro-5G/2.jpg', 'Xiaomi 12T Pro là mẫu smartphone thuộc phân khúc cận cao cấp mà Xiaomi muốn ra mắt thị trường trong năm nay. Bên cạnh thiết kế thời trang thì Xiaomi 12T Pro còn mang tới cho người dùng trải nghiệm siêu đỉnh nhờ con chip mạnh mẽ bậc nhất hiện nay. Dưới đây là chi tiết về mẫu smartphone nhà Xiaomi.', NULL, NULL),
(832, 'Xiaomi-12T-Pro-5G', 'Màn hình Xiaomi 12T Pro nổi bật, thiết kế cuốn hút', 'img/Xiaomi/Xiaomi-12T-Pro-5G/3.jpg', 'Điện thoại Xiaomi 12T Pro được trang bị màn hình mỏng nhẹ tối giản và vô cùng đẹp mắt. Điện thoại có độ phân giải màn hình 6.67 inch Full HD+ cùng với đó là tấm nền AMOLED DotDisplay chất lượng. Tất cả sẽ mang tối cho người dùng chất lượng hình ảnh vô cùng hoàn mỹ với độ chính xác màu cao. Đặc biệt màn hình được trang bị tần số quét lớn lên tới 120 Hz. Nhờ trang bị mạnh tay này màn hình mang đến cho người dùng tốc độ phản hồi nhanh chóng mọi thao tác vuốt chạm được diễn ra một cách mượt mà. Đặc biệt hình ảnh không bị trễ khi người dùng đắm chìm trong những game đồ họa cực mạnh. Về tổng thể thiết kế Xiaomi 12T Pro sở hữu thân máy khá gọn gàng và bóng bẩy nhờ mặt lưng được thiết kế mềm mại và phủ lớp kính cường lực Corning Gorilla Glass 5. Phần thân của máy được hoàn thiện nguyên khối cao cấp không chỉ mang tới cảm giác cầm nắm chắc chắn mà còn góp phần giúp gia tăng độ bền. Khả năng chống nước và chống bụi bẩn khá ổn nước người dùng có thể thoải mái sử dụng trong mọi điều kiện thời tiết khác nhau ngay cả khi sử dụng dưới trời mưa.', NULL, NULL),
(833, 'Xiaomi-12T-Pro-5G', 'Vi xử lý siêu đỉnh với chip Snapdragon 8+ Gen 1', 'img/Xiaomi/Xiaomi-12T-Pro-5G/4.jpg', 'Không chỉ ấn tượng ở thiết kế  Xiaomi 12T Pro còn khiến người dùng khá bất ngờ về hiệu năng vô cùng mạnh mẽ và bất tận. Máy được trang bị bộ vi xử lý Snapdragon 8+ Gen 1 kết hợp với hỗ trợ mạng 5G cho người dùng sức mạnh thoải mái để tự tin chiến mọi trận game đồ họa trên thị trường hiện nay mà không lo giật lag. Đây được đánh giá là vi xử lý mạnh mẽ nhất đến từ Qualcomm ở thời điểm hiện tại với 8 nhân và được sản xuất dựa trên tiến trình 4nm xung nhịp lên đến 3.2GHz. Không chỉ vậy, khả năng tản nhiệt và mức tiêu thụ điện năng được cải tiến so với thế hệ Snapdragon Gen 1. Máy cũng được hỗ trợ dung lượng ram 12GB và ổ cứng lên tới 256 GB. Xiaomi 12T Pro được vận hành trên giao diện riêng của nhà sản xuất Xiaomi - giao diện MIUI 13 hoạt động trên nền Android 12. Bên cạnh đó là công nghệ 5G, hỗ trợ wi-fi 6, công nghệ bluetooth 5.2 và phương thức bảo mật vân tay dưới màn hình vô cùng tiện lợi.', NULL, NULL),
(834, 'Xiaomi-12T-Pro-5G', 'Camera đỉnh cao với cảm biến lên đến 200 MP', 'img/Xiaomi/Xiaomi-12T-Pro-5G/5.jpg', 'Ngoài thiết kế và hiệu năng thì Xiaomi 12T Pro còn nổi bật bởi khả năng chụp ảnh đỉnh cao. Nhờ cụm camera phía sau với camera chính có độ phân giải lên tới 200 MP. Đây được cho là sản phẩm đầu tiên của Xiaomi sử dụng cảm biến hiện đại và giúp cạnh tranh với các thương hiệu khác trong cùng phân khúc giá. Bên cạnh đó, cảm biến hình ảnh siêu lớn 1/1,22\" cho ra hình ảnh chi tiết, sắc nét tốt. Kết hợp cùng với nó là các thuật toán thông minh để mang tới khả năng xử lý ánh sáng môi trường tốt hơn giúp cho ra những bức ảnh hoàn hảo hơn. Bên cạnh đó là khả năng lấy sáng tốt giúp chụp ảnh trong điều kiện thiếu sáng cũng trở nên vô cùng ấn tượng. Không chỉ ấn tượng với độ phân giải của camera chính mà trên camera selfie cũng mang tới cho người dùng những bức ảnh đẹp mắt và cho phép video với chất lượng siêu đỉnh nhờ độ phân giải 20 MP. Chắc chắn rằng với những người đam mê chụp ảnh và sống ảo thì đây là một công cụ vô cùng tuyệt vời.', NULL, NULL),
(835, 'Xiaomi-12T-Pro-5G', 'Pin siêu khủng, sạc nhanh công suất lớn', 'img/Xiaomi/Xiaomi-12T-Pro-5G/6.jpg', 'Cũng như trên các phiên bản trước đó Xiaomi 12T Pro cho bạn thoải mái giải trí và liên lạc cả ngày nếu viên pin dung lượng 5000 mAh. Viên pin dung lượng lớn kết hợp với sự tối ưu điện năng của con chip giúp mày có khả năng tiết kiệm điện năng hoàn hảo. Hơn nữa người dùng cũng có thể thoải mái trải nghiệm và sử dụng nhờ máy được trang bị công nghệ sạc nhanh siêu tốc với công suất lớn 120W. Giờ đây bạn có thể gia tăng thời gian sử dụng và tiết kiệm được tối đa thời gian sạc.', NULL, NULL),
(836, 'Xiaomi-Redmi-10A', 'Điện thoại Xiaomi Redmi 10A - Chiếc điện thoại giá rẻ cho học sinh, phụ huynh', 'img/Xiaomi/Xiaomi-Redmi-10A/2.jpg', 'Xiaomi Redmi 10A là chiếc điện thoại nằm trong phân khúc giá trẻ phù hợp cho những bạn học sinh hoặc bậc phụ huynh. Chiếc smartphone có dung lượng pin cực khủng cùng với hiệu năng ổn định đáp ứng các tác vụ cơ bản như lướt web, xem phim, nghe nhạc hoặc chơi các tựa game đơn giản. Để quyết định có nên mua chiếc điện thoại này hay không thì bạn đừng bỏ qua những đánh giá hữu ích dưới đây nhé.', NULL, NULL),
(837, 'Xiaomi-Redmi-10A', 'Thiết kế mỏng nhẹ, trẻ trung', 'img/Xiaomi/Xiaomi-Redmi-10A/3.jpg', 'Điện thoại Xiaomi Redmi 10A sở hữu một thiết kế trẻ trung, nhẹ nhàng khi sở hữu trọng lượng 194g. Các cạnh được thiết kế bo cong mang đến cho người dùng cảm giác cầm nắm chắc chắn, dễ dàng hơn ngay cả khi không sử dụng ốp lưng vẫn không sợ bị trơn, trượt. Thiết bị được nhà Xiaomi trang bị đa dạng phiên bản màu gồm: bạc, xám than chì và xanh nước biển người dùng thoải mái lựa chọn màu sắc phù hợp với mệnh hoặc là cá tính của bản thân.', NULL, NULL),
(838, 'Xiaomi-Redmi-10A', 'Màn hình rộng lên đến 6.53 inches tích hợp giọt nước', 'img/Xiaomi/Xiaomi-Redmi-10A/4.jpg', 'Smartphone Xiaomi Redmi 10A được trang bị màn hình lên đến 6.53 inches cùng với tấm nền IPS cho khả năng hiển thị và tái tạo màu chân thực. Với thiết kế màn hình mỏng tích hợp với giọt nước tạo nên một ngoại hình độc đáo và mang đến trải nghiệm rộng rãi cho người dùng. Đây sẽ là màn hình phù hợp cho bậc phụ huynh đọc báo, xem phim hoặc là những em nhỏ cũng có thể học trực tuyến với màn hình dễ nhìn, giúp các em nhỏ học tập tốt hơn.', NULL, NULL),
(839, 'Xiaomi-Redmi-10A', 'Hiệu năng hoạt động ổn định trong tầm giá', 'img/Xiaomi/Xiaomi-Redmi-10A/5.jpg', 'Điện thoại Xiaomi Redmi 10A hoạt động ổn định với con chip MediaTek G25 8 nhân với tốc độ 4 nhân 2.0 GHz  và 4 nhân 1.5 GHz. Với tốc độ này, người dùng có thể chơi các trò chơi cơ bản như: Subway, PUBG, liên quân mobile,... Ngoài việc hiệu năng hoạt động ổn định thì máy cũng được trang bị bộ nhớ RAM 2GB cùng với bộ nhớ trong 32GB. Tuy không quá lớn nhưng nó phù hợp với tầm giá, và bạn hoàn toàn có thể dễ dàng mở rộng không gian lưu trữ lên đến 1TB với thẻ nhớ microSD. Như vậy là bạn đã có thể lưu trữ, hình ảnh, âm thanh, tài liệu cũng như dễ dàng tải các ứng dụng về máy.', NULL, NULL),
(840, 'Xiaomi-Redmi-10A', 'Camera đáp ứng nhu cầu sáng tạo cơ bản của người dùng', 'img/Xiaomi/Xiaomi-Redmi-10A/6.jpg', 'Với bộ đôi camera phía sau có độ phân giải lần lượt 13 MP và 2 MP tuy không quá lớn nhưng nó vẫn đáp ứng được những nhu cầu chụp hình cơ bản cho người dùng. Bạn có thể nhanh chóng chụp lại những khoảnh khắc bên người thân, bạn bè, người yêu ở mức chi tiết nhất. Hoặc bạn cũng có thể dễ dàng ghi lại những hình ảnh tài liệu hỗ trợ tối đa trong việc học tập của con em.', NULL, NULL),
(841, 'Xiaomi-Redmi-10A', 'Thời lượng pin 500mAh cho phép sử dụng dài lâu', 'img/Xiaomi/Xiaomi-Redmi-10A/7.jpg', 'Đây là sản phẩm được sinh ra nhằm đáp ứng nhu cầu giải trí của người dùng nên chắc chắn dung lượng pin sẽ là điều đáng quan tâm. Xiaomi Redmi 10A được trang bị viên pin lên đến 5000mAh cho phép người dùng trải nghiệm giải trí cả ngày dài mà không lo ngại đến việc hết pin. Ngoài ra, với công nghệ sạc nhanh 10W sẽ giúp bạn sạc thiết bị nhanh hơn và tiết kiệm được phần nào thời gian sạc.', NULL, NULL),
(842, 'Xiaomi-Redmi-10A', 'Tích hợp những công nghệ hiện đại, hữu ích', 'img/Xiaomi/Xiaomi-Redmi-10A/8.jpg', 'Nhằm tăng cường bảo mật và mở khóa nhanh chóng, Xiaomi Redmi 10A cũng được trang bị công nghệ vân tay và mở khóa bằng gương mặt cho người dùng. Tuy là một sản phẩm ở phân khúc giá rẻ, nhưng máy vẫn được trang bị đầy đủ những tính năng hiện đại. Đây là tính năng không phải sản phẩm nào cùng phân khúc giá cũng làm được.', NULL, NULL),
(843, 'Xiaomi-Redmi-10C', 'Điện thoại Xiaomi Redmi 10C - Hiệu năng \"khủng\" trong tầm giá phải chăng', 'img/Xiaomi/Xiaomi-Redmi-10C/2.jpg', 'Xiaomi vừa cho ra mắt thêm một lựa chọn smartphone tuyệt vời trong phân khúc phổ thông: điện thoại Xiaomi Redmi 10C với màn hình lớn, hiệu năng \"khủng\" kèm thời lượng pin dài sẽ giúp người dùng công nghệ có được chiếc smartphone thích hợp cho năm 2022.', NULL, NULL),
(844, 'Xiaomi-Redmi-10C', 'Gọn nhẹ, năng động và có màn hình lớn', 'img/Xiaomi/Xiaomi-Redmi-10C/3.jpg', 'Được thiết kế cho phân khúc phổ thông, Xiaomi Redmi 10C mang ngoại hình trẻ trung và năng động, sẵn sàng đáp ứng mọi thao tác sử dụng thường ngày của bạn. Xiaomi Redmi 10C có thiết kế linh hoạt với trọng lượng nhẹ và độ mỏng tốt để bạn luôn cầm máy thoải mái trên tay. Mặt lưng Xiaomi Redmi 10C được chế tạo với họa tiết đường vân đặc biệt giúp thiết bị ngăn bám vân tay hiệu quả, lưu giữ vẻ đẹp và màu sắc của máy. Điện thoại Xiaomi Redmi 10C đáp ứng tốt nhu cầu giải trí với màn hình lớn tận 6.71 inch cho độ phân giải sắc nét Full HD Plus (2340 x 1080). Thiết kế màn hình notch \"giọt nước\" quen thuộc giúp màn hình Xiaomi Redmi 10C có tỷ lệ hiển thị lớn, cùng với viền bezel thu hẹp hai bên giúp tạo nên hình ảnh cực chất lượng, giải trí thêm hấp dẫn.', NULL, NULL),
(845, 'Xiaomi-Redmi-10C', 'Cụm camera kép độ phân giải cao hỗ trợ chụp ảnh chuyên sâu', 'img/Xiaomi/Xiaomi-Redmi-10C/4.jpg', 'Điện thoại Xiaomi Redmi 10C được nâng cấp camera sau tốt hơn đời Redmi 9C trước đó. Cụ thể, chiếc máy trang bị bộ hai camera sau, cùng nhiều thuật toán thông minh giúp xử lý ảnh chính xác với môi trường hơn. Camera chính của Xiaomi Redmi 10C có độ phân giải tận 50MP và được nâng cấp đáng kể về khả năng chụp ảnh môi trường và ảnh thiếu sáng. Camera đo độ sâu 2MP cùng nhiều tính năng chụp ảnh thông minh mang lại khả năng nhiếp ảnh chất lượng. Ở mặt trước Xiaomi Redmi 10C, chiếc máy cũng có thêm camera selfie 5 MP được hỗ trợ thêm tính năng góc rộng thích hợp để selfie cùng nhóm đông. Khả năng tích hợp HDR và làm đẹp bằng thuật toán AI cũng là một điểm cộng đối với camera selfie của Xiaomi Redmi 10C để giúp nổi bật khuôn mặt chủ thể.', NULL, NULL),
(846, 'Xiaomi-Redmi-10C', 'Hiệu năng thuần gaming nhờ vi xử lý Snapdragon 680', 'img/Xiaomi/Xiaomi-Redmi-10C/5.jpg', 'Hiệu năng mạnh mẽ trên Xiaomi Redmi 10C được bảo chứng nhờ vi xử lý Snapdragon 680 hỗ trợ 5G tiên tiến. Với 8 lõi xử lý và tích hợp các công nghệ xử lý thông minh (APU 3.0, HyperEngine 2.0,...), Snapdragon® 680 sẽ giúp Xiaomi Redmi 10C cho bạn trải nghiệm giải trí vô cùng hấp dẫn. Ngoài ra, tùy chọn RAM lên đến 4 GB và bộ nhớ trong lên đến 128 GB cũng là thế mạnh của Xiaomi Redmi 10C. Đặc biệt, Xiaomi Redmi 10C sẽ vận hành trên giao diện MIUI 13 - giao diện tùy biến riêng và cũng là bản mới nhất do Xiaomi phát triển. MIUI 13 sẽ chạy trên nền Android 12 đã được cài đặt sẵn, đảm bảo tính tương thích cao cho máy.', NULL, NULL),
(847, 'Xiaomi-Redmi-10C', 'Giải trí thỏa sức nhờ pin 5000mAh cùng sạc nhanh 18W', 'img/Xiaomi/Xiaomi-Redmi-10C/6.jpg', 'Thế mạnh khác ở điện thoại Xiaomi Redmi 10C chính là thời lượng pin cả ngày của máy. Cụ thể, Xiaomi Redmi 10C trang bị dung lượng pin 5000mAh vốn cung cấp thời lượng sử dụng có thể hơn cả ngày với các tác vụ liên lạc và lướt web, và hơn nửa ngày chơi game liên tục mà không lo cạn pin. Ngoài ra, Xiaomi Redmi 10C cũng có thêm công nghệ sạc tốc độ cao để hỗ trợ tối ưu dung lượng pin \"khủng\" của máy. Công suất sạc nhanh 18W sẽ hỗ trợ Xiaomi Redmi 10C tiếp nhận thêm pin nhanh chóng, phục vụ trọn nhu cầu dùng trong ngày của bạn.', NULL, NULL),
(848, 'Xiaomi-Redmi-Note-11', 'Điện thoại Redmi Note 11 - Lựa chọn hàng đầu phân khúc giá rẻ', 'img/Xiaomi/Xiaomi-Redmi-Note-11/2.jpg', 'Nếu như Redmi Note 10 là một trong những điện thoại tốt nhất ở thời điểm hiện tại với camera tuyệt vời, thiết kế cao cấp cùng mức giá khá ấn tượng thì người dùng lại hi vọng vào phiên bản mới mang tên Redmi Note 11 với những nâng cấp nổi bật. Chắc chắn những thông số xung quanh mẫu điện thoại Xiaomi mới này vẫn đang là một ẩn số đối với người hâm mộ.', NULL, NULL),
(849, 'Xiaomi-Redmi-Note-11', 'Thiết kế mỏng nhẹ, màu sắc thanh lịch', 'img/Xiaomi/Xiaomi-Redmi-Note-11/3.jpg', 'Điện thoại Xiaomi Redmi Note 11 khoác trên mình thiết kế vô cùng thanh lịch và sang trọng. Máy có kích thước nhỏ gọn cùng trọng lượng chỉ khá nhẹ giúp người dùng thoải mái cầm nắm cũng như thao tác trên tay. Bên cạnh khung viền nguyên khối được hoàn thiện bằng chất liệu cao cấp thì mặt trước của Xiaomi Redmi Note 11 được trang bị kính cường lực giúp bảo vệ điện thoại an toàn hơn trước những va chạm khi sử dụng. Điện thoại có khả năng chống nước và bụi bẩn vượt trội với chỉ số IP53. Do đó, bạn hoàn toàn yên tâm khi sử dụng dưới trời mưa hoặc không còn lo lắng trong trường hợp chẳng may đánh rơi vào nước.', NULL, NULL),
(850, 'Xiaomi-Redmi-Note-11', 'Màn hình 6.43 inch, khả năng hiển thị 16 triệu màu, tần số quét 90Hz', 'img/Xiaomi/Xiaomi-Redmi-Note-11/4.jpg', 'Redmi Note 11 được Xiaomi trang bị tấm nền IPS LCD với độ phân phải FHD+ cùng khả năng hiển thị tới 16 triệu màu sẽ mang đến chất lượng hình ảnh vô cùng sống động. Người dùng có thể thoải mái tận hưởng và trải nghiệm những video giải trí hoặc những game đồ hoạ ấn tượng. Bên cạnh đó, kích thước 6.43 inch cùng thiết kế tràn viền giúp mở rộng không gian hiển thị cho người dùng. Tốc độ quét 90Hz mang đến khả năng phản hồi nhanh chóng, thao tác vuốt chạm mượt mà và tiết kiệm tối đa điện năng.', NULL, NULL),
(851, 'Xiaomi-Redmi-Note-11', 'Mạnh mẽ với chipset Snapdragon 680', 'img/Xiaomi/Xiaomi-Redmi-Note-11/5.jpg', 'Xiaomi Redmi Note 11 sở hữu sức mạnh vượt trội với chipset Snapdragon 680. Kết hợp với bộ vi xử lý là dung lượng RAM lớn mang đến tốc độ xử lý dữ liệu nhanh chóng, chính xác và vô cùng mạnh mẽ. Bạn hoàn toàn có thể xử lý mượt mà các tác vụ đa nhiệm cũng như giải trí đỉnh cao với các game đồ hoạ cực hot hiện nay. Đáp ứng tối đa nhu cầu download và lưu trữ dữ liệu của người dùng là bộ nhớ trong dung lượng bộ nhớ trong lớn 64GB. Bạn hoàn toàn yên tâm và không bị lo ngại về tình trạng đầy bộ nhớ. ', NULL, NULL),
(852, 'Xiaomi-Redmi-Note-11', 'Chinh phục mọi khoảnh khắc với cụm camera 50MP', 'img/Xiaomi/Xiaomi-Redmi-Note-11/6.jpg', 'Xiaomi Redmi Note 11 có khả năng chinh phục mọi khoảnh khắc khi được trang bị cụm camera vô cùng ấn tượng. Độ phân giải của ống kính lần lượt là ống kính chính 50MP và camera phụ 8MP. Cùng với đó là hai ống kính macro 2MP và cảm biến đo độ sâu trường ảnh 2MP ở mặt sau và mặt trước 13MP giúp cho mọi tấm ảnh, ngay cả ảnh chụp selfie được trở nên vô cùng sắc nét và sống động. Ngoài ống kính chất lượng thì trên camera còn được trang bị những công nghệ vô cùng hiện đại như: hỗ trợ zoom quang cùng khả năng quay video chất lượng cao mang đến cho bạn những khung hình cực đẹp như được quay bằng thiết bị chuyên nghiệp.', NULL, NULL),
(853, 'Xiaomi-Redmi-Note-11', 'Dung lượng pin 5000 mAh, sạc nhanh 33W', 'img/Xiaomi/Xiaomi-Redmi-Note-11/7.jpg', 'Cung cấp năng lượng cho điện thoại là viên pin có dung lượng vô cùng khủng lên tới 5000mAh. Với dung lượng pin này, Redmi Note 11 mang đến cho bạn cả ngày dài trải nghiệm mà không lo bị ngắt quãng vì hết pin. Cùng với đó, hãng đã trang bị cho máy công nghệ sạc nhanh với công suất 33W. Người dùng có thể nhanh chóng bổ sung năng lượng cũng như tiết kiệm được tối đa thời gian sạc.', NULL, NULL);
